INSERT INTO `ff_slide` VALUES ('1', '1', '2', '完美无瑕', '老戏骨联袂女神 演绎一场无懈可击惊天钻石劫案', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1384150892121.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1384150892090.jpg', 'http://vip.kankan.com/vod/39820.html', '20世纪60年代，英国伦敦。供职于伦敦钻石公司的劳拉·奎恩（黛米·摩尔 Demi Moore 饰）美丽端庄，聪明睿智，工作兢兢业业。但在女性地位尚未得到足够尊重的年代，尤其是这家男性占主导地位的钻石公司，劳拉的付出始终得不到应有回报，升职的机会一次次与之擦肩而过。某天，劳拉应邀和公司的清洁工——即将退休的胡布斯（迈克尔·凯恩 Michael Caine 饰）出来看电影，却得知自己将被公司开除的消息，她的事业瞬时陷入绝地。', '1');
INSERT INTO `ff_slide` VALUES ('2', '2', '2', '惊天魔盗团', '年度最炫酷光影盛宴 魔术师组团光天化日抢银行', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383488200344.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383708148482.jpg', 'http://vip.kankan.com/vod/69258.html', '本片讲述的是FBI与一个世界上最出色的魔术师团队斗智斗勇的故事，这支魔术师团队在表演的同时抢劫银行并把钱分给观众，使他们站在了法律和道德的灰色地带。 \r\n　　卷毛宅男杰西·艾森伯格很可能会加入法国导演路易斯·莱特里尔的新作《看到我了吧》，而杰克·吉伦哈尔也有意加盟此片。本片讲述的是FBI与一个世界上最出色的魔术师团队斗智斗勇的故事，这支魔术师团队在表演的同时抢劫银行并把钱分给观众，使他们站在了法律和道德的灰色地带。', '1');
INSERT INTO `ff_slide` VALUES ('3', '3', '2', '4B青年之4楼B座', '华语版生活大爆炸 苦逼岁月里的爆笑2B囧事', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383746854078.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383790130821.jpg', 'http://vip.kankan.com/vod/73579.html', '四个奇葩男女合租在北京一间4楼B座的公寓内，一个是身为明星助理的炫耀型装逼青年“家毅”，一个是将“乔布斯”奉若神明的理想型二逼青年“张杨”，一个是从事拳击陪练的健康型傻逼青年“奋斗”，还有一个笔耕不辍、郁不得志的文艺型苦逼女青年“丽川”。 \r\n　　4楼B座的故事就就此展开，这是一个大城市的缩影。 \r\n　　人们在苦逼的岁月里，我们挥霍着二逼的青春，与傻逼的朋友追寻着牛逼的梦想，装逼地一路狂奔……', '1');
INSERT INTO `ff_slide` VALUES ('4', '4', '2', '青春盛宴', '干爹、妈咪导演最新作 清纯学生妹沦为外围女', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383872548960.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383876692782.jpg', 'http://vip.kankan.com/vod/74597.html', '以北京娱乐模特界几个女孩的真实经历改编，影片中的四个不同形象的女生也是现实生活里各类型女生的缩影：阳光活泼的笑笑，女神气质的雨桐，玲珑剔透的方玲、天真可爱的董乐。她们在纯真年代的大学时光被温柔的爱着，为了自己纯真的明星梦而努力着，她们曾经说过‘我们一定不会变坏的’，却被无情的现实一次次打败。她们在梦想与现实中挣扎与沉沦，她们在欲望与绝望的悬崖边低头臣服。她们经历欺骗与被骗、挣扎与妥协，她们因为不同原因进入了外围圈，成为别人用金钱买来的“消遣”，在这个圈子里起起伏伏。她们这样的生活因为一个重大的曝光事件而发', '1');
INSERT INTO `ff_slide` VALUES ('5', '5', '2', '极速蜗牛', '梦工厂福克斯强强联手 屌丝蜗牛也能一飞冲天', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383660137252.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383660137212.jpg', 'http://vip.kankan.com/vod/69654.html', '影片讲述了一个菜园蜗牛Turbo抱有一个几乎不可能实现的梦想：成为INDY500汽车大赛的冠军，也就是世界上跑得最快的蜗牛。一次偶然的不寻常事件让他拥有了非凡的速度，Turbo打算让自己的梦想成真。 ', '1');
INSERT INTO `ff_slide` VALUES ('6', '6', '1', '一座城池', '韩寒同名小说改编 解密不可思议的激荡青春韩寒同名小说改编 ', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383374846128.jpg', 'http://img.vip.kankan.kanimg.com/dm_pic/dm/headline/1383374846098.jpg', 'http://vip.kankan.com/vod/73403.html', '《一座城池》描写了一群不羁青年在大学时光里海阔天空的“光辉岁月”，讲述了一群人的荒诞生活。从学校肄业的“我”因为一次群架事件，和朋友“健叔”从上海逃到了一个城镇。健叔是“我”高一年级的同学，我们住在长江旅馆里，整日在这个城市里闲晃。后来认识了新朋友王超，从此，王超和他的桑塔纳就和我们混在了一起。小说中的“我”由房祖名出演，而“健叔”则由王太利出演。讲述了两个“纯屌丝”的荒诞岁月。', '1');
