INSERT INTO `ff_vod` VALUES ('2', '19', '未来的选择[QMV+]', 'HDTV', '', '', '尹恩惠,李东健,郑容和,韩彩雅', '权溪泓', '《未来的选择》是一部以电视台为舞台的穿越剧，该剧讲述了尹恩惠饰演的女主人公遇到未来的自己，并进入电视台改变人生的故事。李东健饰电视台代表，郑容和则演隐瞒真正身份，以VJ身份在电视台工作的CEO。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131015014154.jpg', '韩国', '', '0', '8', '', '1', '1383714775', '7', '0', '0', '0', '0', '1', '1', '7', '2', 'qvod', '', 'qvod://292562844|834DC4059EF65DBA50F44F8473603065043D8769|未来的选择_HDTV_01.QMV|\rqvod://293231568|5F835950BF181DDE45E3457C7ACDFA62E45D0246|未来的选择_HDTV_02.QMV|\rqvod://273031287|4F187B3C67B4330A57A54D39736F5C2A142A67B8|未来的选择_HDTV_03.QMV|\rqvod://274345110|FBA47A2515C654D926F2F7A21A1B6E26A2F66F27|未来的选择_HDTV_04.QMV|\rqvod://277675103|78F4296FC17E2FC1AFF1A7BAB9F8476904A54FB8|未来的选择_HDTV_05.QMV|\rqvod://272989111|525DA805816E65B54E233081F2E2726222FFF264|未来的选择_HDTV_06.QMV|\rqvod://280939396|9C4C8D6616681743210DFC859424601C11C790A2|未来的选择_HDTV_07.QMV|\rqvod://285032851|6EBB7716FCFAF559713FABB68C5A58B57AC94CC6|未来的选择_HDTV_08.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75632', '', 'W', '', '4.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('3', '16', '传爱事务所/法外风云[粤语QMV+]', 'HDTV', '', '', '黎耀祥,陈豪,陈法拉,伍咏薇,马赛,王浩信,高海宁', '徐正康', '本剧主角余英伟及李明扬皆为伶牙俐齿的遗产律师。在法庭上，一次又一次的互相比拼......\r\n    遗产律师的责任就是找出执行逝者的本意，英伟和明扬在“明炉金猪”，“龙头棍”，“真假发妻”等案中较劲，争论遗嘱的本意。“明炉金猪”一案，到底继承烧味传统精神重要？还是将烧味店发扬光大来的重要？“龙头棍”一案，“龙头棍”应该属於社团的公家物品，还是归於逝者的私人财产？后来他们发现，遗嘱内包含了逝者善意的遗愿，只有用善意来诠释，才可以令离世者无憾，在世者无怨。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131014223634.jpg', '香港', '', '0', '20', '', '1', '1384334727', '6', '0', '0', '0', '0', '1', '1', '3', '1', 'qvod', '', 'qvod://258387220|C0DC3DF1F38D8E8FACFF96DB97FF1945464AF065|法外风云.粤语_2013_HDTV_01.QMV|\rqvod://261609118|63659D0438D615A2BB3DE1357BE756917C044CF4|法外风云.粤语_2013_HDTV_02.QMV|\rqvod://237978837|35A1408BB4C9F2619DE4A00AA555F4922888B27D|法外风云.粤语_2013_HDTV_03.QMV|\rqvod://327241226|8EBD64E02E7E97D0512AEDE888AD2068940A7C7E|法外风云.粤语_2013_HDTV_04.QMV|\rqvod://313731503|1248C92A295A6F18DCD31F960C0F86975B3BFE29|法外风云.粤语_2013_HDTV_05.QMV|\rqvod://330313577|9AF11C4D1D7F4399A4B2DFC558DC8B53C671C3C8|法外风云.粤语_2013_HDTV_06.QMV|\rqvod://275374708|67EA1BC4C3040E50D13C566947494DDFB37F7F47|法外风云.粤语_2013_HDTV_07.QMV|\rqvod://292032083|EED749324CD805B489049276E25122DFF99913D1|法外风云.粤语_2013_HDTV_08.QMV|\rqvod://292257760|6619453240B47842FB56DCE5B8C9F87A20B70C09|法外风云.粤语_2013_HDTV_09.QMV|\rqvod://258862038|CC01E5370CC8B737439816197E1DE8138309E069|法外风云.粤语_2013_HDTV_10.QMV|\rqvod://292735368|657F2F95A64BE09B95D08AD9D1BF5B6A3E63F605|法外风云.粤语_2013_HDTV_11.QMV|\rqvod://325476900|67CA3220BF04C8A025C19EC0A3A57AC95934EA9B|法外风云.粤语_2013_HDTV_13.QMV|\rqvod://311925127|E1C53DA66347F788970449DFAF8112872441E0CF|法外风云.粤语_2013_HDTV_12.QMV|\rqvod://296339631|D75E39EEC1C71ED79AC72DA8B1CA386C29810755|法外风云.粤语_2013_HDTV_14.QMV|\rqvod://276179094|DF67D13FF7CC9247AF57BC443B730A4783E53676|法外风云.粤语_2013_HDTV_15.QMV|\rqvod://296268420|9C16EF6C1FB2BF984F11B62FB020AD927A4E2BA2|法外风云.粤语_2013_HDTV_16.QMV|\rqvod://234919139|0E4D5D07EED0B48D5F30F340C4B7BDA54ED5D137|法外风云.粤语_2013_HDTV_17.QMV|\rqvod://295333761|83ACE38BBA563B9A9