INSERT INTO `ff_vod` VALUES ('4', '20', '复仇 第三季[QMV+]', 'HDTV', '', '', '艾米丽·万凯普,加布里埃尔·曼,玛德琳·斯托,乔舒华·鲍曼,尼克·维切斯勒,克丽丝塔·B·艾伦,阿什丽·曼德薇,亨利·科泽尼,贾斯汀·哈特雷', 'Bobby,Roth', '当第三季开始时,Victoria花了大量时间来陪伴刚刚相认的儿子Patrick。她非常爱Patrick,甚至爱到了一种不太合适的程度,这对Emily来说不是好事。Emily对付Victoria的主要手段就是在她和子女之间制造矛盾——她这招对Daniel十分奏效,但对Charlotte不是太成功。现在多了一个Patrick,Emily需要付出更多的努力。Patrick是一个很难被Emily说动的人,或许那是永远不可能的事情。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130930144910.jpg', '欧美', '', '0', '7', '', '1', '1384334690', '0', '0', '0', '0', '0', '1', '1', '9', '6', 'qvod', '', 'qvod://267965252|C27F862D9877252B202FF139EA4A4D3C48DE2D5F|复仇第三季_2013_HDTV_01.QMV|\rqvod://268219993|A180AFE2D47C9494751E764EC682AC0C0BE6EB3D|复仇第三季_2013_HDTV_02.QMV|\rqvod://183817106|0BE2AEEF2D5ED02BAE0E68E9EF7FC8DEFC9BD1EF|复仇第三季_2013_HDTV_03.QMV|\rqvod://264435076|6D1E8B3E8A43D815C7068EDA0ED6073419F10DCF|复仇第三季_2013_HDTV_04.QMV|\rqvod://184578817|FEB46CB52DD1642B9D35576B8F8DEEBC7BD67701|复仇第三季_2013_HDTV_05.QMV|\rqvod://178370760|49479132E979466BC05816BE349A3D50ED49A185|复仇第三季_2013_HDTV_06.QMV|\rqvod://184714563|10BBBB22D008AF1AC7BA38D950B1CE291733790A|复仇第三季_2013_HDTV_07.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75267', '', 'F', '', '4.0', '6', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('5', '15', '我是特种兵之火凤凰/我是特种兵3[QMV+]', 'HDTV', '', '', '徐佳,刘晓洁,程愫,杨舒,赵荀', '刘猛', '21世纪是一个人才和高科技主宰战争的世纪，我军区高层研究决定由雷战带领狼牙特种旅黑鹰突击队去选拔组建一支女子特战队——一支代号为“火凤凰”的奇兵。清华的高材生列兵叶寸心、体工队拳道高手沉兰妮、军医何璐、陆航团的彝族女子曲比阿卓、文工团演员唐笑笑、防化团炊事班的田果、欧阳倩和担任特战队教导员谭晓琳这八名女兵来自于不同部队的不同职位，她们怀揣着各自的理想集结在一起。近乎残忍的训练和实战让她们逐渐蜕变，最终以一个真正军人的姿态重新绽放生命，凤凰涅槃。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131023202205.jpg', '大陆', '', '0', '57', '', '1', '1384334690', '7', '0', '0', '0', '0', '1', '1', '7', '8', 'qvod', '', 'qvod://266036524|1C9E11B9247CF24536A9E9C92BC8505F59A7C1AD|我是特种兵之火凤凰_2013_HDTV_01.QMV|\rqvod://254335476|F92EC081C1472A82FF77BAFE27A651F52F17E201|我是特种兵之火凤凰_2013_HDTV_02.QMV|\rqvod://266508864|E6B638E8BBAE5E772037EC9A1D62FCB3263199CC|我是特种兵之火凤凰_2013_HDTV_03.QMV|\rqvod://277348621|17149D49A434F3B0BDEE9E6F58E586EEC6813E93|我是特种兵之火凤凰_2013_HDTV_04.QMV|\rqvod://278297243|CD8526DFE515F6D51D1915CBF268777E20862E74|我是特种兵之火凤凰_2013_HDTV_05.QMV|\rqvod://307837683|6ADDED5868341139344129CE4933E0E4B19EDB11|我是特种兵之火凤凰_2013_HDTV_06.QMV|\rqvod://259761120|E43845238A42BB1BDE30C486067AB74AEC493486|我是特种兵之火凤凰_2013_HDTV_07.QMV|\rqvod://264208094|DDE10ACD65D8394935BCF3272FCBE95467206EF0|我是特种兵之火凤凰_2013_HDTV_08.QMV|\rqvod://277943922|9BDD9D6B1B5997A9815C53563039000C92AD164D|我是特种兵之火凤凰_2013_HDTV_09.QMV|\rqvod://228092345|BDDAAF6CD5E87796130365215A1F6E05644E9F04|我是特种兵之火凤凰_2013_HDTV_10.QMV|\rqvod://252249203|0ECF14898BFFCF898975BB98364CA6E6EA931B0D|我是特种兵之火凤凰_2013_HDTV_11.QMV|\rqvod://265555803|E1442F008D15F0913694DE96AAF3F41D03D1375B|我是特种兵之火凤凰_2013_HDTV_12.QMV|\rqvod://290408138|926F90A071AFE1910F992AE648472E2B693A8241|我是特种兵之火凤凰_2013_HDTV_13.QMV|\rqvod://270475269|95C863234E629DD6A8CA54AF4C7B7A33EC443A34|我是特种兵之火凤凰_2013_HDTV_14.QMV|\rqvod://285514014|625E7E845A4CCBB5F7521F443026C05B8A88352B|我是特种兵之火凤凰_2013_HDTV_15.QMV|\rqvod://292236676|15F3ED8F8EFB879F097C8F83DA4A940C0112D228|我是特种兵之火凤凰_2013_HDTV_16.QMV|\rqvod://270157301|66BB225FF03D1D38D1CB42EF90C312AF913B9158|我是特种兵之火凤凰_2013_HDTV_17.QMV|\rqvod://274082