INSERT INTO `ff_vod` VALUES ('6', '20', '国土安全第三季/国土安全第三季/反恐危机/暗战[QMV+]', 'HDTV', '', '', '克莱尔·丹妮丝,戴米恩·路易斯,莫瑞娜·巴卡琳', '迈克尔·科斯塔,莱斯利·林卡·格拉特', '一个神经质有躁郁症的CIA女特工凯莉，一个被基地组织囚禁8年后被解救回美国但疑似已被策反的大兵布洛迪，两个性格不讨好、样子不偶像的角色，成为艾美奖、金球奖最佳剧集《国土安全》的灵魂人物。在第一季中，所有人都觉得这场猫捉老鼠的游戏中，凯莉已经陷入万劫不复之地。没想到第二季播完之后，“没啥理由能活下去”的人变成了布洛迪。第一季疑云丛生，第二季变本加厉，每隔两三集都会有个剧情大突破。\r\n    布洛迪在国土安全第二季很快就被凯莉和她的同事索尔发现了真实身份，凯莉成功策反了布洛迪，让其成为CIA打入基地组织的卧底。整个故事主线是凯莉一方如何利用布洛迪提供各种帮助消灭基地头目纳齐尔，但中间夹着更多故事线：布洛迪和家人的关系、布洛迪和凯莉的关系、CIA内部的矛盾等等。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130909172650.jpg', '欧美', '', '0', '6', '', '1', '1383714775', '0', '0', '0', '0', '0', '1', '1', '5', '9', 'qvod', '', 'qvod://353742625|914728D576E8EBDD8E5B9EB885BAC9AAD244D84F|国土安全第三季_2013_HDTV_01.QMV|\rqvod://302991028|505C552E31F81AFAE95358667E0C748AA74E520E|国土安全第三季_2013_HDTV_02.QMV|\rqvod://335536813|2C238AE52E5F5FAB5E285F7D1A6A3B4D56B797E6|国土安全第三季_2013_HDTV_03.QMV|\rqvod://356927751|C9BD877A1F63AA792397BA69CF9F1ADD3EA23C3A|国土安全第三季_2013_HDTV_04.QMV|\rqvod://301544225|624433415A77BE0DC7E9E1EFEA85929D42BB57B1|国土安全第三季_2013_HDTV_05.QMV|\rqvod://312098638|506B59DC2965FF5373B717E908D067B7D58E0F9C|国土安全第三季_2013_HDTV_06.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75348', '', 'G', '', '8.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('7', '8', '背水一战/重击防线/终极封锁线', 'BD', '', '', '阿诺·施瓦辛格', '金知云', '《背水一战》的剧本被描述为“以汽车为主题的《正午》”，讲述了“一名大毒枭驾车以每小时200英里的速度逃离审判，但是在他与自由的墨西哥之间却有一个小镇的警察成为艰难的阻隔”。1952年的《正午》是影史上的经典西部片之一，描写了一名小镇警长在无法寻得助手之下，只身对抗四个前来报仇的恶徒。本片曾在2000年被翻拍成同名电视电影。', 'http://175.6.0.111:8058/vfolder//upimage/201301//20130103165743.jpg', '欧美', '', '0', '0', '', '1', '1383714775', '2', '0', '0', '0', '0', '1', '1', '8', '2', 'qvod', '', 'qvod://1712740237|B804A2C539C0A7DDABC869D70E799CC0DAEB003C|背水一战_BD.mp4|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=70504', '', 'B', '', '7.0', '5', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('8', '15', '千金归来[QMV+]', 'HDTV', '', '', '李易峰,赵文瑄,李威,申敏熙,郑佩佩', '罗灿然', '该剧讲述了当代某沿海城市，一位单纯善良的女孩，在经历了家庭变故后，逐渐成长成为一个自立自强的成熟女性，突破重重障碍实现祖父的理想，并收获爱情的故事。沈长清是沈氏企业的继承人，年幼丧母的她由一心要将沈氏企业占为己有的养父潘伟森与表面温柔实则暗藏阴谋的继母丁雅琴抚养，并处处受到继母的女儿丁佳慧的刁难。沈长清不忍看到祖父的家业及立志慈善的心愿旁落，在生父欧海洋、痴心守护自己的林皓、阳光正直的金睿的帮助下，不断武装自己，成为足以与养父和继母抗衡的商界精英，在一次次的较量后最终守住家业实现祖父的心愿。在经历了重重磨难后，沈长清也看清了自己的心意，和林皓有情人终成眷属。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131030201659.jpg', '大陆', '', '0', '38', '', '1', '1384334690', '8', '1', '1', '1', '1384410501', '1', '1', '1', '3', 'qvod', '', 'qvod://283215568|4FF2005648E0750787BDF91ADB5D05B82DB21C80|千金归来_HDTV_01.QMV|\rqvod://297373104|0540F0D89549D0994C156D88E28292805E728245|千金归来_HDTV_02.QMV|\rqvod://346234043|20A062BCC08129434A5E867B9471DC199783F029|千金归来_HDTV_03.QMV|\rqvod://282936195|40DC0BD0E46E706D2282CCB18A206919A5BF6815|千金归来_HDTV_04.QMV|\rqvod://297968136|69D1C95F87C3C3D13987142FC74A296B101E82BA|千金归来_HDTV_05.QMV|\rqvod://358125052|EEF71E58AF9CBA0475C1990E18F9E8DEA8D0467F|千金归来_HDTV_06.QMV|\rqvod://285338326|8BE518572E879269D78A2550B194CDFD0A680517|千金归来_HDTV_07.QMV|\rqvod://297551724|63C1764FF7868F273EAA7881B8B49DF08A7C3C3D|千金归来_HDTV_08.QMV|\rqvod://342716256|2126596EA25EE252AB4BE0132070203BB1EE52CE|千金归来_HDTV_09.QMV|\rqvod://278061286|F55C39834850DC9E427C586536EAB7083E4B9EF2|千金归来_HDTV_10.QMV|\rqvod://301251742|DEAB8CE8D339AFF8BD988899C015E4FA193BABC2|千金归来_HDTV_11.QMV|\rqvod://277416028|E1D5493FD0AF7947D4EFC07FE4136386296961B6|千金归来_HDTV_12.QMV|\rqvod://300628452|797FB0297CBC957341265A077401B9AFD545A03E|千金归来_HDTV_13.QMV|\rqvod://277478394|80BE7D4BFBFAA59431F818A75FA13CF5D9C2B39F|千金归来_HDTV_14.QMV|\rqvod://296372919|6F5A174FAE21484F31668ED69945AC93063A58EE|千金归来_HDTV_15.QMV|\rqvod://354785051|8DB6E51B5CBE2B4CEAF9ED7BB161F271686AF968|千金归来_HDTV_16.QMV|\rqvod://278761425|D3411FF1036230B662B52A5C77F0484FFC7D4760|千金归来_HDTV_17.QMV|\rqvod://292234797|A747858E5ADAB4ED3238F2645DC5A34EB3E002BD|千金归来_HDTV_18.QMV|\rqvod://356134600|F0DEA50EA5157C66C73A8F38E7BA81