INSERT INTO `ff_vod` VALUES ('11', '15', '走出硝烟的女兵/走出硝烟的女人/走出硝烟[高清版]', 'HDTV', '', '', '赵子惠,颜丙燕,于震,王茜,付磊,李依玲', '赵浚凯', '　　《走出硝烟的女兵》改编自小说《走出硝烟的女神》，该剧讲述的是1948年，硝烟弥漫的关中大地上，在犬牙交错的战场情势下，猛虎营女营长陈大蔓临危受命：护送我军一支身怀六甲的孕妇队紧急转移。几十名怀有身孕的女兵在远离大部队、紧急向后方转移途中，不幸进入敌纵深部，被层层裹挟其间，险象环生。敌军为获取情报，对这支特殊的娘子军步步紧逼，穷追不舍。 陈大蔓和姐妹们不屈不饶，在沟壑山涧、村前屋后、街巷树丛间与敌展开了巧妙的周旋，以无畏的勇气和智慧冲破敌军和土匪的围追堵截，克服了险恶环境下的重重困难，终于走出战争的硝烟，胜利归队。\r\n　　在孕妇队，女主人公陈大蔓邂逅了一个又一个具有传奇色彩的女性。她们中，有早年从事妇女运动的吴娘娘、冰姑大姐，有放弃优裕的物质生活投身革命的富家小姐刘雪鸣，有怀抱着满腔革命热情却不得不承受丈夫叛变革命的屈辱的王梅子；有插足别人的情感生活而受到内心谴责的女文工团员阿霞，也有纯朴善良却遭丈夫抛弃的大脚婶水莲，还有陈大蔓过去恋人的妻子孙志坚…　　', 'http://175.6.0.111:8058/201208/13/20120813143529.jpg', '大陆', '', '0', '32', '', '1', '1383714775', '8', '0', '0', '0', '0', '1', '1', '9', '2', 'qvod', '', 'qvod://429753546|DABAD71E094A367B7AEAEA311D4EB99D6BFB6D7D|走出硝烟的女人_HDTV_01.rmvb| \rqvod://339546954|87A44FD7B479B0509D778F1207410E5F27713523|走出硝烟的女人_HDTV_02.rmvb| \rqvod://349167276|5B1155EA386E1F3E037260A70D11663E1AEAEE96|走出硝烟的女人_HDTV_03.rmvb| \rqvod://385909869|BF01901118815F7B2B4A7691624AC05B109FE0FD|走出硝烟的女人_HDTV_04.rmvb|\rqvod://333475696|7F6066E73D8E4841D35B68880814E8DF66F80B68|走出硝烟的女人_HDTV_05.rmvb|\rqvod://370132298|B2D6652B865F69A0C05B8AE6974D71BD692FB20A|走出硝烟的女人_HDTV_06.rmvb|\rqvod://367342838|CF45050C63C3F8BE393AE0AB016EAD7A8260BFA1|走出硝烟的女人_HDTV_07.rmvb|\rqvod://348433625|4E25D9F67DE8D46B6DFE8A2F950584286CABCA34|走出硝烟的女人_HDTV_08.rmvb|\rqvod://336668096|5F637210953400DCBCE4807C425C6D146E84FAA5|走出硝烟的女人_HDTV_09.rmvb|\rqvod://335906694|7C92B907151895DD06D8F5336D10FDBB75AC3705|走出硝烟的女人_HDTV_10.rmvb|\rqvod://327132156|5B4E3373070B00CFCADC5DB2D4233F7E505F97C4|走出硝烟的女人_HDTV_11.rmvb|\rqvod://300916000|857D59DBA39AEBA2D074C7E6AB1E9D00231BD4BA|走出硝烟的女人_HDTV_12.rmvb|\rqvod://365636784|92DBC3269B83D0527F3EAC0B350D32F5CF2157E8|走出硝烟的女人_HDTV_13.rmvb|\rqvod://300963609|2E603D043AF95D31F7D2EF46106DE515A9C2B09E|走出硝烟的女人_HDTV_14.rmvb|\rqvod://340818927|188CE0C76EFB5743AAFEEA23AA17BF70F4FAD22D|走出硝烟的女人_HDTV_15.rmvb|\rqvod://301064050|1D5004FE12C394C6CE03F5E30697CDF2A7C614F5|走出硝烟的女人_H