INSERT INTO `ff_vod` VALUES ('12', '14', '逼上梁山[微电影]', 'DVD', '', '', '未知', '未知', '倔强的老爸自命清高，有情人难成眷属；机灵的朋友男扮女装，以彼之道还施彼身；忍俊不禁的场景，啼笑皆非的情节。结局到底如何？敬请收看8毫米栏目电影《逼上梁山》！', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106105445.jpg', '大陆', '', '0', '0', '', '1', '1383714775', '9', '0', '0', '0', '0', '1', '1', '4', '3', 'qvod', '', 'qvod://63463609|DFB177F8CCFF8926D6E6A92C0F1A349F092F7F1C|逼上梁山_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76145', '', 'B', '', '3.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('13', '18', '多谢款待/NHK晨间剧第89作', 'HDTV', '', '', '杏,东出昌大,原田泰造,财前直见,吉行和子,井之肋海,近藤正臣', '木村隆文', '卯野芽以子是在经营西餐厅的父母的精心养育下成长起来的少女，极其贪吃，寄住在卯野家的大学生西门悠太郎也被这种情形震撼了，不久他便被 “从我想吃到让我吃”的芽衣子的热情征服，与此同时，芽以子也对这位固执地“想要建造世界上最安全房屋”的男子产生了好感，对着想要建造大阪新的街道的悠太郎，芽以子对着他说，“请让我一生都吃喜爱的食物，我也想让你一生都吃喜爱的食物。”芽以子以这种方式向悠太郎求婚并成为了他的妻子。\r\n    后来芽以子嫁到了大阪的世家，但她时髦的西餐却遭到了婆家人的拒绝，东京与大阪的口味大不相同，大阪家庭料理最重要的是“始末”的精神，抱着“价格昂贵并且美味的料理即使是傻瓜都会做”的想法嫁过来的芽以子，在面对了挥金如土的婆婆，回娘家的姐姐和不擅长处理家庭关系而发呆的公公等人后，“要让丈夫幸福就要让他的家人幸福”，芽以子开始领悟到大阪料理“始末”的精髓，开始做出了感化西门一家人的料理。然而这时战争却开始了，芽以子守护者自己的家人，在战乱的年代也积极乐观地努力生活下去。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131001235436.jpg', '日本', '', '0', '37', '', '1', '1384334690', '6', '0', '0', '0', '0', '1', '1', '7', '9', 'qvod', '', 'qvod://172385018|E3867B3200E9F55C22D2A3CB88DE519627B4643C|多谢款待_2013_HDTV_01.mp4|\rqvod://194088574|6BC2434C80EAF66AE95BACDBF271A59453E5161A|多谢款待_2013_HDTV_02.mp4|\rqvod://192946675|47024BE6D128925CD3F1FD0688A00FD8656E37DB|多谢款待_2013_HDTV_03.mp4|\rqvod://154883228|9FD9D37FBB226EA49BCEAEA540C9819E0BBCC128|多谢款待_2013_HDTV_04.mp4|\rqvod://180895933|C829BDAAB97403517F759856FDD9E995B971CA9B|多谢款待_2013_HDTV_05.mp4|\rqvod://181762737|BDD98A60867422DC890B4E7A1F06C7FEB3D67DAC|多谢款待_2013_HDTV_06.mp4|\rqvod://186197914|9E3DA3D28F596EA6DA9728A85B25CA4FA088A569|多谢款待_2013_HDTV_07.mp4|\rqvod://175767082|E815A5A15E7805E8BDA06511E84B42B284E9D0E5|多谢款待_2013_HDTV_08.mp4|\rqvod://150882437|3864EE1117BACE1E5E5935D6EAFFFCCED80994D9|多谢款待_2013_HDTV_09.mp4|\rqvod://141121941|E4BA898B8E5F8799F2BCAFF34A660A0DB77A820A|多谢款待_2013_HDTV_10.mp4|\rqvod://173568325|D68A694501C9CAA660048838214C830F8C5A0A5E|多谢款待_2013_HDTV_11.mp4|\rqvod://171528310|4A2CDC947DA11768E4F232C819A3143D9DC28F17|多谢款待_2013_HDTV_12.mp4|\rqvod://199838973|1D484A2C2BB77D97FA6D53027DFE62200F282DC3|多谢款待_2013_HDTV_13.mp4|\rqvod://178768052|BE4053FCC189B7734956CA0A33C6A4A1C864E73B|多谢款待_2013_HDTV_14.mp4|\rqvod://180680244|201C0A4EFC1B2E649045A8989EB720AED271E2D8|多谢款待_2013_HDTV_15.mp4|\rqvod://156669465|14F58EE8A1C6967D