INSERT INTO `ff_vod` VALUES ('14', '15', '陆贞传奇/女相[粤语版]', 'HDTV', '', '', '赵丽颖,陈晓,乔任梁,刘雪华,杨蓉,唐艺昕,张可颐,吴映洁,王琳', '李慧珠,邓伟恩,梁国冠', '本剧讲述了中国历史上唯一的女相——北齐朝陆贞的传奇故事。陆贞出身官商世家，母亲早亡的她自小善良聪慧，是父亲生意上的得力助手，因此被继母妒恨，终遭其迫害，致使父死家亡，无处安身。为躲避继母的追杀，她参加宫女考试，避入宫廷。宫廷中陆贞刻苦、努力，凭其聪慧才智，成为孝昭帝高演的红颜知己，更为其所赏识晋升为高级女官。同时她的坚忍与善良，也打动了太子高湛的心。但身份地位的差异，注定了这段感情崎岖坎坷。宫女阿碧的嫉妒、太子初恋情人萧观音的仇恨、与太子有杀母之仇的娄太后等所有的阴谋诡计、爱恨情仇一并交织在了陆贞的身上。最终陆贞凭借其果敢与智慧成功的协助太子战胜了娄太后家族为篡权发动的一系列阴谋行径，助高湛即位。但因阴差阳错，使陆贞再无法与高湛成亲。于是她嫁给政治，辅佐幼帝高纬，成为了我国历史上唯一的女宰相。', 'http://175.6.0.111:8058/vfolder//upimage/201305//20130506101859.jpg', '大陆', '', '0', '12', '', '1', '1384334706', '5', '0', '0', '0', '0', '1', '1', '8', '5', 'qvod', '', 'qvod://487290790|F479482C58E7DBFB43708190DF2F0D03A4676F7C|女相.粤语_HDTV_01.rmvb|\rqvod://427772858|BFCB186761BA10FD2B42B2D1D9C00EF3F17440F4|女相.粤语_HDTV_02.rmvb|\rqvod://425630734|85DA4DE22AB0187E1BB1AFBE7E1CEFFCA70BEC83|女相.粤语_HDTV_03.rmvb|\rqvod://465254480|7DFC0860DCD623343FF09D00FE948176661DAC7B|女相.粤语_HDTV_04.rmvb|\rqvod://434743420|BB3490F7112E9477DCCC71E0C866AD18DF14CD72|女相.粤语_HDTV_05.rmvb|\rqvod://449515465|FAB483F3C0CCAF3BA12FC392332F1BDC5F4715BA|女相.粤语_HDTV_06.rmvb| \rqvod://429529172|E5EEAFF5A0E6E794F44AB6D64D84F4784E2CF0F2|女相.粤语_HDTV_07.rmvb| \rqvod://445659755|144ABD47AED2C11C23498511D14407673D62ADDA|女相.粤语_HDTV_08.rmvb|\rqvod://418364453|685E3BC81C89E432E779F270C99B2C8ACEFA5EB6|女相.粤语_HDTV_09.rmvb|\rqvod://427056878|332F85C7FE3BFE814F2B3D5A3EF322A3B2F11697|女相.粤语_HDTV_10.rmvb|\rqvod://463494128|2289166B91C4A89D5189508596FD4ACD6A82BEC4|女相.粤语_HDTV_11.rmvb|\rqvod://451625832|797FD9C242E6C0A8E8FAD49D0025EC5ADD21636F|女相.粤语_HDTV_12.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75850', '', 'L', '', '7.0', '2', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('15', '3', '义风堂堂直江兼续～前田庆次酒语/义风堂堂兼续与庆次', 'DVD', '', '', '浪川大辅,佐藤拓也,川本成,乡田穗积,安元洋贵,上田耀司,广田行生,寺杣昌纪,加藤和树', '原哲夫,ボブ白旗', '这次动画化的「义风堂堂」是「花之庆次」的外传漫画，讲述前田庆次之友、战国名臣直江兼续的故事。漫画由原哲夫和堀江信彦担任原作，武村勇治负责作画，包括第一部「义风堂堂直江兼续～前田庆次月语～」（全9卷）和第二部「义风堂堂直江兼续～前田庆次酒语～」（目前6卷），目前正在月刊「COMICZENON」杂志连载中。', 'http://175.6.0.111:8058/vfolder//upimage/201307//20130704103608.jpg', '日本', '', '0', '19', '', '1', '1383714775', '9', '0', '0', '0', '0', '1', '1', '7', '3', 'qvod', '', '01$qvod://171580106|02D46C6EA8AEBD88F971A11B5E47B822756C8B3E|义风堂堂兼续与庆次_2013_DVD_01.mp4|\r02$qvod://164082719|C3A0C9E93C1B1D5A3087BADBC5F44BFC6425A06C|义风堂堂兼续与庆次_2013_DVD_02.mp4|\r03$qvod://215573676|6F6FEEDF3E18E3DCA73B7E75A0030747A102ED2D|义风堂堂兼续与庆次_2013_DVD_03.mp4|\r04$qvod://216407363|6E3EA5113FAA96E380D87CB70361BE9B48AFA795|义风堂堂兼续与庆次_2013_DVD_04.mp4|\r05$qvod://98783959|D02B9D4B6485ED2DBCF7CE56CFD2F76755B06722|义风堂堂兼续与庆次_2013_DVD_05.mp4|\r06$qvod://215583877|27B8276A2FA18EB50B6FF5DFF86AA2609B2D95C0|义风堂堂兼续与庆次_2013_DVD_06.mp4|\r07$qvod://215854620|B25DE7BB5C4DDFF6BF0882788CF7F5E860280835|义风堂堂兼续与庆次_2013_DVD_07.mp4|\r08$qvod://215832584|048DEA52951D02531DAD353D6CF4D60CB8D5B09D|义风堂堂兼续与庆次_2013_DVD_08.mp4|\r09$qvod://215785286|33B1AA85C8FC13C6EA1850702AC03D7A035B9E02|义风堂堂兼续与庆次_2013_DVD_09.mp4|\r10$qvod://148285243|0775252C60B30A2E814F3B74EDDD99A776BF26DD|义风堂堂兼续与庆次_2013_DVD_10.mp4|\r11$qvod://215580463|3BA0AE808792353ADF69BACBCD3CD939953FF43E|义风堂堂兼续与庆次_2013_DVD_11.mp4|\r12$qvod://215809992|F79157D0EF055AFF08640CFD9CD14982F4315AF3|义风堂堂兼续与庆次_2013_DVD_12.mp4|\r13$qvod://215625533|B22E6D60678A6A2244A7B1724E2F6925CCA07016|义风堂堂兼续与庆次_2013_DVD_13.mp4|\r14$qvod://215595809|AA8E2503EC2D9B6D371EE6FF6916E9B9D51D503F|义风堂堂兼续与庆次_2013_DVD_14.mp4|\r15$qvod://215763584|5321BD624CC0193D5953299A005EDD8A65B04BAC|义风堂堂兼续与庆次_2013_DVD_15.mp4|\r16$qvod://216084681|402C036DDB2AC9F322DB27AA4B03C6681ABA735A|义风堂堂兼续与庆次_2013_DVD_16.mp4|\r17$qvod://159010384|5C0FE9A9F0CE644B1061EA27DA96557C4E4942BF|义风堂堂兼续与庆次_2013_DVD_17.rmvb|\r18$qvod://16814