INSERT INTO `ff_vod` VALUES ('16', '4', '两天一夜/2天1夜[2013]', 'HDTV', '', '', '姜虎东', '未填写', '时隔5年，人气MC姜虎东熊爸爸回归KBS，担任名为HappySunday准备好了韩国新综艺节目的主持人，此节目由六名韩国艺人出演，其中殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，另外还有尚根一只狗为固定出演。由节目组提出挑战，艺人和MC共同完成任务。后2007年8月5日正式更名播出2天1夜，以体验野生为宗旨的娱乐节目，但是由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲的因故离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替，迎来了全新的两天一夜正式出发！在同时段节目中2天1夜的收视率一直居高不下，甚至在09年1月11日创下了48的时段最高收视率，让我们期待姜虎东每个星期日给我们带来的2天1夜，期待姜虎东继情书之后引领韩国综艺再次创造综艺神话吧！', 'http://175.6.0.111:8058/201011/11/20101111104846.jpg', '韩国', '', '0', '20131110', '', '1', '1384334713', '7', '1', '1', '2', '1384410389', '1', '1', '3', '1', 'qvod', '', '20130106$qvod://703843950|6FDB3D8C6EF0E53E2897001CFB84ECF402FA26EE|两天一夜_HDTV_20130106.mp4|\r20130113$qvod://1763071807|957D4C5B286F05ED2A2D981A2898F5A14DCC1EF1|两天一夜_HDTV_20130113.mkv|\r20130120$qvod://1766107243|33E6A51DC82E1379A6778F904ABAD6EE97D36494|两天一夜_HDTV_20130120.mkv|\r20130127$qvod://1768125712|38D846319BA424CD53984DFD675D3A64DF2F23D3|两天一夜_HDTV_20130127.mkv|\r20130203$qvod://1885030345|F4EFB55DE6763A947232BCA31CCAD5FD466532CA|两天一夜_HDTV_20130203.mkv|\r20130210$qvod://1869294805|97090925266653097F33DCE0A7EF3FE1F109424C|两天一夜_HDTV_20130210.mkv|\r20130217$qvod://741438436|DC165290D1A8A21F5CF686FEF7CC906C674EF02D|两天一夜_HDTV_20130217.mp4|\r20130224$qvod://727657460|E5E0EFEF7853DA9FCFA15617A84EDEC4504EADB8|两天一夜_HDTV_20130224.mp4|\r20130303$qvod://1776321767|F3E0C29CF34782212BDD751D8388DE9F54AC67F1|两天一夜_HDTV_20130303.mkv|\r20130310$qvod://713051527|24FC3C38EEBE252D712044672700E8A584545D03|两天一夜_HDTV_20130310.mp4|\r20130324$qvod://829763674|B93BE638BE16090E0C7582280D632933357F66D4|两天一夜_HDTV_20130324.mkv|\r20130331$qvod://1775473950|92D5ADBB2A9227E78E21E14BACCDAC97043A02FF|两天一夜_HDTV_20130331.mkv|\r20130414$qvod://759511020|2450DD779342A63FBFCAB8F40EB70C1F8677C288|两天一夜_HDTV_20130414.rmvb|\r20130421$qvod://679160544|532D1B47F0CC086C66CB5D52F77FF33120CAE8EC|两天一夜_HDTV_20130421.rmvb|\r20130505$qvod://792604392|C22EFA5620204586B3BEC4E73163D454BDFB0D56|两天一夜_HDTV_20130505.rmvb|\r20130512$qvod://8