INSERT INTO `ff_vod` VALUES ('17', '14', '私房钱[微电影]', 'DVD', '', '', '小黑,扬子', '宋川', '秦苏生性胆小怕事，在一家私人企业工作。秦苏和他的领导大海刚好又是邻居。一次，大海出差前将秦苏秘密叫到办公室，委托秦苏将自己两万元私房钱交给大海前妻的儿子。苏秦推脱不过，只好硬着头皮答应下来。秦苏下班回家后想和自己老婆商量一下怎么把钱交给大海前妻的儿子，不料此时正逢大海家被窃，正好丢失也是的两万元现金。秦苏明知这丢失的两......', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106105129.jpg', '大陆', '', '0', '0', '', '1', '1383714775', '2', '0', '0', '0', '0', '1', '1', '6', '2', 'qvod', '', 'qvod://64129259|FBE2A2F617BB80E4B53AAC0FCA36BD912278FE9F|私房钱_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76144', '', 'S', '', '4.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('18', '3', '全职猎人新/全职猎人II/新全职猎人', 'HDTV', '', '', '潘めぐみ,伊濑茉莉也,泽城美雪,藤原启治,浪川大辅', 'Kazuhiro,Furuhashi', 'HUNTERxHUNTER讲述主人公小杰自小在鲸鱼岛长大，与米特阿姨和阿婆相依为命。性格开朗的他，有着能与动物沟通的灵性。因为无父无母，小杰将米特阿姨当作自己的生母爱着。直到9岁那一年，小杰在森林里被一个青年男子搭救。从他口中小杰得知自己的父亲还活着且职业是猎人。在说服米特阿姨之后，小杰独自踏上了寻父的征程。然而世界那么大，在茫茫人海中找到父亲谈何容易？于是，小杰决定成为猎人，从这里开始找寻他父亲的踪迹。靠这样一种信念开始了冒险旅途，并在旅途当中结交好友，不断成长，从而引出了后面的所有故事，引出全职猎人的精彩世界……', 'http://175.6.0.111:8058/201110/02/20111002144738.jpg', '日本', '', '0', '104', '', '1', '1384334693', '9', '0', '0', '0', '0', '1', '1', '1', '6', 'qvod', '', '01$qvod://111845328|CF594B06EA2FF864770DFD20808B989F892C889C|全职猎人_Hunter.x.Hunter.II_2011_HDTV_01.rmvb|\r02$qvod://112072351|AAB965505C42A9AF3B6057C9E8B81CB594D6FD51|全职猎人_Hunter.x.Hunter.II_2011_HDTV_02.rmvb|\r03$qvod://118676685|02293E3BFCA9DAC0CF9073DAE74174EEB9A4266F|全职猎人_Hunter.x.Hunter.II_2011_HDTV_03.rmvb|\r04$qvod://161308028|4840EBEFD3614854767E5BFA61C555269A005019|全职猎人_Hunter.x.Hunter.II_2011_HDTV_04.rmvb|\r05$qvod://129933133|CE6F7361E5DB698C2224C7151BCED8C745E53AE3|全职猎人_Hunter.x.Hunter.II_2011_HDTV_05.rmvb|\r06$qvod://129822288|946C80D92BEFB10C59FD86D92EEB6C853E041E73|全职猎人_Hunter.x.Hunter.II_2011_HDTV_06.rmvb|\r07$qvod://115965133|3F45B58873456A11F51040B89D2A145CFD1C1069|全职猎人_Hunter.x.Hunter.II_2011_HDTV_07.rmvb|\r08$qvod://105193560|146370A72EBB314A2916F25066E32B06C8E5FD6E|全职猎人_Hunter.x.Hunter.II_2011_HDTV_08.rmvb|\r09$qvod://103117157|917922A7D612271E289592F3C1A32FF9D135BF75|全职猎人_Hunter.x.Hunter.II_2011_HDTV_09.rmvb|\r10$qvod://107383097|B0335630CBAEA74B8D76A6408B22D4278B0A4F9B|全职猎人_Hunter.x.Hunter.II_2011_HDTV_10.rmvb|\r11$qvod://107044787|BBF9211E00B8C46AAB87FA3F9A74659F49DC07B1|全职猎人_Hunter.x.Hunter.II_2011_HDTV_11.rmvb|\r12$qvod://108683289|5023A37F93B79AD915D309FF9C92767A30A2403E|全职猎人_Hunter.x.Hunter.II_2011_HDTV_12.rmvb|\r13$qvod://127630613|EC9DE4402B7BD317B2EE22E5EA156956D7821212|全职猎人_Hunter.x.Hunter.II_2011_HDTV_13.rmvb|\r14$qvod://122221323|475E13A10049EA90CBCFBD43982CDC926368C388|全职猎人_Hunter.x.Hunter.