INSERT INTO `ff_vod` VALUES ('19', '15', '真爱惹麻烦[QMV+]', 'HDTV', '', '', '袁弘,吕一,林佑威,孙骁骁,张杨果而', '沈怡', '林真心因为父亲的死而对高氏企业产生仇恨。为了报仇，她刻意接近高氏企业接班人高扬。然而在与高扬的热恋之中，报复心渐渐消融，林真心爱上高扬，面对曾经的恩怨，她陷入犹豫之中。梁燕为了断绝高扬与真心之间的关系，对两人横加阻挠，王翔看着自己喜欢的人投入另一个男人的怀抱，心灰意冷，忽视了晓寒对自己的一片痴情。随着林真心真正身份的揭穿，他与高扬之间的感情也越来越坎坷，王翔被晓寒的痴情所感动。原本以为地位悬殊，他与晓寒之间不会有未来，然而随着母亲的揭秘，才发现高扬之父才是自己苦苦找寻的亲生父亲。高扬原谅了真心，两人搬进新家开始甜蜜新生活，未来，会更美好更灿烂。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131009002455.jpg', '大陆', '', '0', '15', '', '1', '1384334693', '4', '0', '0', '0', '0', '1', '1', '4', '9', 'qvod', '', 'qvod://370398230|BCB3C9F90D7BFFC90C1A6C649F45AB7CD28C83B9|真爱惹麻烦_HDTV_01.QMV|\rqvod://370229977|A66F63C2637FE8514510A9AC13805D954E712157|真爱惹麻烦_HDTV_02.QMV|\rqvod://370375060|26DCA98FC38C4F94443189E20FAFBDDBB08A5D50|真爱惹麻烦_HDTV_03.QMV|\rqvod://370362926|B6701230D750BE5DB7FE4B2729691F7AEDA05189|真爱惹麻烦_HDTV_04.QMV|\rqvod://370283429|F1493E60DA678B5C5F0F101E4CE2A3C3DBB87F68|真爱惹麻烦_HDTV_05.QMV|\rqvod://370554983|06BC091C42917A5E3D0B56B263B4A6AB801CC81F|真爱惹麻烦_HDTV_06.QMV|\rqvod://370626208|9E40A22C3F6B955469F0A20462FD73A2A5AE13C9|真爱惹麻烦_HDTV_07.QMV|\rqvod://370743796|A99611EE39B324082DB802D842F594A6F8EC73D5|真爱惹麻烦_HDTV_08.QMV|\rqvod://370579075|121179F941653BE99693962E951AB84BE93656F9|真爱惹麻烦_HDTV_09.QMV|\rqvod://370164840|34F0252CF76F714981FD1CAE218FAF843A85BCBA|真爱惹麻烦_HDTV_10.QMV|\rqvod://370729006|86C2B71054A3A5E861CB97D02E70C72D5DB74D8A|真爱惹麻烦_HDTV_11.QMV|\rqvod://370434884|54FA533E8463CB8AC12B5942709B981CC0C07C10|真爱惹麻烦_HDTV_12.QMV|\rqvod://371301930|4016B035038234A1A820EF87F12D3F4DBE3E107A|真爱惹麻烦_HDTV_13.QMV|\rqvod://370467023|61FE24BE219BCD519E6F7FDB6C5277689313CCE8|真爱惹麻烦_HDTV_14.QMV|\rqvod://370683637|FAB3991E590ACCE5A763530DFF41A93277B9B50B|真爱惹麻烦_HDTV_15.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76142', '', 'Z', '', '9.0', '5', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('20', '14', '小偷与警察[微电影]', 'DVD', '', '', '未知', '未知', '这是一部带有强烈讽刺意味的短片，小偷与警察，原配与小三，本来都是强烈对立的身份却在本片中变成了合作的关系，一份协议、一份家产，促使两对截然反目的人物走在一起，显得有些荒诞。小偷到警察家中偷东西，有点耗子偷猫食的意味，影片的一开头便率先通过一系列的动作展现出了小偷对此行目的无奈以及对所看到的“奢华”的羡慕，从而......', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106103323.jpg', '大陆', '', '0', '0', '', '1', '1383714775', '6', '0', '0', '0', '0', '1', '1', '9', '3', 'qvod', '', 'qvod://38901699|291C715DC1E3E092D00F4D6B1276435E044A9B51|小偷与警察_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76143', '', 'X', '', '3.0', '4', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('21', '3', '东京暗鸦', 'HDTV', '', '', '石川界人,花泽香菜,金元寿子,木村良平,佐仓绫音,丰崎爱生,喜多村英梨', '金崎贵臣', '故事背景描述出生於土御门家的少年- 土御门春虎 所发生的周围事件。 我愿意成為你的式神，一直在你身边，永远保护你很久以前，年幼的男孩对著女孩定下约定，在他还不知道「将来」的意义之前─ 过去大战时期，日本帝国陆军為将咒术运用在军事上而重新建立阴阳寮，并派任传说中阴阳师安倍晴明的后裔，土御门家当家的天才阴阳师土御门夜光担任统领，成功缔造日本咒术界的改革，成為现代咒术之父。 大战末期，处於败势的帝国陆军要求夜光实行大规模咒术仪式以挽回局势，但结果仪式失败，不只做為执行者的夜光身亡，还强烈的扰乱首都东京的灵气，使东京百鬼夜行、妖魅纵横。 直到了战后了战后阴阳寮改名阴阳厅，负责处理日本各地－主要是东京－发生的灵力灾害。土御门春虎是个出生土御门家的少年，虽身為阴阳师名门后代，却毫无阴阳师才能可言，过著一般人的生活。某年夏天，春虎遇见了他的童年玩伴，也是土御门家的下任当家的少女夏目。 过去曾允下承诺如今却分道而行的两人，在此刻相见之后，土御门的歷史开始转动了，逐渐开始将他引领向了过去所见到的未来是充满了曲折的「未来」，在黑暗中飘舞的乌鸦们，超越时空的阴与阳的幻想！', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131009090550.jpg', '日本', '', '0', '6', '', '1', '1384334695', '9', '0', '0', '0', '0', '1', '1', '8', '5', 'qvod', '', '01$qvod://189224990|A5D267AC7038AC5D132B61FE4B40D2D164E5547E|东京暗鸦_2013_HDTV_01.mp4|\r02$qvod://115932953|C9917E299EB8780EC3EB23A2FB491ADC2C4C869D|东京暗鸦_2013_HDTV_02.mp4|\r03$qvod://144585357|5C2C413740F7942225D81DBD519893C3628E04E6|东京暗鸦_2013_HDTV_03.rmvb|\r04$qvod://105666478|0ECB3E68A2F701A7868BF6F76E63691C6F3C92E0|东京暗鸦_2013_HDTV_04.rmvb|\r05$qvod://165311017|509F8A2FB0D75384FA4E623873C0F7A4A22FFCFC|东京暗鸦_2013_HDTV_05.mkv|\r06$qvod://94250565|D50865E333F26D4B761EDB53C66F00C08CFEC318|东京暗鸦_2013_HDTV_06.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75263', '', 'D', '', '1.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('22', '12', '开棺/天坑坟地[预告片]', 'DVD', '', '', '约瑟夫·摩根,沙尔托·科普雷,托马斯·克莱舒曼,Erin,Richards,何超仪,Max,Wrottesley,éva,Botos', '冈扎罗·洛佩兹-加勒果', '本讲述了某个偏僻荒凉的森林里，六个人在一处有腐尸的露天坟场旁醒来，却好像得了健忘一般的恐怖闹鬼故事。他们无处可去，被迫把神秘事件的线索拼凑起来，最终将带领他们走进惊人的结局，而不至于使真相来的太晚。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106101916.jpg', '欧美', '', '0', '0', '', '1', '1383714782', '9', '0', '0', '0', '0', '1', '1', '8', '7', 'qvod', '', 'qvod://3968450|7B7DA284E07801983FC83B6909CC7E370537EA75|开棺.预告片_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76140', '', 'K', '', '6.0', '5', '1', '0', '0', '0');
