INSERT INTO `ff_vod` VALUES ('31', '15', '大秦帝国第二部：纵横/大秦帝国2/大秦帝国之纵横[QMV+]', 'HDTV', '', '', '宁静,富大龙,王学兵,傅淼,喻恩泰,杨新鸣,李立群', '丁黑', '　　《国命纵横》是秦国东出与六国纵横争雄史。以商地民众按古老习俗厚葬商君为序幕，秦惠王重新与变法势力结盟，铁腕镇压旧贵族叛乱，并整肃朝局，破格起用忠实于新法的年轻官吏，形成了生机勃勃的新一代权力，全力准备东出中原。　　\r\n    神秘的鬼谷子门下又有两位刚学成的新一代名士出山，苏秦张仪的名字已经悄悄传到了秦国的公府。春日，洛阳王城郊外的苏氏别庄来了一位客人，张仪风尘仆仆从安邑赶来，拜访同窗七年、情同手足的师兄苏秦。双杰聚酒评点天下，各谋大国，并约定：苏秦谋秦，张仪谋魏、齐、楚，相互援手，共担艰危。在苏秦兴冲冲准备入秦，向父亲辞行的时候，一生经商的老父只给了他一句话：母国为根，理根为先。苏秦知道，这是老父要他在出山前向天下昭示气节。他改变初衷，先入衰败破落的洛阳王宫去见周显王。周显王赐苏秦一辆王车，让他去游说战国，为周人争光。苏秦与一位美丽神秘的宫廷女官燕姬一见钟情。对献给魏王的霸业对策已成竹在胸的张仪求见魏王，适逢路过大梁的孟子作客王宫，张仪舌战孟子，惹恼魏王，游说受挫。苏秦离周后再入秦，张仪先游齐再说楚，均遭受重大挫折而一时铩羽。七国乱象大混战，秦国新军连续大胜，对山东六国构成强大威胁苏秦忍辱苦修三年，洞察天下大势，重新入世提出合纵抗秦大战略，在已成为燕国王后燕姬的帮助下，被燕易王封为武信君。从燕国突破，成功游说六国结盟，被任为六国丞相，与战国四大公子合力组成六国联军，对秦国形成强大压力。　　秦国危难觅贤，巧妙运动已经对破解合纵成竹在胸的张仪入秦为相。张仪提出连横大战略，主持秦国与山东六国展开了纵横大争。并赢得了秦国公主、执掌秘密机构“黑冰台”的赢华和侍女绯云两个奇女子的爱情。楚怀王芈槐头脑简单且刚愎自用。任用昭睢一群旧世族。宠幸贪才纵欲的王妃郑袖，排斥主张变法强国的屈原。任命无能的子兰为合纵联军主帅。六国联军攻秦，几经较量，六国终因根基不稳内讧多出而频频失利，合纵宣告失败。苏秦为避祸回到燕国。战争中伤亡最重的是楚国，楚王恼羞成怒，归罪于张仪。遂重新起用屈原掌握兵权，发誓向秦国复仇。春申君立即北上燕国，请苏秦入楚，准备发动第二次合纵。刚刚经过大战的秦国遣国书使割地求和。谁知楚怀王看了拍案大叫：不要割地，只要张仪！正当秦国准备举国一战之时，刚从燕国出使归来的张仪却自请入楚。邦交如战场。张仪与赢华冷静周旋于楚国，终于化险为夷。刚刚恢复了大司马职务的屈原从楚国变法与合纵的利益出发，派兵暗杀张仪未遂，却险些造成张仪与苏秦这两个生死朋友间的误会.在秦国的离间下，屈原再次被贬斥，壮心酷烈的屈原私自调集八万楚国新军，在楚国屈氏家族的支持下，贸然与秦军决战。兵败，全军覆没。回到燕国的苏秦险被野心家子之卷入阴谋泥沼，遂离燕入齐。几经周折终于在齐推开全面变法。神秘退隐的燕姬也历尽艰难追随苏秦潜入齐国，两人终获团圆。正当张仪游说六国，成功推行连横亲秦战略的关键之时，秦惠王身患不明原因的“暮疯症”，张仪入齐寻求方士，恰遇苏秦被旧贵族买凶杀害，两兄弟生死相别。安葬苏秦后悲痛而归，秦国内政已经发生了奇怪变化；狂暴太子与长史甘茂结谋排斥异己，上将军司马错被迫卸职隐退，张仪为免遭罢黜而径自挂冠离秦退隐江湖。尚武狂秦武王率领大军欲图东灭洛阳，将秦国再度推向危险的境地……', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130905193356.jpg', '大陆', '', '0', '0', '', '1', '1384334693', '6', '0', '0', '0', '0', '1', '1', '3', '8', 'qvod', '', 'qvod://300054096|88180129EDD04E0D299CB1C2A245DAE56DB5449B|大秦帝国之纵横_HDTV_01.QMV|\rqvod://298486197|E48CF65102A28D8D7D261F7E79D94C07C1547615|大秦帝国之纵横_HDTV_02.QMV|\rqvod://300352089|CF4E25542B2B67251DCB494A5716A0BA24DB421A|大秦帝国之纵横_HDTV_03.QMV|\rqvod://302910111|88881262A1852E6E90E3E149B673D84FE02E14C1|大秦帝国之纵横_HDTV_04.QMV|\rqvod://329869339|B8F0E58C19A06663