INSERT INTO `ff_vod` VALUES ('32', '15', '决战燕子门[高清版]', 'HDTV', '', '', '杨烁,王力可,范雨林,张鹰,晋松,刘萌萌,杜奕衡,陈昊,孟彦森,徐少强', '国建勇,王飞', '民国年间，济南城中。少年君宝为人正直 ，智勇双全，他身姿矫健，是难得的练武 奇才。为保护母亲，君宝砍伤了恶霸楚天 九，这一砍砍出了他一生的悲欢传奇。君 宝被警察署巡官陈宇和楚天九欺凌，被关 进北大窑监狱。机缘巧合，他认了江湖上 声望最高的老贼王李云成为师，习得一身 绝世轻功。在奇人叶飞的帮助下，他学会 了各种奇门绝技，与叶飞浪迹江湖。为了 寻找叶飞的妹妹沉冰，他北上京城，结识 了阿乐、小七、方俊生等人。为揭露陈宇 的真面目，君宝混进警察署并取得了陈宇 的信任。他白天潜伏在陈宇身边，夜晚就 化身侠盗，为民除害，劫富济贫。接着， 他成立了燕子门，带领阿乐、小七等人伸 张正义。', 'http://175.6.0.111:8058/vfolder//upimage/201308//20130829010804.jpg', '大陆', '', '0', '22', '', '1', '1384334688', '2', '0', '0', '0', '0', '1', '1', '4', '3', 'qvod', '', 'qvod://321175833|14DECCB27AA6D3080BF57928D277A18D795E27E8|决战燕子门_HDTV_01.rmvb|\rqvod://309581733|0BF6630750675DF61F4828D242DC5F5580BD202F|决战燕子门_HDTV_02.rmvb|\rqvod://339231847|8D4FC0C519603896FA1B94138DF585703EE4216A|决战燕子门_HDTV_03.rmvb|\rqvod://338120386|2A7C707BD7CFF460A10D34848C08E0EBB920DE07|决战燕子门_HDTV_04.rmvb|\rqvod://313461171|94662E8859A6EECC79AF230E0B2657FC7890DCF5|决战燕子门_HDTV_05.rmvb|\rqvod://309902309|C59D946AB25011B10C94EA2251C912BC4D5A3E90|决战燕子门_HDTV_06.rmvb|\rqvod://344426906|37BA3508F5F80C82CE3DA5BFB5031D4DAF6890DD|决战燕子门_HDTV_07.rmvb|\rqvod://326879562|ED82664EDA810E7EF3D7E8D9D6FF61B28911DDC3|决战燕子门_HDTV_08.rmvb| \rqvod://358141395|B7F8D6331699D5386541DBD247A79F2304EFE940|决战燕子门_HDTV_09.rmvb| \rqvod://391798497|9A099D5CF0898A97ADA0E53B9CB20281074F0AF0|决战燕子门_HDTV_10.rmvb| \rqvod://309745835|1AF563690D20CF7A7C8C62BBE2E6D398B7AD2020|决战燕子门_HDTV_11.rmvb| \rqvod://309962482|375AD18227EA11D5AF058CA75AC1EE422C7E8CCC|决战燕子门_HDTV_12.rmvb|\rqvod://309902378|A3C54251777B012E3B9AE38D955D1743889E3C92|决战燕子门_HDTV_13.rmvb|\rqvod://309847773|284B197DA0E1DD8BDB6AE7B0A1E3B2A0A116FCBE|决战燕子门_HDTV_14.rmvb|\rqvod://311273345|21E6B35DD8E08C0F1580B3C290FB91E31E273045|决战燕子门_HDTV_15.rmvb|\rqvod://315486934|A5AE254166C0550F416D260F9E53A3955F704376|决战燕子门_HDTV_16.rmvb|\rqvod://350265967|F3FB336C91572B3A553643C44CF6560E464F281C|决战燕子门_HDTV_17.rmvb| \rqvod://343456407|5F3E6ECE84B50C8049FC49A27FF05984D5254A55|决战燕子门_HD