INSERT INTO `ff_vod` VALUES ('35', '16', 'On Call 36小时2/On Call 36小時II/OnCall36小时2[粤语]', 'HDTV', '', '', '马国明,杨怡,黄智雯,罗仲谦,曹永廉,周家怡,张慧雯', '潘嘉德', '杨沛聪（罗仲谦 饰），美雪（黄智雯 饰）等刚从医校毕业的新生，正式开始实习医生真枪实弹的工作。每个被分在神经外科的实习医生，都不禁对科室里的张一健（马国明 饰）医生又敬又畏，因其做事格外认真、一丝不苟的个性被医院上下称呼为“一件头”。他为了能实现双脚瘫痪的弟弟一康（魏焌皓 饰）去美国留学的心愿，一直拼命工作努力存钱，对个人感情的事避而不谈。直到范子妤（杨怡 饰）的出现，她不仅是一健导师的女儿，而且从小对医学充满热诚，对一健从仰慕之情转为爱慕之情。对于一健的回避，她反而采取主动，甚至在一康意外不幸离世之后，给伤心欲绝的一健安慰和鼓励，令其重拾医生的信念。正当一切好转之际，子妤被检查出脊髓内肿瘤中的星型细胞瘤，一健恍然大悟内心的情感……\r\n    本剧为2012无线节目巡礼剧集之一，此剧是继《妙手仁心》、《仁心解码》后，无线电视精心制作的医学电视剧。医生除了救死扶伤外，也身具社会中父亲、子女、兄长等角色，当两个身份冲突之时，一个好的医生该如何在情感和理智之间做出正确选择，恰是该剧传达的重点。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131104213920.jpg', '香港', '', '0', '7', '', '1', '1384334701', '6', '0', '0', '0', '0', '1', '1', '6', '8', 'qvod', '', 'qvod://317299339|DA7C7FB0E9934BD0E7BFACC8B3EAED3581927E8F|On.Call.36小时2.粤语_HDTV_01.rmvb|\rqvod://295863993|CE6D9EDC164F0B74978967808F4083F694DC6366|On.Call.36小时2.粤语_HDTV_02.rmvb|\rqvod://311227176|231D6606BAAA5D139DFC329D759EC759105A1251|On.Call.36小时2.粤语_HDTV_03.rmvb|\rqvod://303021017|651594CBD3C9B2FBA1383C278683DE8728286F59|On.Call.36小时2.粤语_HDTV_04.rmvb|\rqvod://314990105|F310D8E440ABE1FD215DC433364EE3530FDBDC05|On.Call.36小时2.粤语_HDTV_05.rmvb|\rqvod://316514203|77724438BF19CCA1F1713C78BD57465F5813933A|On.Call.36小时2.粤语_HDTV_06.rmvb|\rqvod://316379185|0F3BB86D0925B1168D70911802823F9B2D1407BA|On.Call.36小时2.粤语_HDTV_07.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76096', '', 'O', '', '2.0', '1', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('36', '3', '黑白小姐/单色小姐', 'HDTV', '', '', '未知', '岩崎良明', '黑白小姐是堀江由衣在2012年3月进行的公演「堀江由衣的巡回冒险3」中登场的3D虚拟偶像角色，印象色是黑与白，嫌恶五颜六色，希望将世界变成黑白两色，声优是堀江由衣本人。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131002083934.jpg', '日本', '', '0', '7', '', '1', '1384334695', '0', '0', '0', '0', '0', '1', '1', '8', '7', 'qvod', '', '01$qvod://30057429|E7B26958C6BCFF4FC5213D1BE4DEC4CD3E47D86C|单色小姐_2013_HDTV_01.mp4|\r02$qvod://28245368|FCCB461F4B2505BA0422F23C66E6F49FFC359B14|黑白小姐_2013_HDTV_02.mp4|\r03$qvod://37721170|8026FBCAB7A68D61E0CD246A47C9692CA315BB87|黑白小姐_2013_HDTV_03.mp4|\r04$qvod://29937724|60F11A85A1BC1360EB7DD6E49FF4C7D237D58206|黑白小姐_2013_HDTV_04.rmvb|\r05$qvod://32835302|6E89130916A83DF6D5E191D17C2DD70B756D53CF|黑白小姐_2013_HDTV_05.rmvb|\r06$qvod://33644405|232EDC33FE877C803EE00CF4F84BB27AC9764258|黑白小姐_2013_HDTV_06.rmvb|\r07$qvod://32788590|53DF9B9C8E050FA4E1635B68E653D0005A5AB063|黑白小姐_2013_HDTV_07.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75081', '', 'H', '', '3.0', '7', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('37', '10', '女人不坏', 'HDTV', '', '', '周迅,桂纶镁,张雨绮,冯德伦,方中信,彭于晏,高以翔,沈畅', '徐克', '三个不坏的女人，一个号称“无敌” 三十一岁的唐露(张雨绮 饰)。她的美貌让男人飞蛾扑火，也是她事业成功的利器。她不信爱情，也不信IQ不如三围卖钱。偏偏她遇上了对她绝缘的男教授。她不婚却为工作向教授求爱，竟惨遭拒绝，首尝败绩。她想追究原因，真相却让人出乎意外……\r\n    第二个女人泛泛(周迅 饰)，体检中心的验身员，长相平凡之外还是个四眼蛙，直肠触检的技术比追男仔的功夫好上一万倍。她利用对男人的了解和科学实验的精神，找到她的真命天子。但她追男成功的秘密，也成了她这段恋情的最大危机…\r\n    乐团主唱兼拳击手十项全能的铁菱(桂纶镁 饰)是第三个女人。她拥有完美的男友，但他只活在她的幻想中。铁菱的追求者想尽办法想把她拉回现实，但她只想留在幻想世界。直到有一天，她发现幻想中的男人就在她眼前。她要不要跟着完美男人走？她犹豫了…\r\n    三个女人，三种遭遇，发生在引领中国风尚的北京。这是一场浪漫、喜趣又充满时尚魅力的爱情冒险。', 'http://175.6.0.111:8058/200903/27/182902679.jpg', '港台', '', '0', '0', '', '1', '1383714782', '2', '0', '0', '0', '0', '1', '1', '5', '5', 'qvod', '', 'qvod://1502057971|9F30A30896D0E8FB1206605E1DBD5F9466161879|女人不坏_HDTV.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76137', '', 'N', '', '9.0', '6', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('38', '3', '灌篮高手重制版/篮球飞人', 'HDTV', '', '', '草尾毅,平松晶子,梁田清之', 'Nobuto,Sakamoto', '湘北高中的一年级新生樱木花道在初中就有了被50个女孩抛弃的“悲惨”经历，最后一个女孩抛弃他原来是看上了篮球部队小田，由此樱木对篮球更是深恶痛绝。进入高中后，樱木看上了美少女赤木晴子，晴子十分热爱篮球，为了赢取晴子的芳心，樱木决定加入篮球部。在侥幸赢得与篮球队队长赤木刚宪的打赌后，樱木顺利加入了篮球队。随着国中篮球联赛的最有价值球员流川枫的到来、伤愈复出的控位宫城良田以及误入歧途的前国中最有价值球员三井寿的回归，去年不堪一击的湘北篮球今年可谓人强马壮，虽然问题少年一大帮，但是在队长赤木刚宪的带领下，这一群以全国第一为目标的篮球少年正朝着自己的梦想进发！', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106082446.jpg', '日本', '', '0', '4', '', '1', '1383714782', '6', '0', '0', '0', '0', '1', '1', '6', '7', 'qvod', '', '01$qvod://195563360|054F31613AB06615CCD3B8DDC888269FDAC1EB5B|灌篮高手HD重制版_HDTV_01.rmvb|\r02$qvod://203608505|3622D9373A1BBBDAC2D8003F87C95E7F0DADA196|灌篮高手HD重制版_HDTV_02.rmvb|\r03$qvod://241868176|1CEF50AD054503712CD20D4E80F716EC7FE14120|灌篮高手HD重制版_HDTV_03.rmvb|\r04$qvod://184376418|EB1817C94DABFB37BEE89B27B195C95D148123FD|灌篮高手HD重制版_HDTV_04.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76138', '', 'G', '', '7.0', '9', '1', '0', '0', '0');
