INSERT INTO `ff_vod` VALUES ('42', '16', '传爱事务所/法外风云[国语]', 'DVD', '', '', '黎耀祥,陈豪,陈法拉,伍咏薇,马赛,王浩信,高海宁', '徐正康', '本剧主角余英伟及李明扬皆为伶牙俐齿的遗产律师。在法庭上，一次又一次的互相比拼......\r\n    遗产律师的责任就是找出执行逝者的本意，英伟和明扬在“明炉金猪”，“龙头棍”，“真假发妻”等案中较劲，争论遗嘱的本意。“明炉金猪”一案，到底继承烧味传统精神重要？还是将烧味店发扬光大来的重要？“龙头棍”一案，“龙头棍”应该属於社团的公家物品，还是归於逝者的私人财产？后来他们发现，遗嘱内包含了逝者善意的遗愿，只有用善意来诠释，才可以令离世者无憾，在世者无怨。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131014223634.jpg', '香港', '', '0', '22', '', '1', '1384334695', '0', '0', '0', '0', '0', '1', '1', '7', '5', 'qvod', '', 'qvod://278049885|DA83A59FE4C0FC2D712521D1CAB381CF274CA9D2|法外风云.国语_2013_DVD_01.mp4|\rqvod://362151318|965208421DE32BFDA73E26C66AEEF5E38385BB6A|法外风云.国语_2013_DVD_02.mp4|\rqvod://359129366|573FAABCDDDA451EB37774B3C29E245A4D094815|法外风云.国语_2013_DVD_03.mp4|\rqvod://356873275|968E79137BCB5D0588B42F79FC58B2106031A68D|法外风云.国语_2013_DVD_04.mp4|\rqvod://394690781|5083733E02220C252D60ED30B579F9F48A818DAF|法外风云.国语_2013_DVD_05.mp4|\rqvod://357630419|CC7AED8CAA180B6CBD2487C55A07CA9828E41AE3|法外风云.国语_2013_DVD_06.mp4|\rqvod://360033515|8929C1AE3B5EEF62517CED851E2257F9E0821899|法外风云.国语_2013_DVD_07.mp4|\rqvod://359204595|234F7AACA9A9CF632077AB677DAB8ACB8E0E6712|法外风云.国语_2013_DVD_08.mp4|\rqvod://356752878|76A788C380DF2F44B8C20819B4821269EA589499|法外风云.国语_2013_DVD_09.mp4|\rqvod://272409448|776A70C6E791C510BE3660EA6C5E1AA2C3EB8849|法外风云.国语_2013_DVD_10.mp4|\rqvod://274428773|0EA450A06D10FF8385BDD8C6A1B4E5A8D3C2C534|法外风云.国语_2013_DVD_11.mp4|\rqvod://361483047|F7832843C2AE815428C568CA704044FCE3308F50|法外风云.国语_2013_DVD_12.mp4|\rqvod://285739709|59EAE9B9FDC60A929E47EEBA014C8E952959F4EC|法外风云.国语_2013_DVD_13.mp4|\rqvod://361783377|A2DA09E8C6C90FF282D2A40D93EBD7DF9008A1DB|法外风云.国语_2013_DVD_14.mp4|\rqvod://358794168|83F1F0C2540E19D8F30A5139837A3B7959B8FC9F|法外风云.国语_2013_DVD_15.mp4|\rqvod://360739142|35DB87FE82204B1D5939CCA5865517FE9F7B281D|法外风云.国语_2013_DVD_16.mp4| \rqvod://298632076|046DA5639F665F134F03B3B971A8D9A5C70AAA45|法外风云.国语_2013_DVD_17.mp4| \rqvod://298167121|63B1AAB150FEAC3884FC4CFA6FBB5031F440