INSERT INTO `ff_vod` VALUES ('43', '8', '舍身技/荣誉的证明', 'DVD', '', '', '黄圣依,陈晓东,郑浩南,刘家辉,李子雄', '未知', '跆拳道俱乐部创始人赵郁民的得意弟子韩旭峰在一场非法比黄圣依剧照赛中身亡，跆拳道馆也开始日渐没落。一天，一个叫玲玲的女孩来到了俱乐部，并且准备拜赵郁民为师，目标就是夺取跆拳道的冠军。原来玲玲就是韩旭峰的妹妹，为了就是完成哥哥的愿望。可是，她冠军路上要面对着强大的对手。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131106015642.jpg', '大陆', '', '0', '0', '', '1', '1383714792', '0', '0', '0', '0', '0', '1', '1', '9', '8', 'qvod', '', 'qvod://354057615|BDBDAA984ED5EA826ADBDDCEC77059735196890F|舍身技荣誉的证明_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76136', '', 'S', '', '8.0', '5', '1', '0', '0', '0');
