INSERT INTO `ff_vod` VALUES ('53', '19', '奇皇后', 'HDTV', '', '', '河智苑,朱镇模,池昌旭,郑雄仁,李文植', '韩熙', '该剧将讲述高丽人奇子敖的女儿在家人被高丽王杀害后，以高丽贡女的身份被进献给元廷，通过一系列宫廷权利斗争，从身份低微的掌茶宫女，最终成为元朝皇后的故事。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131029015842.jpg', '韩国', '', '0', '6', '', '1', '1384334695', '9', '0', '0', '0', '0', '1', '1', '4', '8', 'qvod', '', 'qvod://275263565|DB4CDB24DDBA7DF60F36842B6E2840486DC04F30|奇皇后_2013_HDTV_01.rmvb|\rqvod://267217078|B849332CCE52FA978CB840ECC4A2667351E2ACEA|奇皇后_2013_HDTV_02.rmvb|\rqvod://267268002|E54B33C72327521FC1800871DFC2489AAB1650FC|奇皇后_2013_HDTV_03.rmvb|\rqvod://286831553|F001180CA0A4F28542A2174AAE582EAD29C88B8B|奇皇后_2013_HDTV_04.rmvb|\rqvod://281657785|C43E61050EFD28971D510C016974FA159BC4B1EB|奇皇后_2013_HDTV_05.rmvb|\rqvod://286804194|8C30B0011B71BA5E2A22147E4E1080926A2D569D|奇皇后_2013_HDTV_06.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75878', '', 'Q', '', '5.0', '4', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('54', '16', 'On Call 36小时2/On Call 36小時II/OnCall36小时2[国语]', 'DVD', '', '', '马国明,吴启华,杨怡', '潘嘉德', '各司其职、各安其位，医院内无论哪一个工作岗位，都是保护生命的斗士。 \r\n　　面对着垂危的病人、带病有孕的子妤，一健执着地要把一切全都扛在肩上，沉重得令他难以喘息。此时再遇上意见不合、封刀多时的大国手洛彦笙，而子妤又病发流产，被逼放弃外科医生的岗位，这一切都让一健在人生路途上受到莫大的冲击。 \r\n　　子妤为了让一健明白到放下执着、活在当下的真谛，毅然转科重新学习。一健霎时难以接受，但看着从前的沛聪、美雪、晶晶等人日渐成长，各大自成为独当一面的医生，在洛彦笙与子妤启发与鼓励下，一健终于明白到一个医生就如一位斗士，要知道自己的能力，守着自己的岗位，才能保卫别人的生命。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105150339.jpg', '香港', '', '0', '7', '', '1', '1384334695', '9', '0', '0', '0', '0', '1', '1', '5', '6', 'qvod', '', 'qvod://364993264|DA0D292CB19C80EEB295E93AACC9861FD8D9D81E|OnCall36小时2.国语_DVD_01.mp4|\rqvod://303861847|01FA504382C32AED25EE47ADE724F2D901CDED5C|OnCall36小时2.国语_DVD_02.mp4|\rqvod://303439538|A8C7E2C96C5BCEC6CCADFD8FE59687B8FF9074A8|OnCall36小时2.国语_DVD_03.mp4|\rqvod://305276095|CDBD30F5241F9246554884626D554000F5DD6097|OnCall36小时2.国语_DVD_04.mp4|\rqvod://279316242|48378E060A231F2C0537836C549AEF3E02E60C15|OnCall36小时2.国语_DVD_05.mp4|\rqvod://357278883|31F90E8305E8E18A8EB16D8A68FA79E470C50E4C|OnCall36小时2.国语_DVD_06.mp4|\rqvod://361324628|7CFD9062C18D6586595BFB5046557E459BDBABF9|OnCall36小时2.国语_DVD_07.mp4|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76111', '', 'O', '', '8.0', '6', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('55', '16', '新变色龙[港剧]', 'TV', '', '', '潘志文,刘纬民', '未知', '故事发生于《变色龙》完结三年之后。贺升得以减刑出狱，可是廉政公署仍以贪污罪将其送上法庭。邝志立不计前嫌，为贺升打赢了官司。邝、贺、程三家人重归于好。 此后，这三家人又遇上了曾、周、脱三家人，而每家都有本难念的经。 名门曾家三少曾世昌与程望棣结为夫妇，可惜曾世昌生性怕事，而且曾家大嫂杜若兰与二少爷曾世藩无休止的明争暗斗，令她陷入了被孤立，只能选择离婚。另一方面，邝志立与周可儿发展感情失败后，终于明白自己心中只爱望棣。无奈，在宿敌黄大钧授意下，一名杀手突然将立枪击至昏迷。 中医周乃波个性冲动鲁莽的儿子“叉烧”，实为杜若兰亲生子。因为缺乏沟通，周氏父子总是摩擦不断。杜若兰视子如命根，不惜抛弃事业及名利，甚至牺牲了性命。 踌躇满志的少年郭建华，为了事业入赘脱家，奈何婚后女儿出生，妻子却撒手人环，岳父脱彪视其为贪财好色之徒。两人心结难以解开。 阿立醒来后，连同阿升、望棣、华仔以及文叔一同对付最可怕的敌人黄大钧，而黄大钧亦与前探长刘炳炎狼狈为奸。经过持久的争斗，阿立等人终于将黄大钧绳之于法。阿立与望棣，阿升与嘉媛有情人终成眷属。邝、贺、程、周、脱五家人齐聚一堂，过去恩怨纠纷终于烟消云散，共同祝贺脱家小女生日快乐。', 'http://175.6.0.111:8058/vfolder//upimage/201308//20130820011643.jpg', '香港', '', '0', '62', '', '1', '1384334706', '9', '0', '0', '0', '0', '1', '1', '8', '6', 'qvod', '', 'qvod://237724496|E4EE5F57E444E20FC3EAD1243A890537B5413E2B|新变色龙_TV_01.rmvb|\rqvod://222320371|F6F07CEA5A508BCA4A2EDA57129CC9DAA6ABC2D9|新变色龙_TV_02.rmvb|\rqvod://239482185|5E44E0A6B5AD85DEC3B4A623BF1CD054E91D8986|新变色龙_TV_03.rmvb|\rqvod://231500730|6ADBAFF844BB177C6B2533FDB7DB8EF82276F760|新变色龙_TV_04.rmvb|\rqvod://213656952|A63731C9C5BE7504D45457F6E68D5EA469CDAC63|新变色龙_TV_05.rmvb|\rqvod://227233889|C7292AF91FC1017CE16C75C7C0960B9E3715417A|新变色龙_TV_06.rmvb|\rqvod://227539376|BACB834E4EB074A74701EAD012405CD27278E80B|新变色龙_TV_07.rmvb|\rqvod://246113195|C94A422EB90F65D22FCB405D0B309784FD4456BB|新变色龙_TV_08.rmvb|\rqvod://240724863|A0197BE0280556BFE99F29AFDB5FF96E0CA6B44D|新变色龙_TV_09.rmvb|\rqvod://223527090|775A63D935B93DB60DEC67A8DE12A0C5E1EA983A|新变色龙_TV_10.rmvb|\rqvod://225175454|2FB19FDC1AE4162295B5B200EB338E1DC7E26636|新变色龙_TV_11.rmvb|\rqvod://212096645|66A3C187C37952EBC3464F666276B7D1EE6406F8|新变色龙_TV_12.rmvb|\rqvod://225991344|A97B800E3FB4EF728FCD8BE211944EC58100BC28|新变色龙_TV_13.rmvb|\rqvod://217777384|0BD33C3C10CD72B06EF04704D49E8283FCFD92DF|新变色龙_TV_14.rmvb|\rqvod://232070383|D1288F4DDC6324D5CDAC7770103227416B1F799D|新变色龙_TV_15.rmvb|\rqvod://228281527|21162A4BC62B11A1DF4CED07AA0050DD03996304|新变色龙_TV_16.rmvb|\rqvod://21800573