INSERT INTO `ff_vod` VALUES ('65', '20', '囧女珍娜第三季/尴哩个尬第三季/囧娜第三季', 'HDTV', '', '', '阿什利·理查兹,博·米尔乔夫,布莱特·达文,Jillian,Rose,Reed,杰茜卡·路,Molly,Tarlov,Greer,Grammer,Desi,Lydic', '未知', '　  Jenna本是一个不惹人注意的女孩，但一次诡异的「误会」却让她成了众人谈论的焦点，这将永远改变她的生活。与此同时，Jenna正秘密与学校里最受欢迎的男生交往，被迫接受一个坏女孩的欺凌，还必须面对父母的责难。', 'http://175.6.0.111:8058/vfolder//upimage/201304//20130419103346.jpg', '欧美', '', '0', '13', '', '1', '1384334695', '6', '0', '0', '0', '0', '1', '1', '6', '8', 'qvod', '', 'qvod://101128757|F5C5ADD149271DE2661A9D7840E18E01DB3FFC4A|囧女珍娜第三季_HDTV_01.rmvb|\rqvod://95314085|9623B6FC11A027917C1620A779CDE0CAA721709C|囧女珍娜第三季_HDTV_02.rmvb|\rqvod://124111531|A93AC80B4C914007F43822B838DEF0D0FA73F092|囧女珍娜第三季_HDTV_03.mp4|\rqvod://110457776|8D559FA4D938A7E3D9D112677476FC97C648115B|囧女珍娜第三季_HDTV_04.rmvb|\rqvod://93222123|1FFEE903916317E480574A4FFD23A295C505688A|囧女珍娜第三季_HDTV_05.mp4|\rqvod://218174121|50002E120EF686C35301EA51CD37B325480FD7EF|囧女珍娜第三季_HDTV_06..mkv|\rqvod://123397228|6550649A5FB0269B3ABA58CEEA680D4ECCB55881|囧女珍娜第三季_HDTV_07.mp4|\rqvod://259442775|C875586F374E4051D48E4E736F49AF50AA38B2A4|情何以堪第三季_HDTV_08.mkv|\rqvod://229172904|01C568DA87A6C5A9B4FA4DA7C7F7F7FDB73D640E|囧女珍娜第三季_HDTV_09.mkv|\rqvod://266142645|E9EFBE66607A0E9DF1057D47E82ADD96435E41B4|囧女珍娜第三季_HDTV_10.mkv|\rqvod://90498296|668381CF992C619D605189F8F1D40FDDF5789F9F|囧女珍娜第三季_HDTV_11.rmvb|\rqvod://251235584|6756B036FDEC6E8191CB1CDCC4322635F162D610|囧女珍娜第三季_HDTV_12.mkv|\rqvod://98694505|994F1C36619D3F6BC8012618645B7D845C4EB6A8|囧女珍娜第三季_HDTV_13.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=70375', '', '0', '', '2.0', '6', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('66', '16', '爸爸两边走', 'TV', '', '', '林韦辰,万绮雯,张文慈,吴廷烨', '未知', '香港男人在深圳建立家庭，在香港工作，每天“冲关”，奔走中港两地，面对工作及生活，这是每一个香港人及内地同胞所热衷的话题，【爸爸两边走】选择了这题材为主轴，剧情以温情伦理为主导，故事以写实手法描述香港及内地人对婚姻及感情的看法，回归之后香港及中国之间生活变迁为重点，以亲情及爱情为原素。并以崭新手法，以国内全实景拍摄作包装，给予观众清新写实的感觉。演员阵容鼎盛，包括：林韦辰、万绮雯、张文慈、袁文杰、江美仪、吴廷烨、楼南光、吕有慧、谢雪心、杜挺豪等，全情投演，反映社会实况。\r\n　　任职男护事的曾耀乾，带着儿子曾诚到机场妻子接机，无意中发现了妻子方泗曼原来与上司杨永祥有奸情，耀乾曾经想挽救这段婚姻危机，无奈妻子将婚姻及事业挂了勾…结婚七年，妻子由一个护士晋升至行政经理，而耀乾还停留在男看护阶段，夫妻的距离由近而远，渐渐同床异梦。耀乾知道无法挽救这段婚姻，欲与妻子离婚，妻子感觉对家庭仍有责任，不肯离异，耀乾为了让妻子死心，带着儿子离去，回到深圳暂住。\r\n　　耀乾一边在香港工作，一边要回到深圳照顾儿子，开始了爸爸两边走的生活，耀乾每天“冲关”时发觉，原来有很多香港人也是跟他一般的遭遇，每日奔走中港两地，面对工作及生活。当耀乾渐渐适应了中港两边走的生活后，开始在国内认识了不少朋友，其中一个是弱视的钢琴教师常萍，常萍虽然弱视，但人却坚强，对生命充满寄望，不但不需要人照顾，还能反过来照顾耀乾及曾诚…日久生情，耀乾与常萍渐成爱侣。\r\n　　常萍有一个愿望，希望能参加全国音乐比赛，可惜身体残疾使她不能如愿，耀乾想尽法子帮助常萍治好了她的眼疾，使常萍可以如愿，在数万人面前表演钢琴，常萍喜极而泣…而耀乾也在帮助常萍的过程里，在失败婚姻阴影中爬起来，重新做人。当耀乾及常萍感情成熟，准备结婚之时，却遇到最大的考验…泗曼与永祥的感情告终，想吃回头草，就算不能得回耀乾的爱，也要得回儿子曾诚…最后耀乾面对情义的抉择，作出了一个肯定的抉择…继续爸爸两边走的生活。', 'http://175.6.0.111:8058/200911/17/121529375.jpg', '港台', '', '0', '22', '', '1', '1384334698', '4', '0', '0', '0', '0', '1', '1', '9', '2', 'qvod', '', 'qvod://219004165|EDCC3100C4661C1722458F6A66CD79FE757A292D|爸爸两边走_TV_01.rmvb|\rqvod://217528834|36F189476B2DD0BFEA9869486FA66C9C503C0105|爸爸两边走_TV_02.rmvb|\rqvod://219807360|33058219E36CF7A9B745B7274611C90721B0FAE7|爸爸两边走_TV_03.rmvb|\rqvod://217110686|9F75526C634D2DCEC59327879E87F8ED84B7F432|爸爸两边走_TV_04.rmvb|\rqvod://218177114|CB21EF3F13D707644E986E5787AAAF4F289E490B|爸爸两边走_TV_05.rmvb|\rqvod://218757314|AB4A95A4361BFA46B544EC46B802AE8773CD6A1E|爸爸两边走_TV_06.rmvb|\rqvod://217234003|10279F826B746CC67A6C73AF2FA24A708A503A62|爸爸两边走_TV_07.rmvb|\rqvod://217351753|12D3002D9470B0A08561800EE1D14A265A298ED8|爸爸两边走_TV_08.rmvb|\rqvod://217696835|DFD8B10CFD8864C7CE35C58E00C5411F812172F8|爸爸两边走_TV_09.rmvb|\rqvod://217163524|82D31E5FE859FF748310CEDFED0022A128E17263|爸爸两边走_TV_10.rmvb|\rqvod://217268041|7FD6E8EFC4DC64CDB32AD14ACD69EFE3070A25A3|爸爸两边走_TV_11.rmvb|\rqvod://217363587|E3716A034738A675FEFE0D24A6C9078D75B5C026|爸爸两边走_TV_12.rmvb|\