INSERT INTO `ff_vod` VALUES ('69', '16', '天蚕变[港剧]', 'TV', '', '', '徐少强,苗可秀,余安安,顾冠忠,伍卫国,马敏儿,张瑛,杨泽霖', '麦当雄', '少年云飞扬（徐少强饰）来历鲜为人知道，他虽与武当派掌门青松（张瑛饰）有一段不寻常的关系，但他在武当派却是地位卑微，其后获得一神秘黑衣人秘授武功。 \r\n　　青松与武林煞星独孤无敌（杨泽霖饰）三度较量，可惜俱败对方手下，使独孤无敌称霸武林。 \r\n　　武当山上接二连三发生离奇血案，皆涉及云飞扬，最后青松竟遭惨死，使他百感交集，遂离开武当山。当时，武林中有一种神奇武功「天蚕诀」，该种武功的秘诀在于「变」，倘若学者不精，束茧自缚，反连本身的武功也丧失，若能领悟其中奥秘，晓得如何变化，则可使武功臻至化境，成为武林中地位最高的盟主。 \r\n　　云飞扬经过无数离奇遭遇，终于学会「天蚕诀」，并且得到美人青睐，他与独孤凤（曲可秀饰）、傅香君（余安安饰）、伦婉儿（马敏儿饰）的缠绵绯测爱情，令他感到虽然能击败天下第一高手独孤无敌，但换来的只是一片悲哀。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130902194844.jpg', '香港', '', '0', '52', '', '1', '1384334693', '7', '0', '0', '0', '0', '1', '1', '5', '2', 'qvod', '', 'qvod://265778022|2F6B3682BFF9A0050158581FB007A0ABFDA4F623|天蚕变_TV_01.rmvb|\rqvod://244064494|00E9C12605E2BC1ADA410D5675398EC11CA3733E|天蚕变_TV_02.rmvb|\rqvod://217005846|5742BAA4DAC6B0D01501EF78E341D3DA3A7B6F76|天蚕变_TV_03.rmvb|\rqvod://235565547|DE532E8D525F8053A208C523B917E61F70A8FC2A|天蚕变_TV_04.rmvb|\rqvod://218337769|EA66D2F5B8FA1469CF2363F16313E3E2EC49D54F|天蚕变_TV_05.rmvb|\rqvod://241140278|646B933E2D6F4A95FB8C1AAD173E886F6BCB292B|天蚕变_TV_06.rmvb|\rqvod://244275134|E7488AE56767A63DAE319CE7A61A2FA84D4C7D1D|天蚕变_TV_07.rmvb|\rqvod://230583957|E2F2A0BEA34EA245D2454E6255423AEB782EE892|天蚕变_TV_08.rmvb|\rqvod://212238631|1ED7FDB365BBC65234928C5C126ED0FCAAF31BB7|天蚕变_TV_09.rmvb|\rqvod://201197954|1E30E246DA2F837C21B5FCA75EBA87F1570FA284|天蚕变_TV_10.rmvb|\rqvod://244819121|A8C47DB2AC287EAF99C5DD1548AC986B8471D679|天蚕变_TV_11.rmvb|\rqvod://226088060|506BB3AE163D0DB63BADA7B6BC16A24FAA5C1B02|天蚕变_TV_12.rmvb|\rqvod://222794256|8F4B7FF650F05B1CA7E539E9E01D947B02CA1691|天蚕变_TV_13.rmvb|\rqvod://236829097|38072C22F021695D5710325875C6163E9505F4B1|天蚕变_TV_14.rmvb|\rqvod://215467619|3651ADB201A8D52827F214D4937D4093335310BF|天蚕变_TV_15.rmvb|\rqvod://230091461|5C26FB34AA9399C9313F68446C30627FC908A499|天蚕变_TV_16.rmvb|\rqvod://220510144|B8FE3D2F467E5D6770C08F62E710D97EA3B4A53D|天蚕变_TV_17.rmvb|\rqvod://216517148|6C7AC58813E253382289341A63B915DBF297B227|天蚕变_TV_18