INSERT INTO `ff_vod` VALUES ('70', '4', '康熙来了[2013]', 'TV', '', '', '蔡康永,徐熙娣', '王伟忠,陈彦铭,詹仁雄', '《康熙来了》为台湾的电视谈话性娱乐节目，2009年前由中大制作公司（Chungta Production）制作，2009年起由金星制作公司制作，中天综合台于2004年1月5日开播，原名《奇怪十点钟》。“康熙”二字分别取自两位男女主持人姓名的第二个字：蔡康永和徐熙娣。最早节目开始构想是王伟忠找蔡康永开辟一个新节目为主持人，蔡康永同意并且有个建议要求，要邀徐熙娣作为主持搭档，蔡康永欣赏认为她活泼风趣无厘头风格和他有一庄一谐效果，两人一个知性一个搞笑风趣，最后促成节目形成。', 'http://175.6.0.111:8058/201203/23/20120323170319.jpg', '台湾', '', '0', '20131112', '', '1', '1384334698', '3', '0', '0', '0', '0', '1', '1', '1', '3', 'qvod', '', '20130101$qvod://283231769|6D76F46E0D20244E60D7C283E7C9E89810FAF2A8|康熙来了_TV_20130101.rmvb|\r20130102$qvod://280699393|97EDA4D28CE83D9A0F995B41C745259082833A5F|康熙来了_TV_20130102.rmvb|\r20130103$qvod://278935531|ED14D3D82A209DA9132AFA65D6F99AD119814915|康熙来了_TV_20130103.rmvb|\r20130104$qvod://281327802|60C7A33471E9D343A23E497EB2E141B1449CC4B4|康熙来了_TV_20130104.rmvb|\r20130107$qvod://282786034|0DDF06BD6D1D236C347439ED2CE639EBC835D1AC|康熙来了_TV_20130107.rmvb|\r20130108$qvod://281568446|FC3125712588E96C53EFA0BCB426027213060CCC|康熙来了_TV_20130108.rmvb|\r20130109$qvod://279857551|321FDDC1BB1C814E5DF21B6ABAD231D1EB6AB70D|康熙来了_TV_20130109.rmvb|\r20130110$qvod://283093096|197EC0E03FF1FC23B483C58E967D67F6FF4E5FDB|康熙来了_TV_20130110.rmvb|\r20130111$qvod://283495293|A53DDCE1E7CFEFA09A0B9B7CD2B20E8072256DF0|康熙来了_TV_20130111.rmvb|\r20130114$qvod://282835261|C0A232BCA5A156D20DD0B41A40ECDB2129D399E0|康熙来了_TV_20130114.rmvb|\r20130115$qvod://279938503|84228C74105B6D64DB1558BEEA0CFA920A5D4700|康熙来了_TV_20130115.rmvb|\r20130116$qvod://275914315|9F47D87E77C34972D1E6B24AB93F59207B32A187|康熙来了_TV_20130116.rmvb|\r20130117$qvod://282347255|4F6C5BD092EE6548FE3C407EA83BD0D6072C6953|康熙来了_TV_20130117.rmvb|\r20130118$qvod://280399246|8E8844CF78268BF9654EB72E63A08A4512413FC5|康熙来了_TV_20130118.rmvb|\r20130121$qvod://268157617|BD0BE8E5B212DE0BD1611E6EDAA54F80D57BA9D8|康熙来了_TV_20130121.rmvb|\r20130122$qvod://277560332|B741A7F81D87986DDBAF3453D181F200BB9DC2BD|康熙来了_TV_20130122.rmvb|\r20130123$qvod://266577882|5D4298F8314544C828B5