INSERT INTO `ff_vod` VALUES ('71', '16', '传爱事务所/法外风云[粤语]', 'HDTV', '', '', '黎耀祥,陈豪,陈法拉,伍咏薇,马赛,王浩信,高海宁', '徐正康', '本剧主角余英伟及李明扬皆为伶牙俐齿的遗产律师。在法庭上，一次又一次的互相比拼......\r\n    遗产律师的责任就是找出执行逝者的本意，英伟和明扬在“明炉金猪”，“龙头棍”，“真假发妻”等案中较劲，争论遗嘱的本意。“明炉金猪”一案，到底继承烧味传统精神重要？还是将烧味店发扬光大来的重要？“龙头棍”一案，“龙头棍”应该属於社团的公家物品，还是归於逝者的私人财产？后来他们发现，遗嘱内包含了逝者善意的遗愿，只有用善意来诠释，才可以令离世者无憾，在世者无怨。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131014223634.jpg', '香港', '', '0', '22', '', '1', '1384334698', '0', '0', '0', '0', '0', '1', '1', '2', '1', 'qvod', '', 'qvod://326919748|9A6C37C764D0F74F08754C9B66F82C3F89C24FD8|法外风云.粤语_HDTV_01.rmvb|\rqvod://325157692|5FE4959C259DCAD13B3E26D57DBDF174B67B8107|法外风云.粤语_HDTV_02.rmvb|\rqvod://311964533|EE6E8523331BCB1859A58761708E5BF99E4C6138|法外风云.粤语_HDTV_03.rmvb|\rqvod://315963933|3BFCA59306A73F8ABC19D59F680F892E8EC45D14|法外风云.粤语_HDTV_04.rmvb|\rqvod://321437039|BB02AFF7141B6A10F5F03F4962F3A7C031A6DFFF|法外风云.粤语_HDTV_05.rmvb|\rqvod://314869420|7110BADEF2328807C331A936BD966954B661DB69|法外风云.粤语_HDTV_06.rmvb|\rqvod://311419098|C6079AF8434D65A9B16BA3CF390D6A08234A61E2|法外风云.粤语_HDTV_07.rmvb|\rqvod://317448791|BF433F51BC2563987E9EAA251E99EB72DFA941E2|法外风云.粤语_HDTV_08.rmvb|\rqvod://319796919|76CE62C014F31832B01B06EE4224D20F1F5FED67|法外风云.粤语_HDTV_09.rmvb|\rqvod://317874647|EE25C436D84E4711FD422BB39AF673F266764D3D|法外风云.粤语_HDTV_10.rmvb|\rqvod://318471479|C8D2DF8A24425B380C27485281EF0DA4FBD9A10D|法外风云.粤语_HDTV_11.rmvb|\rqvod://321234552|B3DFBDA3E397AAC32C275AD2F0C3A16C8E84BE91|法外风云.粤语_HDTV_12.rmvb|\rqvod://319616863|BFD8C9DFEB9352128AD7B6E82979B40B087D63B2|法外风云.粤语_HDTV_13.rmvb|\rqvod://320637476|6B872BC801ED4904BF3D2E43B6802B2642A79FCF|法外风云.粤语_HDTV_14.rmvb|\rqvod://317514375|055BAFF1A675DA0AEE41B866763675A18EBD65C1|法外风云.粤语_HDTV_15.rmvb|\rqvod://319455326|EB793D068CFC1C9902AD818B312C625FEA6E89D9|法外风云.粤语_HDTV_16.rmvb|\rqvod://317189047|EA04101678AAAEF72E5B49139A16C51898BFF2E9|法外风云.粤语_HDTV_17.rmvb|\rqvod://318472795|75B03B844D224989C9B6A118EBF2A398AE8ACD7E|法外风云.粤语_HDTV_18.rmvb|\rqvod://318816889|2B1F774