INSERT INTO `ff_vod` VALUES ('72', '15', '金玉满堂之身世之谜', 'HDTV', '', '', '胡杏儿,穆婷婷,黄少祺,蒋毅,陆昱霖,于千景,邬倩倩,寇振海,苑琼丹,高雄,王静,何赛飞,刘洁,刘昌伟,倪齐民,王岗', '黄建勋,苏沅峰', '“刘记酒铺”历经风雨，迎来百年店庆。刘家孙女刘采凡主持拍摄店庆宣传片，意外与走失多年的刘家亲女儿张涵雁相遇。为保住自己在刘家的地位，采凡想尽办法阻止涵雁认祖归宗。当年，涵雁走失被田英收留，恰巧田英是采凡的生母。原来，田英生下采凡后，怕整日酗酒的丈夫张武带走采凡抵债，便把她送人。涵雁半工半读与田英相依为命，生活艰难却积极乐观。涵雁的身份揭晓回到刘家后，备受宠爱，与张易南的感情更加稳定。而采凡却因自己的过错被赶出刘家，她一时妒火攻心，选择与涵雁同归于尽，却自食恶果，身受重残。涵雁摒弃前嫌，悉心照料采凡，所有人为涵雁的举止感动，刘劲成和汤慧敏夫妇更是欣赏女儿的情怀，重新接纳采凡。家和万事兴，“刘家酒铺”迎来更加兴隆的百年。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131029202306.jpg', '大陆', '', '0', '39', '', '1', '1384334701', '6', '2', '2', '2', '1384427670', '1', '1', '6', '6', 'qvod', '', 'qvod://291426998|0F865B7205402E14F2C4BCB5C9901CC38D468222|金玉满堂之身世之谜_HDTV_01.mkv|\rqvod://292087166|218E6A9642E1933121AC5C7ACB117B07E2A66895|金玉满堂之身世之谜_HDTV_02.mkv|\rqvod://290978806|95C21EB383D0E5C610A72072DEC27E1D27B3B34F|金玉满堂之身世之谜_HDTV_03.mkv|\rqvod://293232437|19225B95975160942DD6A47CACC89905CB1A5559|金玉满堂之身世之谜_HDTV_04.mkv|\rqvod://288775145|9C45CA6D57EA1DF7F9A1787A8B356B69E822928C|金玉满堂之身世之谜_HDTV_05.mkv|\rqvod://291403271|36DE8019E65068A8B8F3CDACB717CF93054CCF2A|金玉满堂之身世之谜_HDTV_06.mkv|\rqvod://294801617|35E631F6122E1F3E002A77C856E48E83E32FFB80|金玉满堂之身世之谜_HDTV_07.mkv|\rqvod://291871689|4FB107AB46F0A159C1F5AA65556BA38D7EB9F2E0|金玉满堂之身世之谜_HDTV_08.mkv|\rqvod://289429931|EF51EE9ED5C41E413BDD50E293073F227911EAF6|金玉满堂之身世之谜_HDTV_09.mkv|\rqvod://268983233|8AFD867DEC017E20DA6E9A492A5009E67F2E1E49|金玉满堂之身世之谜_HDTV_10.mkv|\rqvod://267339719|C94FDAC13F7F3201578EDF037D66E4B312753005|金玉满堂之身世之谜_HDTV_11.mkv|\rqvod://266639389|9345F3A375CC5CC0B0E4445893FA1558B43A5205|金玉满堂之身世之谜_HDTV_12.mkv|\rqvod://285566162|5678EF6DC9A0FC0C4C4FA7D00349ADE030B93200|金玉满堂之身世之谜_HDTV_13.mkv|\rqvod://293104422|2677AEB20C89EDB5C9D23504A2F92C8EA8E95124|金玉满堂之身世之谜_HDTV_14.mkv|\rqvod://291652383|071C8408F2EEDF3385879A15DEE97AA83E2C6C0A|金玉满堂之身世之谜_HDTV_15.mkv|\rqvod://292369509|7099C61A78E8B51E5D43DC8E9C171E0BE1F513D8|金玉满堂之身世之谜_HDTV_16.mkv|\rqvod://290376714|023A6A0C9A33ABC8CC9E14523ECE46