INSERT INTO `ff_vod` VALUES ('73', '15', '我是特种兵之火凤凰/我是特种兵3[高清版]', 'HDTV', '', '', '徐佳,刘晓洁,程愫,杨舒,赵荀', '刘猛', '21世纪是一个人才和高科技主宰战争的世纪，我军区高层研究决定由雷战带领狼牙特种旅黑鹰突击队去选拔组建一支女子特战队——一支代号为“火凤凰”的奇兵。清华的高材生列兵叶寸心、体工队拳道高手沉兰妮、军医何璐、陆航团的彝族女子曲比阿卓、文工团演员唐笑笑、防化团炊事班的田果、欧阳倩和担任特战队教导员谭晓琳这八名女兵来自于不同部队的不同职位，她们怀揣着各自的理想集结在一起。近乎残忍的训练和实战让她们逐渐蜕变，最终以一个真正军人的姿态重新绽放生命，凤凰涅槃。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131023202205.jpg', '大陆', '', '0', '57', '', '1', '1384334701', '16', '14', '14', '14', '1384425211', '1', '1', '3', '5', 'qvod', '', 'qvod://283631853|6C1B6C2C200E103694FA0A8B24E92BADC663152F|我是特种兵之火凤凰_HDTV_01.rmvb|\rqvod://300500896|952D06AB0954F7E67D084CA241AAABD215F7F0C5|我是特种兵之火凤凰_HDTV_02.rmvb|\rqvod://314781377|EB93F766CD2D5A569715197AF5814E5883D35F20|我是特种兵之火凤凰_HDTV_03.rmvb|\rqvod://281317750|584C91C1C86095F806E1C417955A89156049C24A|我是特种兵之火凤凰_HDTV_04.rmvb|\rqvod://279683251|3A5E57DAFA6C127DD516060AE4A5193AB18D1B11|我是特种兵之火凤凰_HDTV_05.rmvb|\rqvod://308554795|6771C8B42C848881BC444CA6F557E8A748376F65|我是特种兵之火凤凰_HDTV_06.rmvb|\rqvod://279059036|9186C0C3575DA8EA211C62345ABD478FB4E6BF27|我是特种兵之火凤凰_HDTV_07.rmvb|\rqvod://275982995|A4B0447BD2DCD5202ABCA109505C8CF6506B681D|我是特种兵之火凤凰_HDTV_08.rmvb|\rqvod://294712849|A7C238102256FE6739EB3D5C5E23753F2EFE8510|我是特种兵之火凤凰_HDTV_09.rmvb|\rqvod://284335457|D2E07D94761B16418342B2E031D42C7A1C4F90F3|我是特种兵之火凤凰_HDTV_10.rmvb|\rqvod://302318631|45CCC27F66DF8179358ADB6DFE46B69D9180E231|我是特种兵之火凤凰_HDTV_11.rmvb|\rqvod://274774519|A45C0583C2E4F875D568C2D04D796A6AB2833C50|我是特种兵之火凤凰_HDTV_12.rmvb|\rqvod://306238400|3DD3AE9ABCB9EC4C1116C64276B6F2C1EC5BD3A1|我是特种兵之火凤凰_HDTV_13.rmvb|\rqvod://282727648|48C7ADBE35D62911691D3C556B41CCF6C5B56154|我是特种兵之火凤凰_HDTV_14.rmvb|\rqvod://301362273|6C593ECB176C217ECF70E5073DE4FFE56F994475|我是特种兵之火凤凰_HDTV_15.rmvb|\rqvod://299689031|2914AB4257123BF67AF73AD2B40ABFAC23E98068|我是特种兵之火凤凰_HDTV_16.rmvb|\rqvod://280746025|A645E98456971B3717DD536AD2B36B3D51A288C8|我是特种兵之火凤凰_HDTV_17.rmvb|\rqvod://281264787|27F31A891F9A017C4DA4B5408F5F5A7BFEB8F5DC|我是特种兵之火凤凰_