INSERT INTO `ff_vod` VALUES ('75', '15', '千金归来', 'HDTV', '', '', '李易峰,赵文瑄,李威,申敏熙,郑佩佩', '罗灿然', '该剧讲述了当代某沿海城市，一位单纯善良的女孩，在经历了家庭变故后，逐渐成长成为一个自立自强的成熟女性，突破重重障碍实现祖父的理想，并收获爱情的故事。沈长清是沈氏企业的继承人，年幼丧母的她由一心要将沈氏企业占为己有的养父潘伟森与表面温柔实则暗藏阴谋的继母丁雅琴抚养，并处处受到继母的女儿丁佳慧的刁难。沈长清不忍看到祖父的家业及立志慈善的心愿旁落，在生父欧海洋、痴心守护自己的林皓、阳光正直的金睿的帮助下，不断武装自己，成为足以与养父和继母抗衡的商界精英，在一次次的较量后最终守住家业实现祖父的心愿。在经历了重重磨难后，沈长清也看清了自己的心意，和林皓有情人终成眷属。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131030201659.jpg', '大陆', '', '0', '40', '', '1', '1384334693', '3', '0', '0', '0', '0', '1', '1', '6', '5', 'qvod', '', 'qvod://293763276|0DB9E9E20180F2C3540612E17AB7F638D09E06AF|千金归来_HDTV_01.rmvb|\rqvod://280983180|12C66330746FF5595EDDB1E6C482163D5EA44C1F|千金归来_HDTV_02.rmvb|\rqvod://340984109|84AB96B8BA8D6FF3BB8460B88BCBABCF789D3D07|千金归来_HDTV_03.rmvb|\rqvod://274294996|75E727F29E6DE6BA7F34F7BA02D4ED6E9153022E|千金归来_HDTV_04.rmvb|\rqvod://292656324|7A51BA59E776DF84C460243D5B98B1458984C9ED|千金归来_HDTV_05.rmvb|\rqvod://350797891|14B477118FC06C27DF25DBD5BCFA46A0E46DBAFF|千金归来_HDTV_06.rmvb|\rqvod://274416743|C9EE2116726E9223B1A223650903E28F38DB470F|千金归来_HDTV_07.rmvb|\rqvod://296560218|5A500C98E6A7E4530A7163361BB31B621F9D914D|千金归来_HDTV_08.rmvb|\rqvod://355179714|9C34D679E9343D4F64655CC0EB0DCCDCFF0A07F3|千金归来_HDTV_09.rmvb|\rqvod://276039577|5A35BBC817B5A83C4203F73D158B9849EAF30A24|千金归来_HDTV_10.rmvb|\rqvod://302130245|AEE58DECCF2ADA7159A2B52B028C7D6A5E1357C8|千金归来_HDTV_11.rmvb|\rqvod://281397213|AD30EFD5AE33ED47F61C463ED30B8D7D79043D43|千金归来_HDTV_12.rmvb|\rqvod://293979802|22FBE8341B8DFE0C7D5A4B5E18E3BA6CADE52C9D|千金归来_HDTV_13.rmvb|\rqvod://274670609|83B4302F35770A83F8DE0CADF3E466FB0F41126B|千金归来_HDTV_14.rmvb|\rqvod://297163724|D26B0D618A1396B5F1BBEFBB91A4FD21C04DB118|千金归来_HDTV_15.rmvb|\rqvod://350480250|5F2DF667ACE72C63760CBFB2251A1862AB020C6E|千金归来_HDTV_16.rmvb|\rqvod://274837948|7D66A91172F4797B8AC9D98C4BA223FC3FA02471|千金归来_HDTV_17.rmvb|\rqvod://294704012|6FBBB046C8540D064183281622B698DF1BCF9766|千金归来_HDTV_18.rmvb|\rqvod://359711716|13531CDE525B0D7D2843A9EF74