INSERT INTO `ff_vod` VALUES ('81', '15', '独有英雄/我就是角儿[1-26高清]', 'TV', '', '', '周一围,包贝尔,薛佳凝,李小冉,林园,刘佳,班杰明', '杨文军', '1912年春天，当红小生马玉郎，为寻父亲，单枪匹马前往枣庄，一路险象环生，他凭借自己的机智不仅屡屡为险为夷，结识了一群与他的生命息息相关的人外，还意外拥有了一口改变他一生的古窑。当上窑主后，他亲自下井，感受到井下工人的艰辛与危险，张启之和白双凤的改革思想，天津与上海的先进技术更是激发了他要用先进的生产力来改变窑工的工作现状的雄心壮志。面对四大窑主和以军阀保守势力的觊觎以及帝国主义对中国煤炭虎视眈眈的双重压迫，他与白双凤、张启之等人立誓要以生命保卫中国这条黑色的命脉。马玉郎，他用了整整十年的时间从戏班的小舞台走向了历史的大舞台，实现了从角儿向实业救国的企业家的蜕变。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131024230721.jpg', '大陆', '', '0', '34', '', '1', '1384334701', '0', '0', '0', '0', '0', '1', '1', '3', '7', 'qvod', '', 'qvod://319694193|32C73EC93DFE7C20D0528CB6E74722D973C550BA|独有英雄_HDTV_01.rmvb|\rqvod://318767499|43F48F002873C6093AF78A77B595CC43EAAB958E|独有英雄_HDTV_02.rmvb|\rqvod://282257493|C05681470920E9AB959C263CAF0982ACCC77A87E|独有英雄_HDTV_03.rmvb|\rqvod://280485844|84D7A50B5C870299A45C9A3DBC2DA4969CB6BE9C|独有英雄_HDTV_04.rmvb|\rqvod://320708802|EDC3031AFC06FC3F54718B0FBC27A0A936C31486|独有英雄_HDTV_05.rmvb|\rqvod://301549661|A3CDC271EC89FA09696D9353CCDE9EA87D2333F8|独有英雄_HDTV_06.rmvb|\rqvod://283370347|B6ADB724093ED75E3CD7E827FAB0B9A593417976|独有英雄_HDTV_07.rmvb|\rqvod://283633677|EAAE9B4E8BF6C92EA16DD808607237AF616294CB|独有英雄_HDTV_08.rmvb|\rqvod://296354160|23EFAEE94D6E0ACE00001CE732AA0A6184AEBD54|独有英雄_HDTV_09.rmvb|\rqvod://327680819|88D7123D5F4ACB2C0A689F22BFEFD1A892F1205F|独有英雄_HDTV_10.rmvb|\rqvod://319705877|F3B5F7C3153AD3E60E57933317B96F06BDB5B9AE|独有英雄_HDTV_11.rmvb|\rqvod://313749809|4AA9526EB52BC2D498C51CCF580745094F6E42DB|独有英雄_HDTV_12.rmvb|\rqvod://301946270|F3AF0CD9D27082E76823EF358594BE8914698EBD|独有英雄_HDTV_13.rmvb|\rqvod://315696953|23E7C01709CB4EF8BE570CD97B2B4177E8F6664F|独有英雄_HDTV_14.rmvb|\rqvod://322401535|419F1D109B0ADD67C5885DDA094AE9141F5E651E|独有英雄_HDTV_15.rmvb|\rqvod://309849546|55C2D1CF6065385CDCA1973DB790CBCA372FD645|独有英雄_HDTV_16.rmvb|\rqvod://274687523|C1AF38C28E64D375511CF2FB1B636791A23E877F|独有英雄_HDTV_17.rmvb|\rqvod://276777600|2556FC089AF93F1A3B0E50FFA92903A75F5F4BCC|独有英雄_HDTV_18.rmvb|\rqvod://313493015|E533