INSERT INTO `ff_vod` VALUES ('83', '16', '揭秘[新加坡]', 'DVD', '', '', '刘子绚,黄腾浩,陈邦鋆', '未知', '故事描述一间以上流社会为服务对象，专门替客户解决“疑难杂症”的公关公司。为了处理纠纷而秘密组织了一队精英成员，帮助个案的苦主做危机控管，减低当事者的声誉、感情与家庭的伤害。剧中的男主角温昌渝（黄腾浩饰）是一个极度聪明，为求完成任务无所不用其极的电脑法医。外表乐观但内心却有段不为人知的秘密的他，遇到了极富正义感的邝芸香（刘子绚饰)。两人工作上是上司与下属的关系，每每因为个案而起争执，最后却“吵”出了感情，形成白天是“对头”，晚上是“情侣”的奇妙关系。《揭秘》将会以二至三集为一个案件单元，带出数个改编自真实网络个案的故事。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105211951.jpg', '香港', '', '0', '5', '', '1', '1383714803', '2', '0', '0', '0', '0', '1', '1', '4', '4', 'qvod', '', 'qvod://221124743|802A127BA4C386477A074BDE70C1173ECC469BBE|揭秘_DVD_01.rmvb|\rqvod://233918692|99D02D1B8C977D40636FA9B98F6E12ADF0F147BF|揭秘_DVD_02.rmvb|\rqvod://222879263|BCCEDC27150BEC25BFE7CF3462001C181A81725E|揭秘_DVD_03.rmvb|\rqvod://222663002|51C6A2A82689AF1AAF98609C513BA60395502030|揭秘_DVD_04.rmvb|\rqvod://213421854|7FD33D03FEFB6EF9127D1140CA5BCD07848C80F7|揭秘_DVD_05.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76135', '', 'J', '', '7.0', '2', '1', '0', '0', '0');
