INSERT INTO `ff_vod` VALUES ('85', '3', '大雄的秘密道具博物馆/哆啦A梦：大雄的秘密道具博物馆', 'DVD', '', '', '水田わさび,大原めぐみ,かかずゆみ,木村昴,关智一,千秋', '寺本幸代', '哆啦A梦大雄的秘密道具博物馆全集简介：在某个深夜，哆啦A梦正在熟睡着……然而，有一只黑手突然从一个神秘黑洞中伸出，把哆啦A梦脖子上的铃铛偷走，哆啦A梦半睡半醒地摸到自己的脖子，一声尖叫说自己的铃铛不见了！然后，穿着侦探服的大雄在聚光灯下亮相，开始帮哆啦A梦找铃铛，紧接着，画面转向一栋大楼里，大雄他们被一堆秘密道具环绕着。', 'http://175.6.0.111:8058/vfolder//upimage/201308//20130811084933.jpg', '日本', '', '0', '0', '', '1', '1383714803', '6', '0', '0', '0', '0', '1', '1', '9', '3', 'qvod', '', '1$qvod://733859800|D773893B7EC9F5814E36196B958D866B544A8C39|哆啦A梦2013剧场版.大雄的秘密道具博物馆_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=73602', '', 'D', '', '1.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('86', '16', '有爱一家人[QMV+]', 'TV', '', '', '宥胜,房思瑜,周晓涵,李运庆', '未知', '这是一部描述“幸福居”民宿三个女儿与一位长工的故事。在剧中，万圣仁（宥胜 饰）的妈妈以家规规定30岁前必须结婚，逼他相亲尽快成家，但圣仁对小时候给他温暖的小天使却念念不忘，然而线索只有一条手帕。这时刚好看到新闻正在报道“幸福居”民宿，招牌图案跟手帕上的图案一模一样，于是圣仁去应征长工，认识了有爱（房思瑜 饰）三姐妹。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131022203458.jpg', '港台', '', '0', '8', '', '1', '1384334693', '9', '0', '0', '0', '0', '1', '1', '4', '8', 'qvod', '', 'qvod://203240777|0254DCC99042F6D82C9C59BDB181217C94F28D7B|有爱一家人_2013_HDTV_01.QMV|\rqvod://203797809|E400B08B7C2154D1FD010F1C722EF9B3F818E11E|有爱一家人_2013_HDTV_02.QMV|\rqvod://203455045|44776661144E346D2697DFEFD602C46D82A5F382|有爱一家人_2013_HDTV_03.QMV|\rqvod://203343345|E8D56B4F8946B18837E268524C5BC513C98582EB|有爱一家人_2013_HDTV_04.QMV|\rqvod://204812344|0C41287A0A58B3610EDA4CE7AA6F510D86B0CEC5|有爱一家人_2013_HDTV_05.QMV|\rqvod://202486450|B2188035626E00C5480D7073BEB520FFAECF6491|有爱一家人_2013_HDTV_06.QMV|\rqvod://204288871|13D0FC1E72927222B5D06652902105EBAFAE713C|有爱一家人_2013_HDTV_07.QMV|\rqvod://203731879|8AD873491E2B8C56F0A2A04561630F028D8071C3|有爱一家人_2013_HDTV_08.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75728', '', 'Y', '', '4.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('87', '15', '一克拉梦想', 'HDTV', '', '', '蒋梦婕,姚元浩,迟帅,刘一含,阚清子', '黄祖权', '刘美丽，一个天真、有梦想的奋斗型女孩。她为了实现成为国际知名设计师的梦想，走上了中国梦想秀的舞台。尽管梦想舞台没能为她转动，却也给她完成另一心愿的机会——呼吁热心人帮她找寻失散的妹妹。然而美丽从未放弃自己的设计梦想，努力投考服装业巨头云想公司，却在云想撞上命中冤家周旋，与其产生了一段剪不断理还乱的关系。当云想与天衣两大服装业龙头的商业大战如火如荼地展开，美丽身不由己地卷入其中。随即其身世谜团被逐步发现，无奈置身其中的美丽却始终坚持着她的梦想，用她有如天使一般的心灵影响着周遭的人们，当所有浮华褪尽，是如钻石般璀璨的梦想照亮前路。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131027201157.jpg', '大陆', '', '0', '34', '', '1', '1384334701', '4', '0', '0', '0', '0', '1', '1', '2', '6', 'qvod', '', 'qvod://270411665|C2A9ACDE017DDB9620AC27A122CBE3531929D83F|一克拉梦想_HDTV_01.mkv|\rqvod://331045314|DEAF5A0EEDAED4C513EBD4065EFBA3F884399712|一克拉梦想_HDTV_02.mkv|\rqvod://291501174|8313B52E478D8DBEFCCA6A3A1AEE0115A1719EB4|一克拉梦想_HDTV_03.rmvb|\rqvod://319139320|A36F0D15B189002FF5E4C44B13D8D0787B845EE6|一克拉梦想_HDTV_04.rmvb|\rqvod://298238330|BCC48DE382B35405BC910B8D28428A64C052FCCE|一克拉梦想_HDTV_05.rmvb|\rqvod://321316341|C1497C46836EA612C7923AB507C34CC06EA3D419|一克拉梦想_HDTV_06.rmvb|\rqvod://305444940|076F4F3AAB8B9F1DD15F6B3F8C1456AE78C70837|一克拉梦想_HDTV_07.rmvb|\rqvod://313197457|B51E516B933A2271A3193BF309D165838C9D8BA6|一克拉梦想_HDTV_08.rmvb|\rqvod://308582935|DD74865335459E204720EDBB5080005CD60443B1|一克拉梦想_HDTV_09.rmvb|\rqvod://321396486|071100DF2FF8062ED590B236D13068DD249C7B5B|一克拉梦想_HDTV_10.rmvb|\rqvod://314696283|388F74C639CD84A42C6A1487B5826937175FC73A|一克拉梦想_HDTV_11.rmvb|\rqvod://321131940|DD14572096C14FBFA56B7FD0E2E6579959FD7522|一克拉梦想_HDTV_12.rmvb|\rqvod://316249343|81728C8ADE55F510E6D36128AE7459B7E09B7B32|一克拉梦想_HDTV_13.rmvb|\rqvod://328497905|7CA15858CAC29AD4E5A640AF1905AEE4FD7AF77D|一克拉梦想_HDTV_14.rmvb|\rqvod://318605454|D1726B0C615333398588EABB43AE76E8D5C09A2C|一克拉梦想_HDTV_15.rmvb|\rqvod://315862966|CF14FF458AB6B3F7DA518417D40892407866A31E|一克拉梦想_HDTV_16.rmvb|\rqvod://313315497|48ECAEFB314F2405C2C5594B761FF110928EE540|一克拉梦想_HDTV_17.rmvb|\rqvod://308544743|D90260410FCA2016FBD2759477A4A221DFDD82DB|一克拉梦想_HDTV_18.rmvb|\rqvod://308205677|AEA99C661855B563061BC9C92