INSERT INTO `ff_vod` VALUES ('88', '20', '罪恶黑名单/黑名单第一季', 'HDTV', '', '', 'Annet,Mahendru,詹姆斯·斯派德,迪亚哥·克莱特霍夫', '乔·卡纳汉', '几十年来，绰号「红魔」（Red）的前军事情报官员Raymond Reddington（James Spader）一直是联邦调查局通缉犯名单上的重要人物。他为全世界形形色色的罪犯代办各种交易，撮合非法生意，被人们称作「犯罪世界的管理员」。然而令人大跌眼镜的是，他竟然主动向从来没有抓住过他的联邦调查局「自首」，并提出一个神秘但是惊人的条件：他愿意帮助联邦政府抓住所有人都认为早就死了的恐怖分子Ranko Zamani，但他只和一个联邦探员对话——Elizabeth “Liz” Keen（Megan Boone），一位刚刚结束训练成为联邦调查局初级分析师的「菜鸟」。Liz被这突如其来的情况搞得一头雾水——这可是她第一天上班啊！ 　　联邦调查局当然很想根据Red所说的线索来阻止臭名昭著的恐怖分子发动大规模袭击，但接下来一系列匪夷所思的事件令他们不能不产生怀疑：Red的真实动机究竟是什么？为什么他选择Liz——一个看起来和他没有任何关联的年轻女人？Liz是否有不为人知的秘密？除了Zamani之外，Red手中还掌握哪些罪犯的信息？事实上Red手中的确掌握着一份「黑名单」——这些年来与他打过交道的政客、匪徒、间谍和国际恐怖分子全都榜上有名。Red承诺帮助联邦调查局抓住所有与他合作过的罪犯……只要Liz继续以「搭档」的身份待在他身边。Red打算教Liz「用罪犯的方式来思考」，并且掌握「总揽大局的能力」——无论她是否愿意。 　　Ryan Eggold扮演Liz的丈夫Tom，可能隐瞒了一个秘密。 Diego Klattenhoff扮演主管外勤任务的联邦调查局探员Donald Ressler。 Harry Lennix扮演联邦调查局反恐处副处长Harold Cooper，事业成功，愤世嫉俗。 Ilfenesh Hadera扮演Liz最好的朋友Jennifer Palmer，也是一名联邦探员。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130924181655.jpg', '欧美', '', '0', '8', '', '1', '1384334704', '1', '0', '0', '0', '0', '1', '1', '7', '3', 'qvod', '', 'qvod://205973469|3AC0ED8C2658F90475467F69FD75759A73DBA5F8|黑名单第一季_HDTV_01.rmvb|\rqvod://243099170|81F3D91B63CE0BAB8AF2B21A06AFAAE002422324|黑名单第一季_HDTV_02.mp4|\rqvod://415800690|AE361EE05D69B442E483F5B0B2FE111723C8ACC3|黑名单第一季_HDTV_03.mp4|\rqvod://200196501|EE1C641F3A230CA3F8DA67187D89DF8723B68D2B|黑名单第一季_HDTV_04.mp4|\rqvod://499644872|22693EB7F92FE0F44E1384D7F6232F6FF5B0CD57|黑名单第一季_HDTV_05.mkv|\rqvod://145598276|FDFF359711161E8C3A16D039F356D85BE2F90FE0|黑名单第一季_HDTV_06.rmvb|\rqvod://273634214|7C9BE175F43FA467DDA4A9289F845CD0F0E8693B|黑名单第一季_HDTV_07.rmvb|\rqvod://505122523|762E02D5DC5AD67386FAB0C9F0D1C2228614FB50|黑名单第一季_HDTV_08.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74868', '', 'Z', '', '6.0', '9', '1', '0', '0', '0');
