INSERT INTO `ff_vod` VALUES ('95', '18', '白马王子 纯爱适龄期', 'HDTV', '', '', '优香,三浦贵大,中村俊介,新井浩文,河北麻友子,山田真歩,优希美青,柳下大', '熊坂出,本田隆一,守屋健太郎', '探索女性内心的声音，大人真实的爱的物语“我没有被谁所爱，所以至今只身一人”——在女子高校工作的32岁教师，原多香子。 恋爱中受了伤，在孤独与不安中快破碎之时，比她小七岁的新任教师小津出现，心里有了久违的恋爱的悸动。 但是！小津已经有了婚约！并与曾经出轨对象黑泽也有千丝万缕的联系，恋爱变得越来越扑朔迷离。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131024182751.jpg', '日本', '', '0', '3', '', '1', '1383714803', '9', '0', '0', '0', '0', '1', '1', '7', '6', 'qvod', '', 'qvod://243606157|A85C7901CA8F8404C8D83F909AFAEA869131D27B|白马王子纯爱适龄期_HDTV_01.rmvb|\rqvod://279910162|8CBE000A92D816D6AEA9785A976C3F5EC6D5AB07|白马王子纯爱适龄期_HDTV_02.rmvb|\rqvod://276804256|4B4B457D927A46D09A1E2315F53AB3672D335953|白马王子纯爱适龄期_HDTV_03.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75794', '', 'B', '', '3.0', '1', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('96', '15', '莞香[缺1-2]', 'TV', '', '', '曹颖,刘钧,颜丹晨,沙溢', '未知', '以寮步香市盛衰为主线，讲述了莞香世家种香、卖香、品香的曲折故事与抵抗外敌的壮志豪情，再现了具有东莞民俗史价值的莞香传奇。该剧以清末民初为历史背景，讲述了易家、莫家和麦家三大家族在风云动荡的岁月中，为保护和传承莞香这一祖先流传下来的文化瑰宝而展开的一段商战传奇。《莞香》剧本经三年打磨而成，故事气象宏大，情节跌宕起伏，既有扣人心弦的恩怨情仇，又有缠绵非测的感情纠葛，更有抗击外敌的英勇斗争，集商战、爱情、战争、传奇于一身，展示了一幅莞香文化的历史长卷，描绘了一段可歌可泣的英雄史诗。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131018193627.jpg', '大陆', '', '0', '29', '', '1', '1384334715', '6', '0', '0', '0', '0', '1', '1', '8', '2', 'qvod', '', 'qvod://157481869|B0965F7E605CA6FC6A55D9C5F90383ACCA6676D5|莞香_TV_03.rmvb|\rqvod://127532733|98F675E4DE45E1B3BBD7E74F692BA4CF05B7880D|莞香_TV_04.rmvb|\rqvod://144025635|7FD1EF7E47FF039846CB64AC9BCC07A91C515915|莞香_TV_05.rmvb|\rqvod://143356223|5F8013CAC862F2A04AA01626A42E0EC210A376C6|莞香_TV_06.rmvb|\rqvod://143078730|48107140BC82A52068C39ED66D2B77A8E1D48A47|莞香_TV_07.rmvb|\rqvod://143135026|8257B4A459C832CB02120F72F7AF0A73FBA5DBFD|莞香_TV_08.rmvb|\rqvod://143176833|71FD6115D061203FDBF9F2E58E2D058A18461E33|莞香_TV_09.rmvb|\rqvod://303321830|9FD96216847B72CAA45664D00E7D9CBD99A794FA|莞香_TV_10.rmvb|\rqvod://227435882|79AECF000EC068DD9C93E7091ADB61051D7012F2|莞香_TV_11.rmvb|\rqvod://299159220|B122C0820FD4FF6463F4EDB1BC4586EE7332D2BD|莞香_TV_12.rmvb|\rqvod://303608034|64E2D8B360D0C27ABF14A43AE74BEC3E0739F8F6|莞香_TV_13.rmvb|\rqvod://303850454|F706A2BBD48B70084AD7F8040E18A331DD44CF42|莞香_TV_14.rmvb|\rqvod://305989044|E330DD3286D67FD7FEBA363C7D9C999A4915E9B1|莞香_TV_15.rmvb|\rqvod://298762635|9BB7802325C5CC61046DE24BCD94E6F341CF624E|莞香_TV_16.rmvb|\rqvod://298540597|2C51BFBE718A64E025AD9591F5575EA1A92A0472|莞香_TV_17.rmvb|\rqvod://318144790|DECA301DE6EF11ADC1D9251DDF38CC195BFB4BA0|莞香_TV_18.rmvb|\rqvod://301216335|BA02627AC720CECFDA89DA3E73133E5AB41A7698|莞香_TV_19.rmvb|\rqvod://301216335|BA02627AC720CECFDA89DA3E73133E5AB41A7698|莞香_TV_19.rmvb|\rqvod://331895256|5D2214185B622F6982A1E8E25128C257BC358D19|莞香_TV_20.mp4|\rqvod://296904865|18AC12A9432DE6CF5981E1E181C33B6681145C60|莞香_TV_21.rmvb|\rqvod://29913173