INSERT INTO `ff_vod` VALUES ('97', '20', '沉睡谷/断头谷第一季', 'HDTV', '', '', '约翰·赵,妮可·贝哈瑞,,卡蒂亚,温特,奥兰多·琼斯,Patrick,Gorman,汤姆·米森,Dwayne,Boyd,理查德·赛特伦', '伦·怀斯曼', 'CW的《断头谷》由《疑踪》（Missing）的两名编剧开发，据称是一部「挑战电视恐怖故事底线」的恐怖剧集。该剧根据近代沉睡谷故事的源头——「美国文学之父」华盛顿·欧文以沉睡谷的故事为基础于1799年创作的经典作品《沉睡谷传奇《沉睡谷传奇》——改编，是一个现代版的沉睡谷故事。在该剧中，FBI探员Ichabod Crane来到沉睡谷小镇调查一起神秘的“斩首谋杀案”。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130917200652.jpg', '欧美', '', '0', '7', '', '1', '1384334704', '4', '0', '0', '0', '0', '1', '1', '1', '2', 'qvod', '', 'qvod://459659125|F2E169FDD8C1BEEA744EBBA17D5DF3747C4F9561|断头谷第一季_HDTV_01.mkv|\rqvod://426963893|3611650D6695B9C1B2137743B5E8F8A5B5D5A4BB|断头谷第一季_HDTV_02.mkv|\rqvod://416573197|BAAD81AD794348EB72A34CCE0D26064ECB18BD12|断头谷第一季_HDTV_03.mkv|\rqvod://398108681|A0B67BE097D745CD69ABA370749660E8AA0FCA66|断头谷第一季_HDTV_04.mkv|\rqvod://386979413|8C9985F7DE199A663FF8EF83952993FA066C61E9|断头谷第一季_HDTV_05.mkv|\rqvod://426711909|023A214761F0A90E2BCEB16C6530CD1C9B72CB1D|断头谷第一季_HDTV_06.mkv|\rqvod://405243577|6FE4FFC66EB4B6B2BC5ADF0D16717A791BD2734B|断头谷第一季_HDTV_07.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74674', '', 'C', '', '6.0', '9', '1', '0', '0', '0');
