INSERT INTO `ff_vod` VALUES ('99', '20', '母亲大人 第一季/妈咪 第一季/母忧母虑 第一季/老妈们', 'HDTV', '', '', '安娜·法瑞丝,艾莉森·珍妮,考特尼·海根勒,弗伦奇·斯图尔特', 'Gary,Halvorson', 'Christy（Anna Faris）是那帕谷地一家高档餐厅的女服务员，已经戒酒四个月了。她竭尽全力来当一个好母亲，避免重蹈覆辙——过去她屡次做出错误的选择，差点把她的一生都给毁了！一切本来相安无事，直到Christy的母亲Bonnie（Allison Janney）决定搬来和她一起住。Bonnie和Christy一样也曾是个酒鬼母亲，屡次戒酒屡次再犯。这一次虽然又戒除了一段时间，但谁能保证她不再碰酒瓶呢？更糟的是，这次她会不会把女儿也一起拖下水？', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130924163859.jpg', '欧美', '', '0', '8', '', '1', '1384334704', '7', '0', '0', '0', '0', '1', '1', '9', '3', 'qvod', '', 'qvod://270371902|9841A4E9C85853AD0D06413BD114E393D11C5B70|极品老妈第一季_HDTV_01.mkv| \rqvod://252265334|F89A6399043C395A29B002A1F9257F3D1FDFC66C|极品老妈第一季_HDTV_02.mkv| \rqvod://245523446|5D9FB6F235DEC3F73A1D9E64CF03836CD2A3DD5F|极品老妈第一季_HDTV_03.mkv| \rqvod://241323430|05CD0E43BBCC50B8263C1365C5C7D23F5CC79261|极品老妈第一季_HDTV_04.mkv| \rqvod://254373081|03C5476894EC1341A56A7BD12ABDF713C0969C90|极品老妈第一季_HDTV_05.mkv| \rqvod://252891935|40BBF3D26B79ADC53481B15FD3B8B2A63497787B|极品老妈第一季_HDTV_06.mkv|\rqvod://249008277|26939C8E4143465B6CE748329986295E4A870D55|极品老妈第一季_HDTV_07.mkv|\rqvod://255827760|B639796B016AFC8D5EFC922FB30400D83A608ECE|极品老妈第一季_HDTV_08.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74864', '', 'M', '', '1.0', '6', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('100', '18', '被迫归来的33分钟侦探/33分钟侦探被迫归来', 'VCD', '', '', '堂本刚,水川麻美,野波麻帆,户次重幸,佐藤二朗,高桥克实', '福田雄一,成田岳', '33分钟侦探再次归来，虽然是被迫的。延续着前作的故事构造，五分钟就可以解决的案件却硬是被撑到了33分钟，不靠谱的侦探鞍马六郎（堂本刚 饰）的推理可谓语出惊人，他的智囊团们继续为他出谋划策，希望有幸猜中真正的凶手。\r\n    再度归来的33分钟侦探鞍马六郎和他的助理武藤里佳子（水川麻美 饰）继续追踪着棘手案件，他们和警察大田原（高桥克实 饰）组成探案三人组，力图寻找那些被别人忽视的细微角落。什么，凶手已经被抓住！不，在六郎眼里，这起案件绝对没有这么简单，真正的凶手还藏在幕后。让我们跟随着六郎，找出占卜师、搞笑艺人等杀人事件的真相。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105192124.jpg', '日本', '', '0', '1', '', '1', '1383714803', '7', '0', '0', '0', '0', '1', '1', '4', '3', 'qvod', '', 'qvod://62583849|8BA2C91E82794F8A4469CEC25BE425543D1F8143|33分钟侦探被迫归来_VCD_1.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76133', '', 'B', '', '5.0', '3', '1', '0', '0', '0');
