INSERT INTO `ff_vod` VALUES ('102', '14', 'M[微电影]', 'DVD', '', '', '未知', '陈诚', '圈圈是个可爱的女孩，每天最让她期待就是睡前故事了。因为她的眼镜看不见，爸爸妈妈给她讲的故事，就成了她幻想世界中最大的安慰。爸爸妈妈很爱她，想法设法想要治好她的眼镜。有一天，圈圈做了一个梦，在梦中她的眼镜能看见了……', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105192659.jpg', '大陆', '', '0', '0', '', '1', '1383714808', '4', '0', '0', '0', '0', '1', '1', '4', '9', 'qvod', '', 'qvod://77764994|78A2BD3D092478070ACE291F28AA474A969C0C13|M_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76134', '', 'M', '', '6.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('103', '16', '百万宝', 'TV', '', '', '李南星,郑惠玉,陈靓萱,江承熹,张汶祥', '李宁强', '白星星（郑惠玉饰演）自幼聪明伶俐，学业名列前茅；她理智、有冲劲、敢于冒险。白星星在26岁生日时，就赚到了生命中的第一个一百万。她驾名车、投资股票，意气风发。 电视剧《百万宝》白星星有这样的成就，男友汤喜耀（张汶祥饰演）居功不小。白星星有魄力，敢拼敢闯，但脾气急躁，做事粗枝大叶；汤喜耀正好相反，做事一板一眼，节俭成性。但是，白星星却觉得汤喜耀小眉小眼，成不了大事。汤喜耀以为星星移情别恋，一走了之。白星星少了汤喜耀从旁协助，经营的连锁店一间间关门大吉，之前所赚到的钱也慢慢地用完了。最后，她竟然得宣布破产！另一方面，大酒店主厨马达（李南星饰演）被白星星批评他所煮的鸡饭失水准而大动肝火。后来，他还因此而被酒店辞退，马达气极，迁怒白星星。他们视对方为命中的灾星。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131030190011.jpg', '其他', '', '0', '18', '', '1', '1383714808', '8', '0', '0', '0', '0', '1', '1', '8', '2', 'qvod', '', 'qvod://275706729|D15ED0C4390575FFE437EA45363354DE3523CFCE|百万宝_TV_01.rmvb|\rqvod://278981945|7B8C75455D3A69516362807A2AE223F946BF34B6|百万宝_TV_02.rmvb|\rqvod://257159013|F5FCD263882D96C733351B8E752D0B0C1668D9E3|百万宝_TV_03.rmvb|\rqvod://244160191|9888D330A226DC76DF95F255B3C7ADF034B2E21B|百万宝_TV_04.rmvb|\rqvod://266299320|EF7311FF978C69A7903BFFBFD53C69FBEA8FC852|百万宝_TV_05.rmvb|\rqvod://266048468|0F215C89A3FE4912C6DCA08DC4890549DC08A958|百万宝_TV_06.rmvb|\rqvod://262672050|EBB06DF69D03143D41163369BF1BCDD8A3F715BF|百万宝_TV_07.rmvb|\rqvod://268842285|80C9AFC3E4A30734E97724017C51B1AC0F57BB90|百万宝_TV_08.rmvb|\rqvod://244729114|9671B127B639992AC4C9BC118349D0CB1CB280A4|百万宝_TV_09.rmvb|\rqvod://216154015|4468B22D957038FCEFD877C088C13DB48F89BBAA|百万宝_TV_10.rmvb|\rqvod://248213628|518DB63AA5DC0F28E341215280C05A2A4AB33D7C|百万宝_TV_11.rmvb|\rqvod://258691470|A92B9F7F448F8623685313962E1C02C0865669F6|百万宝_TV_12.rmvb|\rqvod://244834602|8D9E3DACC1766E33C37E071BCDA9FB22E5F4ED26|百万宝_TV_13.rmvb|\rqvod://239876023|74B6041FF5396D70C0D8FB0346FE17AEF8C1C771|百万宝_TV_14.rmvb|\rqvod://254907623|77ACABEE887B7D662CC32286A823B7E05E33C8C7|百万宝_TV_15.rmvb|\rqvod://242244672|858A58137D9480C6C22923DE1362BC9E9A15CC6D|百万宝_TV_16.rmvb|\rqvod://217135959|4BA9EA4537BDB8D8522199406BAEE986A485B058|百万宝_TV_17.rmvb|\rqvod://244423888|CEBFBA0E2A187035284135DF6F6B2CA732441932|百万宝_TV_18.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=7