INSERT INTO `ff_vod` VALUES ('105', '18', '33分侦探', 'VCD', '', '', '堂本剛,水川あさみ,野波麻帆', '未填写', '“犯人是…那家伙吗，还是那家伙，应该是那家伙！！” 堂本刚首次出演富士台连续剧。充满吐糟的“随性”推理让周围人头痛不已。“33分侦探”追击犯人。。。预定！！ 33分钟。那是周六剧场正片的长度。就是说为让电视剧能拍成，即使犯人是一目了然的，就算案件能在5分钟内搞定也“必须拍满33分钟”。同时花33分钟引导案件解决（预定）的就是33分侦探，也就是鞍马六郎。每一回出现在案发现场的33分侦探，都会指着看似毫无关联的人说“你就是犯人吧！”，周围的人就会反驳他说“绝对不是！！”，而他这时会展开独特的推理。其推理虽然有一贯推理剧的尖锐视角来推动剧情，但结果也可能隐含着一开始大家就认为可疑的人物是真正的犯人这种荒诞的结局。总而言之就是“随性”。 33分侦探弥漫的“随性”气氛中，侦探的推理总是再最后一刻才正中靶心，这种紧张感在一般的推理剧中是感受不到的，可以说是史无前例的“脱线推理剧”！', 'http://175.6.0.111:8058/200904/14/193610592.jpg', '日本', '', '0', '0', '', '1', '1383714808', '7', '0', '0', '0', '0', '1', '1', '4', '7', 'qvod', '', 'qvod://62567482|E4E0A95B49BE29F111A8985606BCD896814431C5|33分侦探_VCD_1.rmvb|\rqvod://62444401|795E1511893B057597F8709AC3AC547F31DB6879|33分侦探_VCD_2.rmvb|\rqvod://62109668|2567D25507A1FDC36818CB4D26A4F88F57CAAB71|33分侦探_VCD_3.rmvb|\rqvod://62579392|AC2016A18939355546ECB129ED28E180ABB5E36B|33分侦探_VCD_4.rmvb|\rqvod://50429436|B21A5844891F85CE098A7972516B9DA9A06138BE|33分侦探_VCD_5.rmvb|\rqvod://62582206|55302D663465389D3AC562E3162D8EEC545C21DE|33分侦探_VCD_6.rmvb|\rqvod://62151194|006CAEF864F465C56B9B8B840CA95A6104E83179|33分侦探_VCD_7.rmvb|\rqvod://62548676|6947D5CDDEB87375E619B80F10C6CE1ACD4BDA21|33分侦探_VCD_8.rmvb|\rqvod://61690880|C12EC463B7FF461621BD756E1873DA9883EC1E62|33分侦探_VCD_9.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=377', '', '3', '', '8.0', '7', '1', '0', '0', '0');
