INSERT INTO `ff_vod` VALUES ('112', '11', '寂静的地球', 'DVD', '', '', 'Bruno,Lawrence,Alison,Routledge,Pete,Smith', 'Geoff,Murphy', '一个男人醒来发现世界上只剩下他一个人，于是到处寻找其他的幸存者，弄清到底发生了什么事。他怀疑自己卷入了一个政府的研究项目，而这个项目与其他人失踪有关。最后他终于找到几个人，当他们开始信任彼此时，设法要知道自己被遗留在这个世界上的原因。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105184247.jpg', '欧美', '', '0', '0', '', '1', '1383714808', '3', '0', '0', '0', '0', '1', '1', '3', '3', 'qvod', '', 'qvod://155737752|D6127569F3CBF927B7BF357D7D239D1FF6EB164F|寂静的地球_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76130', '', 'J', '', '8.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('113', '10', '常开野蔷薇', 'DVD', '', '', '菅野美穗江口洋介,小池荣子,池脇千鹤,宇崎竜童,', '吉田大八', '在高知县的某渔港小镇，结束了无望婚姻的直子（菅野美穂 饰）带着女儿回到了这里。她的母亲胜子（夏木マリ 饰）经营着镇上唯一一家美发店“常开野蔷薇”，那些中老年妇女经常聚在店里，肆无忌惮地谈着爱情、性和男人。直子有两个童年的玩伴，她们也各自遭遇着痛苦的爱情。经营夜店的小美（小池栄子 饰），老公阿久公然在自己店中勾搭酒女，愤怒的她驱车撞向情敌；乖乖女模样的小友（池脇千鶴 饰）结交了数任男友，可无一例外对她非打即骂，看似体贴的丈夫则沉湎赌场无法自拔。直子偷偷地与中学教师鹿岛（江口洋介 饰）相恋，他们的爱情虚幻而美好……\r\n    本片根据西原理惠子的同名漫画改编。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105173814.jpg', '日本', '', '0', '0', '', '1', '1383714808', '0', '0', '0', '0', '0', '1', '1', '5', '7', 'qvod', '', 'qvod://34845512|570FF93FC338B859F295ED940AF211A13B6568DA|常开野蔷薇_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76121', '', 'C', '', '8.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('114', '3', '飙速宅男/弱虫脚踏板', 'HDTV', '', '', '山下大辉,鸟海浩辅,福岛润', '锅岛修', '本作的主角是千叶县立总北高中的新生小野田坂道，他是一名热爱动画、游戏和秋叶原的御宅族。这样的他由于在初中时代没有遇到拥有相同喜好的同学，所以他打算在进入高中以后一定要加入动漫画研究部。只不过，想加入的社团却因为成员不足而活动休止了。面对如此状况，小野田坂道开始意气消沉了。另一方面，同样也是新生、初中时代活跃于各大自行车比赛的今泉俊辅，某日在训练的时候见到小野田坂道骑着自行车爬上陡坡的过程，故事由此正式展开。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131008232508.jpg', '日本', '', '0', '6', '', '1', '1384334712', '5', '0', '0', '0', '0', '1', '1', '6', '8', 'qvod', '', '01$qvod://214982638|4B3DF21D8E45C7CCC6D901792EADC3D35D1DF39C|飙速宅男_HDTV_01.mp4|\r02$qvod://214716487|CEE6B8AB06F6C9C0FF9D2E2D5D96D052B12F2243|飙速宅男_HDTV_02.mp4|\r03$qvod://298358908|E914257568E7EBC495BAD89FEA04F3D210B05C3A|飙速宅男_HDTV_03.rmvb|\r04$qvod://191904518|A272D3AEF4877DA133EEF154BA74C02876362884|飙速宅男_HDTV_04.rmvb|\r05$qvod://164393920|77DA8F52BD3732B6B1E79603FCCF42E10A79414A|飙速宅男_HDTV_05.rmvb|\r06$qvod://207002204|CB2F95425066E699B947AD648E6ED395FD565B15|飙速宅男_HDTV_06.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75260', '', '0', '', '2.0', '5', '1', '0', '0', '0');
