INSERT INTO `ff_vod` VALUES ('124', '3', '守望者：动态漫画[缺1-3、5-12 、04无字]', 'VCD', '', '', '未知', 'Jake,Strider,Hughes', '目前最受期待的漫画改编电影《守望者》将于3月6日上映。而在电影上映的同时，华纳公司还为《守望者》原著漫画的粉丝们准备了另一份大礼——《守望者：动态漫画》（Watchmen: The Complete Motion Comic）的DVD及BD版，于3月3日，在电影版上映之前推出！《守望者》是美国漫画界的一部珍宝级漫画，获奖无数。2005年美国《时代周刊》评选出自1923年以来的100部最优秀的英文小说，《守望者》就是其中的一部，而且也是入选的惟一一部漫画。（注：在美国，那些有着较复杂故事，而且主要以成人读者为目标用户的漫画也被称之为图画式小说或漫画小说，即graphic novel）\r\n    这次的《守望者：动态漫画》则是这部美国史上最著名的漫画小说的一个动态数码版漫画。本片的制作也全程由原著的画师Dave Gibbons监督。所谓的动态漫画，就是在原著漫画的基础上，以一定程度的动感、以及配音，让漫画有尤如观看动画一般的效果，但同时又能够保留看漫画的感觉。原著的12章故事将会被全部收录，整部片子长达5个小时，完整再现《守望者》漫画的所有剧情！故事设定在80年代，假设美国与苏联即将爆发核子衝突，一群超人被政府禁止活动，其中一位被谋杀身亡，这群超人於是企图找出幕后兇手，Watchmen重塑了超人的形象，被誉为对超人类型漫画有著革命性的影响，它是唯一一部护得雨果奖的漫画，也曾被时代杂誌列为100部最佳小说之一。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105181623.jpg', '欧美', '', '0', '4', '', '1', '1383714813', '4', '0', '0', '0', '0', '1', '1', '4', '9', 'qvod', '', '1$qvod://50797579|EE4D9A88A1C1515495126B811C5FBE13A6892A80|Watchmen The Motion Comic_VCD_E04.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76127', '', 'S', '', '9.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('125', '6', '直到光芒把我们带走', 'VCD', '', '', 'Varg,Vikernes,Fenriz,Hellhammer,Harmony,Korine', 'Aaron,Aites,Audrey,Ewell', '直到灯带我们是一个特征长度的纪录片记载历史、意识形态和审美的挪威黑金属-一个音乐亚文化臭名昭著的尽可能多的为一系列的谋杀案和教堂纵火因为其独特的音乐和视觉美学。这是第一个(也是惟一一个)电影真正揭示一个运动,迄今为止被笼罩在黑暗中。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105175517.jpg', '欧美', '', '0', '0', '', '1', '1383714813', '6', '0', '0', '0', '0', '1', '1', '7', '5', 'qvod', '', 'qvod://160196320|4040D8A98BAB4CED047DA297A6BFFEECD2109F4F|直到光芒把我们带走_VCD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76125', '', 'Z', '', '2.0', '4', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('126', '18', 'V之岚', 'VCD', '', '', '二宫和也,阿部宽,大野智,相叶雅纪,松本润,樱井翔,北川弘美', '岩本仁志,熊谷拓雄', 'V之岚是岚(ARASHI)出道时期一起演出的一个短篇drama，因为他们代言世界杯排球比赛的缘故，所以这个drama也是讲述五个热爱排球的少年的故事。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105181057.jpg', '日本', '', '0', '0', '', '1', '1383714813', '8', '0', '0', '0', '0', '1', '1', '6', '4', 'qvod', '', 'qvod://11492000|91CCFD652C2E58CCB3ABA454116B89E1A117A111|V之岚_VCD_01.rmvb|\rqvod://12692391|9BFA6A8534BE27CEFE436C3566026CBB78B12BB0|V之岚_VCD_06.rmvb|\rqvod://12465264|05A40FDEB05F5F2988B521C49226699573851AA8|V之岚_VCD_07.rmvb|\rqvod://10538297|60D365C89C06785B0AE7C94FE86CBB2AF21703B3|V之岚_VCD_08.rmvb|\rqvod://10185837|DF18219A2B3E7A68D32FE1A18B7D528CA62C2E5D|V之岚_VCD_09.rmvb|\rqvod://11293880|142C38A4B10A7F833445FA6F29FB11F45E743587|V之岚_VCD_10.rmvb|\rqvod://11781984|73EB03FAA851FE578AE178AAF81C243B939D75D8|V之岚_VCD_11.rmvb|\rqvod://10372190|AFF23B6BA1C2308F9C74136376562322673680AB|V之岚_VCD_12.rmvb|\rqvod://9692089|532C1AF5092E828D6630AEF314C90739891D2669|V之岚_VCD_13.rmvb|\rqvod://9809851|2B03DBACA71FF377903312DA98CBDC70EBAD90EF|V之岚_VCD_14.rmvb|\rqvod://10854556|E341AAF8988B648C7B7B91EFB2CEF6A62AABFD29|V之岚_VCD_15.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76126', '', 'V', '', '1.0', '2', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('127', '20', '致命旅行/黑锅/悬途末路/悬疑迷局/致命朋友', 'VCD', '', '', 'Logan,Marshall-Green,(Taylor,Fog),Matthew,Bomer,(Jay,Burchell),Aaron,Stanford,(Will,Traveler)', 'David,Nutter', '这部片子是 美国ABC电视台获得我国黑色三部曲（黑金，黑冰，黑洞）的国外改编权后的第一部黑色系列片，剧中的故事也是揭露贪官污吏，替人雪冤。 　　剧情步步惊险！环环相扣！紧张刺激毫不拖拉！让你看片的时候绷紧每一根神经。 　　Tyler Fog、Jay Burchell和Will Traveler是好朋友，他们在耶鲁大学研究生院分租同一套房子，共同渡过了两年的快乐时光。三个才华横溢的年轻人即将成为风险投资家、律师和化学工程师，而在从业前的夏天，他们计划着一次穿越美国的旅行。在Will的提议下，极富纪念意义的人生旅行从纽约最古老的德雷克斯勒艺术博物馆的顶层开始， Tyler和Jay踩着单排轮滑竞相滑下，Will在后面拿着DV摄影留念，并约定在博物馆门前的拐角处集合。踩着轮滑风风火火赶到拐角处的Tyler和 Jay四处寻找Will的身影，却在手机中听到Will的声音。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105174816.jpg', '欧美', '', '0', '0', '', '1', '1383714813', '4', '0', '0', '0', '0', '1', '1', '3', '5', 'qvod', '', 'qvod://55918180|133DD554A40645A83E81BF03259EF31C6C164054|Traveler-致命旅行.第一季_VCD_01A.rmvb|\rqvod://56458259|C67122081F01DA548BC86C6FD438D8092771EE43|Traveler-致命旅行.第一季_VCD_01B.rmvb|\rqvod://36151888|2B1BCE182DFDD765F3CB83C83673B9085A907D5F|Traveler-致命旅行.第一季_VCD_02A.rmvb|\rqvod://35988123|4E8F61088BF39D88E93791898A2E0BDC07372888|Traveler-致命旅行.第一季_VCD_02B.rmvb|\rqvod://34423853|93BD6B9C497CE3535A99356D0DEF92BE52493859|Traveler-致命旅行.第一季_VCD_03A.rmvb|\rqvod://34235139|3B570A603C0F6D56B6F4B0BD4F6A996AF6FC719F|Traveler-致命旅行.第一季_VCD_03B.rmvb|\rqvod://34430963|EF4B62F97C0721E6F11835003A40B3B961041DA4|Traveler-致命旅行.第一季_VCD_04A.rmvb|\rqvod://34618221|D5D19E2309D61C28353FBB3DCF06342E09E174FF|Traveler-致命旅行.第一季_VCD_04B.rmvb|\rqvod://34416660|1B1955E9F57034FF2A4B5DDDCCA169135D7CA809|Traveler-致命旅行.第一季_VCD_05A.rmvb|\rqvod://48174973|26EBB96154F706D534A39652A693784D24410765|Traveler-致命旅行.第一季_VCD_05B.rmvb|\rqvod://35972342|FE62269FFEBD872F44C5DB63BB1F6A997DAF8927|Traveler-致命旅行.第一季_VCD_06A.rmvb|\rqvod://35151504|5364A7B91CE25DD8DFE27CF5618FF9E909A84D20|Traveler-致命旅行.第一季_VCD_06B.rmvb|\rqvod://34479035|5B29C32E9F79A06481CD0C05FF0E6420F034D107|Traveler-致命旅行.第一季_VCD_07A.rmvb|\rqvod://55661093|52FBFC81B5BDB5784C6DFF923A57610FE87B259B|Traveler-致命旅行.第一