INSERT INTO `ff_vod` VALUES ('128', '14', '叛逆边缘[无字]', 'DVD', '', '', '希里安·墨菲,Tricia,Vessey,乔纳森·杰克逊', '约翰·卡尼', '故事背景是加州小镇的中下层社区，年轻人生活空虚，缺乏正当娱乐，于是转向摇滚乐、迷幻药和性发泄寻求满足。当地警察意图扫荡孩子们的毒品交易，卡尔深受困惑，于是跑去找小无赖里奇帮忙，因为他有枪。不料事情发展越弄越糟糕，暴力事件一发不可收拾……', 'http://175.6.0.111:8058/200906/08/120826075.jpg', '欧美', '', '0', '0', '', '1', '1383714813', '3', '0', '0', '0', '0', '1', '1', '9', '3', 'qvod', '', 'qvod://291526306|F9BC61A82D329789ABBE442DD3767FC604441B99|叛逆边缘_无字_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=7055', '', 'P', '', '7.0', '1', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('129', '20', '灰飞烟灭 第一季', 'VCD', '', '', 'Philip,Glenister,Keeley,Hawes,Marshall,Lancaster,Dean,Andrews,Montserrat,Lombard,Stephen,Campbell,Moore', 'Jonny,Campbell,Bille,Eltringham,Catherine,Morshead', '英国BBC最新电视剧《尘归尘》是《火星生活》的衍生剧。英国电视剧《Life on Mars》(火星生活) 曾获英国电视学院奖及国际艾美奖，ABC已在翻拍美版。这部剧集科幻(尤其是时间旅行)题材与警匪片于一身，说的是曼城的一个警探山姆-泰勒，在办案中被车撞倒在地，从昏迷中醒来后发现自己回到了1973年，成为警探吉恩-亨特的下属。很容易想像成《回到未来》那样的喜剧片，第一季刚开始的时候确实有吉恩和山姆鸡同鸭讲而闹出的笑话，但很快转而描述他们之间的冲突，山姆崇尚21世纪的办案方式；而吉恩作为一个70年代的警探经常是把认定有罪的嫌疑人先抓起来打一顿再说。此外，现在最爱热议的问题是山姆的来历，他到底是真的穿越回到过去？还是说，一切不过是他车祸昏迷中做的梦？亦或是他根本就是1973年的一名精神病人？现在BBC出品的新剧《Ashes to Ashes》，讲的则是8年后(1981年)吉恩-亨特的故事。Gene Hunt警探再次归来，但他不再是那个自我风格的曼彻斯特治安官，坦白地说由于他可靠的伙伴...', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105172842.jpg', '欧美', '', '0', '2', '', '1', '1383714813', '6', '0', '0', '0', '0', '1', '1', '4', '2', 'qvod', '', 'qvod://49954268|BDF5C160A5F5F17F637E4C7195A705F9AE26183A|[英剧]灰飞烟灭第一季_VCD_08A.rmvb|\rqvod://51561529|6DA261C694D686EA3EC7B14E74930130AA17AE1A|[英剧]灰飞烟灭第一季_VCD_08B.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76119', '', 'H', '', '5.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('130', '14', '归来否？33分侦探/33分侦探SP', 'DVD', '', '', '堂本刚,水川麻美,石井毅,福田响志,安田显,中村由利,高桥克实', '森谷雄', '去年夏天播出的KinKi Kids的堂本刚（29）主演的富士土曜连续剧《33分侦探》，将在3月的第3周的土曜日（星期六）的21日，播出特番《帰ってくるのか！？３３分探侦》，此事于12日获悉。并且从3月28日起将连续四周限定的播出《帰ってこさせられた３３分探侦》。\r\n    这里是只有一集的SP的页面，播放第二周开始将继续播映连续四周的电视剧。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105172914.jpg', '日本', '', '0', '0', '', '1', '1383714813', '5', '0', '0', '0', '0', '1', '1', '6', '7', 'qvod', '', 'qvod://62559644|E3AA5C1F5008AF5D357690E1132F0AD28C71D188|归來了吗.33分重侦探SP_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76120', '', 'G', '', '4.0', '2', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('131', '3', '面包超人[国语]', 'DVD', '', '', '未知', '柳濑蒿', '面包超人(Anpanman)昵称“红豆面包超人”，有着红通通脸颊的大圆饼脸，是个胖嘟嘟的健康小子。他有一颗正义的心，发誓要维护森林正义，甚至不惜牺牲自己的“面包头，被封为史上最爱“做脸”的超人。不过面包超人也有弱点———他不能淋雨。他的头一遇到水就会“泡汤”，那样他就会没力气打坏人，只好束手就擒。不过没关系！只要果酱爷爷赶紧再烤一个新的面包头让他换上，他又会恢复力气，打倒坏人！', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131104162848.jpg', '日本', '', '0', '57', '', '1', '1383714813', '8', '0', '0', '0', '0', '1', '1', '3', '2', 'qvod', '', '01$qvod://36448268|D87AE83DCBAC001996374CB06231F695E5A1BB0D|面包超人.国语_DVD_01.rmvb|\r02$qvod://36504383|21432695D8AC56D47FAFC0E3CA348E45F8F10B92|面包超人.国语_DVD_02.rmvb|\r03$qvod://36477455|F1B9786E500DF50F7FC40A0BD232FE8F2F1EA2A8|面包超人.国语_DVD_03.rmvb|\r04$qvod://36559598|A7B643C72E69D62B06B2415197372021113BCD39|面包超人.国语_DVD_04.rmvb|\r05$qvod://36514366|7D5A56414FD6FD04CD9ED4FC52C25A0A1F8DD748|面包超人.国语_DVD_05.rmvb|\r06$qvod://36513181|04DE11744E6DDF7C1E0ACF18896D234C1C0655EA|面包超人.国语_DVD_06.rmvb|\r07$qvod://36517014|51A1198DB8C339F189947AE6A618F89E4D3521E5|面包超人.国语_DVD_07.rmvb|\r08$qvod://36505607|FA38AD88DF1C13254C650189D2A65E7D714CCA70|面包超人.国语_DVD_08.rmvb|\r09$qvod://36519820|EA352FBB90967DCBA68E812CC9BFA6A55447257C|面包超人.国语_DVD_09.rmvb|\r10$qvod://36523011|3E686523A4D1FA5BD504EE62311BEED4F65A4102|面包超人.国语_DVD_10.rmvb|\r11$qvod://36505194|0BEB283F1262D6E71880D6B46A14F32B58392574|面包超人.国语_DVD_11.rmvb|\r12$qvod://36514190|E7B762755447F5230326B8AB2B5042A4FE0A8F98|面包超人.国语_DVD_12.rmvb|\r13$qvod://36506770|777DE97ABE56C57780B84B4706D4BF5802D3A87C|面包超人.国语_DVD_13.rmvb|\r14$qvod://36310334|489E89EF3941BC91B87637479F192885F949F325|面包超人.国语_DVD_14.rmvb|\r15$qvod://36629955|FA0C71CEB4269C75746FC419B741D5BF9544DC89|面包超人.国语_DVD_15.rmvb|\r16$qvod://36515553|32C0C65424E5B15136A8A1BBF3F52BB0B3C22B77|面包超人.国语_DVD_16.rmvb|\r17$qvod://36518239|16D1875DCC929FC45B827ED97E734049FAB654A1|面包超人.国语_DVD_17.rmvb|\r18$qvod://36582776|BF68E6B35FFABAD3E78B589B90E169D5B47BB16D|面包超人.国语_DVD_18.rmvb|\r19$qvod://36567226|07867ED1F403FB7FCE82C37A6A5F5EF09CD6F012|面包超人.国语_DVD_19.r