INSERT INTO `ff_vod` VALUES ('132', '9', '地址变更/更改地址', 'DVD', '', '', '艾曼纽勒·莫雷,福德莉奇·贝尔,芳妮·瓦莱特,达尼·布里扬,阿丽亚娜·阿斯卡里德,克莱尔·布勒尼奥', '艾曼纽勒·莫雷', '虽然戴维（艾曼纽勒·莫雷 Emmanuel Mouret 饰）和安妮（福德莉奇·贝尔 Frédérique Bel 饰）作为合租室友整日同居一室，但他们从未有过想要将两人的关系更进一步的打算。戴维心心念念着自己的学生茱莉亚（芳妮·瓦莱特 Fanny Valette 饰），在得知了死党的苦恋之后，安妮挺身而出，为他出谋划策。\r\n    通过安妮的帮助，戴维和茱莉亚相爱了，不久之后，戴维搬出了同安妮合租的屋子，开始和茱莉亚同居。同居后的生活并没有想象的美好，第三者的介入也让戴维和茱莉亚的感情产生了裂痕，最终两人分手，戴维离去。一次偶然中，戴维和安妮相遇了，后者因为负担不起高额的房租而打算搬家，就这样，安妮和戴维又称为了合租室友，但这一次，两人都感觉到，他们之间的关系发生了翻天覆地的变化。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105172114.jpg', '欧美', '', '0', '0', '', '1', '1383714813', '3', '0', '0', '0', '0', '1', '1', '6', '3', 'qvod', '', 'qvod://279619088|E0D8E1E553A367BCC4B3E71140F1B160E7D6BC0B|地址变更_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76118', '', 'D', '', '3.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('133', '3', '外星蒙查查/宇宙小毛球/外星毛查查/蒙加公[国语]', 'DVD', '', '', '折笠爱,田中真弓,中村大树,岩男润子,绪方贤一', '尾鷲英俊', '毛球星的公爵小毛球（毛查查/Mojya公/蒙加公）及他的弟弟、妹妹，为了找寻“莫哈拉达摩佳宝藏”来到地球，遇上了充满梦想的地球少年空夫和美琪。小毛球他们住在空夫的家内，空夫帮助他们找寻撒哈拉宝藏，时常跟他们在宇宙四处历奇。同时，毛家球要比小毛球先找到宝藏，因此时常跟空夫和小毛球他们作对，而发生了不少趣事。最终，空夫不仅帮助小毛球找到了宇宙之石和宝藏，两个来自不同科技程度、不同文化背景的孩子也建立了深厚的友谊。该作品的主题正是片中最终的宝藏——“友谊”。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131104162211.jpg', '日本', '', '0', '73', '', '1', '1383714813', '7', '0', '0', '0', '0', '1', '1', '6', '5', 'qvod', '', '01$qvod://37115787|F5FFCC461C618674D59A62470A459370FA091B8F|宇宙小毛球.国语_DVD_01.rmvb|\r02$qvod://36932588|410A73993F173DD7C586F40FB0524F533C4BEDFD|宇宙小毛球.国语_DVD_02.rmvb|\r03$qvod://36982365|4C604E6D28FADB1DE4E1720B26C4349271705CB7|宇宙小毛球.国语_DVD_03.rmvb|\r04$qvod://37344481|B1BA69145B2A69F77A162C85745F8F4A5DD25102|宇宙小毛球.国语_DVD_04.rmvb|\r05$qvod://37015694|8771F58FE866EC664D9D8F882769EA0B5C9EF572|宇宙小毛球.国语_DVD_05.rmvb|\r06$qvod://36947076|80A2B2F978D3F574E1500A131F6292272AC4A04C|宇宙小毛球.国语_DVD_06.rmvb|\r07$qvod://122752876|3874FB2063D2457BB5609D378B969FF9A1923B96|宇宙小毛球.国语_DVD_07.rmvb|\r08$qvod://123873104|2353A5E8089C81BF0654575B4BE79F90CD49FD0A|宇宙小毛球.国语_DVD_08.rmvb|\r09$qvod://37096697|3C95E62005FD07AE4B8F2F75EBD1CB1D94AEBD64|宇宙小毛球.国语_DVD_09.rmvb|\r10$qvod://37063052|97D9A19C0DA0C120A8A1F7496B4C676364131CCF|宇宙小毛球.国语_DVD_10.rmvb|\r11$qvod://37318950|F5F72E3DABCCA4FAFFBEA5468CA3B1BFEE512A6C|宇宙小毛球.国语_DVD_11.rmvb|\r12$qvod://36972814|21D596460F1DD4E92C63116C08A93439496329D1|宇宙小毛球.国语_DVD_12.rmvb|\r13$qvod://36959335|CB6C870FABFB416FF29CF4D77CFF2E271C03D393|宇宙小毛球.国语_DVD_13.rmvb|\r14$qvod://37182813|DDA02E10E24E73A2E4878F49A42B41CBC84C0D75|宇宙小毛球.国语_DVD_14.rmvb|\r15$qvod://36992787|77E722676243D329A419AACE33484BE678FFF5E5|宇宙小毛球.国语_DVD_15.rmvb|\r16$qvod://36891939|9C5C1B7256D9F2F5645DC6460B4D1D55210801ED|宇宙小毛球.国语_DVD_16.rmvb|\r17$qvod://37291942|0D67D8A1BB423B5EB5E14FB05EB2271BFABDAC3F|宇宙小毛球.国语_DVD_17.rmvb|\r18$qvod://36837656|24E550F46C44919ADDFA3BC0DB2B14AB8AB55110|宇宙