INSERT INTO `ff_vod` VALUES ('134', '9', '笑林老祖/少林龙小子', 'DVD', '', '', '郭晋安,朱茵,李名炀', '袁英明', '少林是习武圣地，以前习武为了行侠仗义，现在是为了比赛夺取冠军。绰号小精灵的小和尚，自幼就在少林寺长大，与瞎眼师傅布袋大师相依为命，为人机智聪明，身手敏捷，甚得少林长老溺爱。一次，小精灵被选中参加“少林功夫表演团”，南下广州，准备翌日出发至欧洲。当晚小精灵与众师兄弟误闯的士高惹祸，令瞎眼师傅大发雷霆，要小精灵整晚面壁思过，翌日众人为赶机程，竟然遗下了小精灵，他由佛门清静地，突然置身花花世界中，误打误撞，闹出连串笑话……', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105164331.jpg', '香港', '', '0', '0', '', '1', '1383714813', '1', '0', '0', '0', '0', '1', '1', '1', '6', 'qvod', '', 'qvod://313212286|53AE4F47CA635CFFE62162EE2C46A2589D5861A1|少林龙小子_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76117', '', 'X', '', '3.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('135', '3', '艾斯奥特曼', 'DVD', '', '', '高峰圭二,星光子,瑳川哲朗,Yuko,Enatsu,冬木透,蟹江敬三,片冈五郎,岸田森,小林昭二,近藤正臣,幸田宗丸,嵯川哲朗,筱田三郎,盐泽登代路', '熊谷健,伊藤久夫,桥本洋二', '异次元人亚波妄想侵占地球，炮制了一系列宇宙怪兽和地球生物合成的超兽。被称为第1号的超兽贝劳克恩在日本福山市登场。前去迎战的地球防卫军全军覆没。这时，在惨遭破坏的大街上，有二位把自己生命置之度外的青年，他们是面包房的驾驶员北斗星司和护士小姐南夕子。二人竭尽全力救援遇难的人们，但终于精疲力尽倒在瓦砾中……救了他俩的是艾斯·奥特曼。艾斯把自己的生命溶入了二人的体中。\r\n    北斗和南夕子为了继续与亚波人战斗，参加了地球防卫军TAC，经过顽强地训练，终于战胜了贝劳克恩。\r\n    艾斯的战斗能力日趋强大，在自身掌握的特殊的光线技能和奥特兄弟的协助下，战胜了超兽和超人艾斯杀手，并会同奥特兄弟在异次元空间同亚波人展开了殊死的决斗。月球人的南夕子返回月球后，艾斯便附在北斗一人身上了。重任在肩，艾斯持之以恒地与超兽、亚波人搏斗。在击败了亚波人最得意的合成超兽后返回了光之国——奥特之星。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131104174904.jpg', '日本', '', '0', '0', '', '1', '1383714813', '6', '0', '0', '0', '0', '1', '1', '8', '1', 'qvod', '', '01$qvod://12076175|B420F3F44523FCF1455D3F556A3893CCD3081B2B|艾斯奥特曼_DVD_01话辉煌奥特五兄弟-0001.rmvb|\r01$qvod://12143949|A1874CE8EDB9C5D1B7766D7F801FBBD22D136C87|艾斯奥特曼_DVD_01话辉煌奥特五兄弟-0002.rmvb|\r01$qvod://12103494|D4710CE31EBBCF6C473D0101C95CBFFAE2D618F9|艾斯奥特曼_DVD_01话辉煌奥特五兄弟-0003.rmvb|\r01$qvod://7370171|A6DFADF7642A0ED5923C4BA3017C4E2FF1F5543E|艾斯奥特曼_DVD_01话辉煌奥特五兄弟-0004.rmvb|\r02$qvod://12119284|C3723049D26E7AE08A36495BCE6BC56E7C0EF163|艾斯奥特曼_DVD_02话越过大超兽-0001.rmvb|\r02$qvod://12104793|B3D5934714FF1148A752CF7BEDA06023CC96A3E9|艾斯奥特曼_DVD_02话越过大超兽-0002.rmvb|\r02$qvod://12081430|7EB4E2446C8396F0DE6C1DE4107D8DDF9C040D51|艾斯奥特曼_DVD_02话越过大超兽-0003.rmvb|\r02$qvod://8379663|98EC78A767368257152681DB2948F4CD84560D3C|艾斯奥特曼_DVD_02话越过大超兽-0004.rmvb|\r03$qvod://12088347|190B7D235750015613A7AD3A56A6F527AE25B7F1|艾斯奥特曼_DVD_03话燃烧超兽地狱-0001.rmvb|\r03$qvod://12081978|A1739D8F095457FF1CE5B13BC5128DF4D9CCC852|艾斯奥特曼_DVD_03话燃烧超兽地狱-0002.rmvb|\r03$qvod://12092701|B5AA3F5DD47FD5B14C39FBE855B989EBF8F32AF5|艾斯奥特曼_DVD_03话燃烧超兽地狱-0003.rmvb|\r03$qvod://7391577|AE40FD078DF2DB606D010637281ABA7266A721A8|艾斯奥特曼_DVD_03话燃烧超兽地狱-0004.rmvb|\r04$qvod://12054289|07179E75690C50972D883EA83D0BE10EA396E8A1|艾斯奥特曼_DVD_04话三亿年前超兽再现-0001.rmvb|\r04$qvod://12107901|0CD3839E7FE06366CE58E9FEA653C0C882648B47|艾斯奥特曼_DVD_04