INSERT INTO `ff_vod` VALUES ('136', '12', '奥托，与僵尸同行/奥托，或者与死者一同上天堂', 'DVD', '', '', '杰·克里斯法,Katharina,Klewinghaus,马赛·斯科拉特,Susanne,Sach&amp;#223;e,Guido,Sommer', '布鲁斯·拉布鲁斯', '一个叫奥托的年轻僵尸出现在人迹罕至的高速公路上，他不知道自己是谁，也不知道要到哪里去。他搭上便车来到柏林，而一座废弃的游乐园成了他柏林之行的第一站。不久他就被地下电影制作人美狄亚&amp;#8226;杨恩发现，美狄亚在哥哥阿道夫和朋友海娜的帮助下，开始拍摄一部以奥托为主角的纪录片。美狄亚还惊喜地发现，她一直在筹备的一部政治题材的色情僵尸影片如今总算有拍成的可能了。而奥托从自己外套的口袋里发现一个钱夹，里面的一些东西让他想起自己死之前的一些事情，包括他的前男友鲁道夫，于是，他约见鲁道夫，就在两人最初相见的学校操场，一连串可怕的事情随之发生。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105163019.jpg', '欧美', '', '0', '0', '', '1', '1383714813', '4', '0', '0', '0', '0', '1', '1', '9', '8', 'qvod', '', 'qvod://149484885|8581F0ABD4B2B2805D51675A7AB6915E32D181E8|奥托.与僵尸同行_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76114', '', 'A', '', '8.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('137', '16', 'On Call 36小时2/On Call 36小時II/OnCall36小时2[粤语QMV+]', 'DVD', '', '', '马国明,吴启华,杨怡', '潘嘉德', '各司其职、各安其位，医院内无论哪一个工作岗位，都是保护生命的斗士。 \r\n　　面对着垂危的病人、带病有孕的子妤，一健执着地要把一切全都扛在肩上，沉重得令他难以喘息。此时再遇上意见不合、封刀多时的大国手洛彦笙，而子妤又病发流产，被逼放弃外科医生的岗位，这一切都让一健在人生路途上受到莫大的冲击。 \r\n　　子妤为了让一健明白到放下执着、活在当下的真谛，毅然转科重新学习。一健霎时难以接受，但看着从前的沛聪、美雪、晶晶等人日渐成长，各大自成为独当一面的医生，在洛彦笙与子妤启发与鼓励下，一健终于明白到一个医生就如一位斗士，要知道自己的能力，守着自己的岗位，才能保卫别人的生命。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105150339.jpg', '香港', '', '0', '7', '', '1', '1384334688', '1', '0', '0', '0', '0', '1', '1', '4', '3', 'qvod', '', 'qvod://278501595|43E1C728125A6A8780E28A7553D0DC662FA16BD4|On.Call.36小时II.粤语_HDTV_01.QMV|\rqvod://276718521|169F8018E6A8102322052A93BFFCDF45E5FAC72D|On.Call.36小时II.粤语_HDTV_02.QMV|\rqvod://190669301|8041170E5D237976E5E54D331A1A14BA835217FA|On.Call.36小时II.粤语_HDTV_03.QMV|\rqvod://188931958|61742476399127386C97B42007E1FF9ADC7A696A|On.Call.36小时II.粤语_HDTV_04.QMV|\rqvod://190650217|572D1BE691060CA6A7CE4D229859E76A490B4341|On.Call.36小时II.粤语_HDTV_05.QMV|\rqvod://187913919|446C02B5207F2385A435372F543A50696E130757|On.Call.36小时II.粤语_HDTV_06.QMV|\rqvod://323174511|5E7DA45D10C6A8DD3FD5EBC191436D3DDEF66DC4|On.Call.36小时II.粤语_HDTV_07.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76115', '', 'O', '', '1.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('138', '14', '一个独生女的故事', 'DVD', '', '', '杨烁一,周淑琴,刘宝华', '郭林', '鸣鸣（杨烁一 饰）是家中的独生女，幸福无比。但随着父亲的离世，母亲（周淑琴 饰）因心脏病卧床不起，家中的重担便落在了她的身上。除了照顾妈妈料理家务，她还忙着自己的学业。老师得知了情况后，也对她格外的关心。\r\n    一天夜里母亲突然病发，鸣鸣把母亲送进医院后，每天都坚持上课，下课便在病房里做作业顺便照顾母亲。母亲看着自己年纪小小的女儿如此懂事，不想女儿再为自己劳累，竟想到了自杀……\r\n    生活的磨难使鸣鸣迅速成长，坚强的她又能否克服一切困难呢？', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105163721.jpg', '大陆', '', '0', '0', '', '1', '1383714813', '3', '0', '0', '0', '0', '1', '1', '9', '6', 'qvod', '', 'qvod://152148818|6644A02B0A4DFA185A0EDCCD44CBADFC8A36C373|一个独生女的故事_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76116', '', 'Y', '', '5.0', '9', '1', '0', '0', '0');
