INSERT INTO `ff_vod` VALUES ('140', '15', '我们这拨人[标清版]', 'HDTV', '', '', '夏雨,宋佳,廖凡,王宝强,郭京飞,白百何,许歌,徐岑子', '刘心刚', '主要讲述两个二十多岁的IT精英（汤若、高博，后又有老同学李时恰加盟），建立“走着瞧”视频网站的创业故事。，尽管二人付出了千辛万苦，但在激烈的同行竞争中仍然难以立足。凭着80后的敏锐思维，二人突发奇想，找到了一个来自农村的厨子王大亮，让他做“托儿”装成哑巴，“身残志坚”学习画画。在包装之下，王大亮成了会画”蒙娜丽莎”的网络红人，号称“流浪的达芬奇”，名声大噪。“走着瞧”网站点击率飙升，广告也随之而来。随着时间的推移，原本一个小的恶作剧愈演愈烈，竟成了弥天大谎……伴随着事业的成功，汤若等人对自己的欺世盗名和挪用汤父公司20万公款的行为感到越来越不安，并深觉愧疚，内心备受煎熬。最终在社会压力下和老一辈人的教育感化下，他们幡然悔悟，决心向大众公开道歉，开始新的创业之旅。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131101150843.jpg', '大陆', '', '0', '0', '', '1', '1384334693', '12', '2', '3', '3', '1384426331', '1', '1', '2', '4', 'qvod', '', 'qvod://229419464|D7D3F90AA1B17486233C2304CD4C115E8D96BB30|我们这拨人_DVD_01.rmvb|\rqvod://165958140|D848BBAE1209079A801B544CD45ED71F444EDE9A|我们这拨人_DVD_02.rmvb|\rqvod://182935333|2692CD819C2239E893782FE90DD05AF83ECA49AD|我们这拨人_DVD_03.rmvb|\rqvod://196425101|88D9C649E6E345F58B2B6E672F3199FC8DC03FEC|我们这拨人_DVD_04.rmvb|\rqvod://210564084|CB5546AD1698726E86DBC9B74B1BF1C28B007BFC|我们这拨人_DVD_05.rmvb|\rqvod://191535002|4B9B9C275AF22A460109B01DA8F8E5804F335257|我们这拨人_DVD_06.rmvb|\rqvod://214055064|FACB63A54B0E8831961E518AD74BFA26A217C089|我们这拨人_DVD_07.rmvb|\rqvod://214990136|07EE9A40FFC5AB21D595A1CC28F51C2812DF2809|我们这拨人_DVD_08.rmvb|\rqvod://211533261|A8D0D3F1703F09DC4DE271AA04D7C18C5226821D|我们这拨人_DVD_09.rmvb|\rqvod://192916571|BC034CF2A7283E7E4F9433D9D7D1305844AA50C4|我们这拨人_DVD_10.rmvb|\rqvod://159170027|0C95C4A84B4FAF0EBA3FFC7B35D02C74912724F6|我们这拨人_DVD_11.rmvb|\rqvod://158739802|295326D82E344E49EBED0EE391873A3966D52B22|我们这拨人_DVD_12.rmvb|\rqvod://158969704|4FFEC417E533AC5E8F6EBE07A6979C2E44B3BB45|我们这拨人_DVD_13.rmvb|\rqvod://158761436|08322875424B8D6244DA5BF7B7F1840ACF9E312F|我们这拨人_DVD_14.rmvb|\rqvod://158766368|4C310B1EB997A57A0DE94186D0F8E091B7B3541F|我们这拨人_DVD_15.rmvb|\rqvod://158713398|CA41796ADE607253E4B0BBE725C58EB6C7330191|我们这拨人_DVD_16.rmvb|\rqvod://158866990|9746E46E5BC3F57A4905AC33EA1553B70F07561F|我们这拨人_DVD_17.rmvb|\rqvod://158964009|6C882E4CC333586E21028C8DF9