INSERT INTO `ff_vod` VALUES ('147', '4', '食尚玩家[2013]', 'TV', '', '', '莎莎,艾毛,浩角翔起', '未填写', '在台湾，由名人或知名老饕推荐的美食总是特别让人跃跃欲试，由此《食尚玩家》节目应运而生。　\r\n    《食尚玩家》节目每周在TVBS欢乐台首播四期，由莎莎、2moro、浩角翔起等新生代主持人担当主持。所谓“食尚玩家”，就是在游玩中享受美食，在美食中尽情游玩，所以每一期的《食尚玩家》节目都会选择一个台湾的城市或其他国家的城市，同时设置一个主题，比如省钱游、浪漫游、相亲游、温暖游等，根据这个主题来进行节目的编排，选择当地有代表性或颇受网友好评的餐厅、旅游景点、人文景观、自然风景等，通过主持人在该地区的游历和对该地区的介绍，让观众了解该地区独特的美食、美丽的自然风景和当地的人文习俗等，也会向观众推荐一些颇受当地人好评或颇受网友好评的餐厅、酒店、民宿、夜市、旅游景点、礼品店等，为观众的出行提供了很好的建议，同时，《食尚玩家》节目通过对各个地区的美食和游玩的介绍，向观众传达享受生活、热爱生活的积极向上的观念。', 'http://175.6.0.111:8058/201011/02/20101102113145.jpg', '台湾', '', '0', '20131111', '', '1', '1384334712', '2', '0', '0', '0', '0', '1', '1', '6', '6', 'qvod', '', '20130101$qvod://307502775|7E8A9BE7D6BDCC6FDF70E7328D90AE442912AF2C|食尚玩家_TV_20130101.rmvb|\r20130102$qvod://302474538|878BAC86368F9AC12AC8FA59E5BB01D421765F7F|食尚玩家_TV_20130102.rmvb|\r20130103$qvod://308769194|72D27753F924372CB396F54870B93DE07341A24F|食尚玩家_TV_20130103.rmvb|\r20130108$qvod://309807829|86CF5EB55BA75F2E655D688A22B152BA8CE7ACA7|食尚玩家_TV_20130108.rmvb|\r20130109$qvod://303244721|40EC3FD7FD87BBEB32CC1D24B1D7C1FB58E4481B|食尚玩家_TV_20130109.rmvb|\r20130110$qvod://305718272|02277692315DA7B924C754D7586C0E21B5560C25|食尚玩家_TV_20130110.rmvb|\r20130114$qvod://306122892|5BD81F3ECF727624A9A13A2FA4C275DDE4C8CD5E|食尚玩家_TV_20130114.rmvb|\r20130115$qvod://311614338|D1FDF1F6CE470CC33D52612BD2E27346BB47D15C|食尚玩家_TV_20130115.rmvb|\r20130117$qvod://309714062|CF85539B448EFDDFBFC8F936914D894BEFAF00EF|食尚玩家_TV_20130117.rmvb|\r20130121$qvod://307501103|3E75ECCF87A7012CB9A07DF5706C836A11E1E8AA|食尚玩家_TV_20130121.rmvb|\r20130122$qvod://309930943|27BDB511A751E80E2D5557E2CD753AE4ED721275|食尚玩家_TV_20130122.rmvb|\r20130123$qvod://303189578|6F011CD6832256C3F82BF8508C082875F26CF2C1|食尚玩家_TV_20130123.rmvb|\r20130124$qvod://308461247|DEC23BBA4A109F59FFABD0801E8A211DEDC294B9|食尚玩家_TV_20130124.rmvb|\r20130128$qvod://312769731|67AE3B66FCF9AD141310B9198931F1ED439C1C38|食尚玩家_TV_20130128.rmvb|\r20130129$qvod://305434231|AE78ECD66F1B7EC00D1D7A128569B05FAE10