INSERT INTO `ff_vod` VALUES ('167', '14', '青春好久不见', 'BD', '', '', '黄蓉,童伟,江南', '段玉飞', '三十岁的廖天（童伟 饰）遭遇中年危机，婚姻失败，事业无成，沦落到去KTV刷马桶。一次偶然的机会，他遇到了已经成为“大哥级”人物的老同学梁冬（王梁 饰），被迫之下参加了高中同学聚会。在这里，廖天见到了到了昔日的朋友，还有当年喜欢过的校花——薛曼（黄蓉 饰），勾起了他藏在心底的记忆，以及那段最美好又充满遗憾的青春时光。而所有人的改变也让廖天感受到青春逝去、无法重来的悲伤。廖天用自己的方式向青。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105141954.jpg', '大陆', '', '0', '0', '', '1', '1383714822', '2', '0', '0', '0', '0', '1', '1', '1', '5', 'qvod', '', 'qvod://538703585|6B20C3285018DC60B3329E95F0EB86A8E23C97A3|[青春好久不见_BD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76109', '', 'Q', '', '1.0', '4', '1', '0', '0', '0');
