INSERT INTO `ff_vod` VALUES ('171', '3', '脆莓公园第二季', 'HDTV', '', '', '大卫·赫尔曼,丹尼尔·托什,凯特琳·奥尔森,汤姆·肯尼', '丹尼尔·托什', '《脆莓公园》主人公，又笨又肥又自恋，做事马马虎虎，经常把事情搞砸，脑袋经常跑偏，绝对超越了一般正常人的思维，但有时又能想出出人意料的好点子。这样一个人居然一直当着“脆莓公园”最佳林警，并且不择一切手段不让其他人抢走这个称号和勋章。特点是会把脑子里想的事情不经思考直接说出来（却还以为周围人不知道），另外，Steve不会感染性病。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130905180537.jpg', '欧美', '', '0', '9', '', '1', '1383714822', '5', '0', '0', '0', '0', '1', '1', '1', '4', 'qvod', '', '01$qvod://129885465|A704A9F92FE512A9E2EBC0E09BDCA110F940A59F|脆莓公园第二季_HDTV_01.mp4|\r02$qvod://105678734|2327EECBB41E6ADA1B21322B38A922371691C609|脆莓公园第二季_HDTV_02.mp4|\r03$qvod://119139627|8794373315187010AA2420B904645A567CAAC9F8|脆莓公园第二季_HDTV_03.mp4|\r04$qvod://127875018|515864736F85FFB6501E0A361A8159D4EEA6EA15|脆莓公园第二季_HDTV_04.mp4|\r05$qvod://113752321|4F24591173BB1D871149C07603802DE3BB2B5AF8|脆莓公园第二季_HDTV_05.mp4|\r06$qvod://115717236|C4B05B274D883D077CEC051F987F0B69A9F7115C|脆莓公园第二季_HDTV_06.mp4|\r07$qvod://122839516|14B0ED32353248A7BCE8BFBC6CC66635D804D713|脆莓公园第二季_HDTV_07.mp4|\r08$qvod://167454810|7F266FA38F0B42F15325A3B15CE692477AD9599E|脆莓公园第二季_HDTV_08.rmvb|\r09$qvod://143152449|CD2D88A73FF5C677778097070841CBD5C7B4D016|脆莓公园第二季_HDTV_09.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74249', '', 'C', '', '9.0', '7', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('172', '20', '人质/劫持杀机', 'HDTV', '', '', '托妮·克莱特,迪伦·麦克德莫特,Dylan,McDermott,泰特·多诺万,瑞斯·考罗,比利·布朗,何家蓓,詹姆斯·诺顿,奎恩·谢法德,马泰斯·瓦德', '杰弗利·纳赫马诺夫', '故事描述一个普通家庭卷入一场巨大的政治阴谋——这起事件不仅改变了这家人的命运，也影响到国家安全。艾美奖得主Toni Collette（《塔拉合众国》）在该剧中扮演主人公Ellen，一个事业成功的华盛顿外科医生。美国政府挑选她为患病的总统实施手术，但她的家人突然遭到绑架，她意识到一场巨大的政治阴谋已经降临到自己头上。现在她必须小心考虑自己的选择，以最安全的方式救出丈夫和孩子。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130924151657.jpg', '欧美', '', '0', '8', '', '1', '1384334710', '1', '0', '0', '0', '0', '1', '1', '5', '2', 'qvod', '', 'qvod://512816781|D4EFDE5F8B0E7B18575745BC2C82B76FC23F8AEA|人质第一季_HDTV_01.mkv| \rqvod://394242158|6AEE99BAEBF2A9C048B85AB163EE4ED384660C2A|人质第一季_HDTV_02.mkv| \rqvod://211639503|220FC8EAE95AD9E50181E1393C33F1243E2C1B37|人质第一季_HDTV_03.mp4| \rqvod://202504790|9979C84CA9E004BADE332A92DF22A8BE7673E912|人质第一季_HDTV_04.mp4| \rqvod://494900345|1833BB886F35C9C406FECFDE6ECAC73D39634984|人质第一季_HDTV_05.mkv| \rqvod://148957521|2B4103C03D44F7C1EECC4413E527BBADEA3B4D32|人质第一季_HDTV_06.rmvb|\rqvod://204331353|FFDFF0DDF4977C85B54F4E788D6393D0A7F66927|人质第一季_HDTV_07.rmvb|\rqvod://202236228|B1BFFC1C0D645EA8EA662F96FA364D64A8206F2A|人质第一季_HDTV_08.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74862', '', 'R', '', '7.0', '4', '1', '0', '0', '0');
