INSERT INTO `ff_vod` VALUES ('174', '3', '机巧少女不会受伤', 'HDTV', '', '', '下野纮,阿澄佳奈,冈本信彦', '未知', '机巧魔术，那是人形使们用来操纵内藏着魔术回路的自动人形而用的魔术，拥有这种技术的最高学府是英国的王立机巧学院，目前正举行著决定人形使之顶点“魔王”，通称为“夜会”的战斗。如今有两个人影正走过它的大门，来自日本的留学生雷真与他的伙伴的少女型人形的夜夜，为了得到“夜会”的参加资格，雷真决定直接用决斗的方式从参加预定者那里夺取资格。目标是次期魔王有力候补，外号是暴龙的美少女夏洛特，但是没想到 在决斗途中竟然发生意想不到的插曲……', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131008005856.jpg', '日本', '', '0', '6', '', '1', '1384334714', '8', '0', '0', '0', '0', '1', '1', '3', '8', 'qvod', '', '01$qvod://284349239|AE1157461FC25263CC311A3FBBEBBD6EBFA6CE6C|机巧少女不会受伤_HDTV_01.mp4|\r02$qvod://151167738|1CF71571A15299714F6816527EA1D062D17C4CD8|机巧少女不会受伤_HDTV_02.mp4|\r03$qvod://122620974|5F34C56CB35C7F16D65B8906A5955F490DA436D9|机巧少女不会受伤_HDTV_03.mp4|\r04$qvod://163288667|5B20188AE8EFE1396962E648C6271E39CF9D8729|机巧少女不会受伤_HDTV_04.rmvb|\r05$qvod://163440189|E06D8100A912A11CA6A07D1465DCB4347172B326|机巧少女不会受伤_HDTV_05.rmvb|\r06$qvod://150910946|4991A1F45E75B1BCA9575030F6B0401177BC5B5E|机巧少女不会受伤_HDTV_06.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75234', '', 'J', '', '4.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('175', '20', '性爱大师[QMV+]', 'HDTV', '', '', '麦克·辛,丽兹·卡潘,Caitlin,Fitzgerald', '约翰·麦登', '《性爱大师》（Masters Of Sex）是一部追踪美国「性革命」起源的历史剧。《恐怖大师》、《科幻大师》我们都看过了，那么……《性爱大师》（Masters Of Sex）呢？该剧根据畅销书《Masters of Sex: The Life and Times of William Masters and Virginia Johnson, the Couple Who Taught America How to Love》改编，故事描述了上世纪六十年代所谓的「人类性行为探索者」William Masters（Michael Sheen）和Virginia Johnson（Lizzy Caplan）的生活及对当时流行文化的影响。据称正是因为这两个人对性爱进行深入研究，才触发了当时西方社会特别是美国的「性革命」。Caitlin Fitzgerald扮演男女主人公中的「第三者」－－男主人公Masters的妻子Libby Masters。Nicholas D\"Agosto、Teddy Sears、Beau Bridges、Margo Martindale参与演出。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130917005645.jpg', '欧美', '', '0', '7', '', '1', '1384334712', '5', '0', '0', '0', '0', '1', '1', '3', '1', 'qvod', '', 'qvod://334567571|E760B6AAB25E5B83FAC203CC1EEF3CC2081E170C|性爱大师_HDTV_01.QMV|\rqvod://318714434|EEB6D931104F4CCDF83C2DD28EF512D2C7AA993F|性爱大师_HDTV_02.QMV|\rqvod://328580639|C19F61AE65287478AC44228ECE8D712550DE4E54|性爱大师_HDTV_03.QMV|\rqvod://327501523|CE86129C322A750C27F4BD307E68492ECD77A5CE|性爱大师_HDTV_04.QMV|\rqvod://247558341|96CCD156EC0BB41AC27C23C99F6A6803BFD2E0A2|性爱大师_HDTV_05.QMV|\rqvod://359586190|A6A5ACB84990DAB591108F6EC96D3F6DB2493845|性爱大师_HDTV_06.QMV|\rqvod://397266749|216CE6B8F779D6440645A7AB60442F53DBD2DDDF|性爱大师_HDTV_07.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75413', '', 'X', '', '7.0', '5', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('176', '20', '行尸走肉 第四季/阴尸路 第4季[QMV+]', 'HDTV', '', '', '安德鲁·林肯,大卫·莫瑞瑟,史蒂文·元,钱德勒·里格斯,斯科特·威尔森,劳伦·科汉,诺曼·瑞杜斯,小拉瑞·吉拉德', '格里高利·尼克特洛', '第四季仍继续围绕男主角瑞克及其率领的幸存者们展开。瑞克的扮演者安德鲁·林肯介绍道：“当第四季回归后，瑞克会处在一个完全不同的立场，他还会解释为什么要回到那个破旧的监狱。10月14日，《行尸走肉》第四季强势回归，即将再掀“丧尸风暴”！', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131014112244.jpg', '欧美', '', '0', '5', '', '1', '1384334712', '4', '0', '0', '0', '0', '1', '1', '7', '4', 'qvod', '', 'qvod://184671216|E6F2D641F6CD0452568F1B883F5A36597AF0915C|行尸走肉第四季_2013_HDTV_01.QMV|\rqvod://313229374|EF632FCC1EF37F6D1A114C86C4FB5065218659A5|行尸走肉第四季_2013_HDTV_02.QMV|\rqvod://312755675|3B43E608FD8F1B3CE40E89100B7FB5BF22F9B463|行尸走肉第四季_2013_HDTV_03.QMV|\rqvod://280978787|C5207C13FF6F6B4CCD31182B9E9D0A8EC197F785|行尸走肉第四季_2013_HDTV_04.QMV|\rqvod://290992693|4105B8456E5DEE885B12F91F515654800EEB36CC|行尸走肉第四季_2013_HDTV_05.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75513', '', 'X', '', '4.0', '4', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('177', '15', '万万没想到', 'DVD', '', '', '白客', '叫兽易小星', '《万万没想到》是万合天宜与优酷出品共同出品的一部系列迷你剧。该剧以夸张而幽默的方式描绘了屌丝代表王大锤意想不到的传奇故事。剧情内容极其丰富，从当下热门话题到经典历史故事，调侃的视角幽默的语言独树一帜。\r\n    作为天朝认证的皇家屌丝，王大锤每天的生活都多姿多彩而又变幻莫测。他就像你身边的一个普通人，他也经历着所有人都会遇到的事；只是在迷你剧独特的叙事手法和天马行空的框架下，他的人生从此却变得有所不同。也许是一样的挫折经历，因为多了一些异想天开和幽默调侃，王大锤的普通生活渐渐变得熠熠生辉。\r\n    王大锤代表着在大社会和各种压力下生活的普通群众，他面对的是每一个人都要面对的，而我们每一个人也都承受着世间的千奇百怪和万万想不到的剧情。影片从王大锤开始，幻化出你我他的普通生活，教会我们对挫折一笑而过决不妥协。', 'http://175.6.0.111:8058/vfolder//upimage/201308//20130812101712.jpg', '大陆', '', '0', '13', '', '1', '1384334712', '7', '0', '0', '0', '0', '1', '1', '8', '9', 'qvod', '', 'qvod://15133674|384AE3FEE3EA6EAC648CFE8B0347F8787FB8AE5C|万万没想到_DVD_01.mp4|\rqvod://20606317|2BBDD2B18E7E732768107C8C6B7178FD59C9737F|万万没想到_DVD_02.mp4|\rqvod://23961121|5314A8C9ACC310B38E82D525E7FC61F50C5403E1|万万没想到_DVD_03.rmvb|\rqvod://32030797|DFBF3700F18657ECD82E3C1B7174B3AF2F6A12D8|万万没想到_DVD_04.rmvb|\rqvod://48908652|D8C478A19D74A1B7FD27B10D8EB87F3AAC98433B|万万没想到_DVD_05.rmvb|\rqvod://59035313|3FC4029F5E10C2618170B67583ADDCDF2662F3C4|万万没想到_DVD_06.rmvb|\rqvod://60665441|5EFABCA292EFCF7E0137EE15FD1DE0F5B37B05A2|万万没想到_DVD_07.rmvb|\rqvod://64012974|73F9C0948625BA8B66B105824C84216EE8402995|万万没想到_DVD_08.rmvb|\rqvod://66000440|C1AAFF9F12EC0F717B59E3C442F8665547CDF5B7|万万没想到_DVD_09.rmvb|\rqvod://109842410|C9B39D488DEAB8778633134959A072B933FF4757|万万没想到_DVD_10.rmvb|\rqvod://51214165|F857ED8D52B9EA128D24C1B81FEFD4D8E86D6C1B|万万没想到_DVD_11番外篇.第一话.rmvb|\rqvod://61202109|0817E8ECA96A1A03DEE819002D4543183638222F|万万没想到_DVD_12番外篇.第二话.rmvb|\rqvod://59298140|489380EFE68A0C72788D5C6E8A1F8118CDEA8909|万万没想到_DVD_13番外篇.第三话.rmvb|\rqvod://87119733|B098DBC773EF6705257C0E46DDE130381E5B28E1|万万没想到.制作特辑_DVD.rmvb|\rqvod://34702047|AFEB7029C62A63DC7386A0478404C4B9A06B670F|万万没想到.制作特辑.1111脱光秘笈BD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=73615', '', 'W', '', '4.0', '5', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('178', '19', '奇皇后[QMV+]', 'HDTV', '', '', '河智苑,朱镇模,池昌旭,郑雄仁,李文植', '韩熙', '该剧将讲述高丽人奇子敖的女儿在家人被高丽王杀害后，以高丽贡女的身份被进献给元廷，通过一系列宫廷权利斗争，从身份低微的掌茶宫女，最终成为元朝皇后的故事。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131029015842.jpg', '韩国', '', '0', '3', '', '1', '1384334695', '9', '0', '0', '0', '0', '1', '1', '2', '3', 'qvod', '', 'qvod://430014815|37645D7D3156508D3DB886DE2196F8C114FC4178|奇皇后_HDTV_01.QMV|\rqvod://433606051|C70C775B314988B7A9CC4391A1B4EAAEDFA8737E|奇皇后_HDTV_02.QMV|\rqvod://434789268|A7585FE410A3C6BBC5830321018031E0BDC7F7EC|奇皇后_HDTV_03.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76053', '', 'Q', '', '6.0', '7', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('179', '4', '爸爸去哪儿[湖南卫视QMV+]', 'HDTV', '', '', '未知', '未知', '《爸爸去哪儿》原版模式购自韩国MBC电视台，节目中多位来自各行业的明星将还原到爸爸的角色，每期将有5位明星爸爸跟子女48小时的乡村体验，爸爸单独肩负起照顾孩子饮食起居的责任，节目组设置一系列由父子(女)共同完成的任务，父子(女)俩在不熟悉的环境下状况百出。 短短两天，将成为平日里很少有机会待在一起的父子(女)拉近距离的难忘时光。节目里让父亲着实体验了一把没有孩子妈在身旁、爸爸们一下子又当爹又当妈，这样或许爸爸们更能体会到妻子在家带孩子的辛苦。不管是参加节目体验的明星还是电视机前的观众看了以后应该都会更加爱护自己的妻子，更加要做一个好父亲的决心。 湖南卫视“明星亲子”节目《爸爸去哪儿》旅行真人秀这个概念在韩国从2007年的综艺节目《两天一夜》开始，之后韩国便大量产生了将几男几女安排在一起去野外或者国游玩的真人秀类节目。 2013年，随着韩国MBC的《爸爸，我们去哪儿？》大热，湖南卫视也引进了该节目版权。该节目是由影视、歌唱、体育等领域发展的明星爸爸带着各自的小孩，展开一次两天一夜的亲子之旅。第一期节目将在10月11日晚播出，并成为第四季度的主打综艺节目。里面最受关注的非那些明星带着孩子参赛莫属，据悉，林志颖和儿子KIMI、王岳伦和女儿王诗龄、田亮和女儿田雨橙、郭涛和儿子郭子睿、张亮和儿子张悦轩将组成头几集的阵容，进行农村放羊、野外爬山、上船捕鱼等活动。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131012000807.jpg', '大陆', '', '0', '20131108', '', '1', '1384334713', '3', '0', '0', '0', '0', '1', '1', '9', '2', 'qvod', '', '20131011$qvod://630425226|CF887CB87E79F3906DACF75ACCD93D6CF05472F2|爸爸去哪儿_HDTV_20131011.QMV|\r20131018$qvod://651878227|AADD8BD385EEF1BE5AC48F4D88962DE515E4B5F8|爸爸去哪儿_HDTV_20131018.QMV|\r20131025$qvod://641644870|B6EEF50B3C18E48488EB82DE8285E05C3796BBA8|爸爸去哪儿_HDTV_20131025.QMV|\r20131101$qvod://655582687|F7474A82DE1874AA0CCEDF7AD18D51329839A991|爸爸去哪儿_HDTV_20131101.QMV|\r20131108$qvod://602096832|F8D30D1DC47AEFE3FD871E3C8F8B6BD8551AB20F|爸爸去哪儿_HDTV_20131108.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75631', '', 'B', '', '4.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('180', '10', '李米的猜想', 'DVD', '', '', '周迅,邓超,张涵予,王宝强,王砚辉', '曹保平', '　　爱一个人你会等多久？　　李米等了四年！\r\n　　四年来，李米一直都在寻找自己的未婚夫方文。四年前，论及婚嫁的两人因李米父母的反对而分手，方文负气离开。四年来，李米总能收到方文写给她的信，然而却从来没有寄信地址。方文从她的生活中消失了，却似乎又以一种特殊的方式存在着。这个城市到处都漂浮着他们之间的回忆，李米每天都在路途中不停的寻找，在希望与失望的两极之间挣扎。她把方文的照片夹在杂志里，给每一个乘客看，期望能够等到一点点线索。只是，当她真的遇到那个朝思暮想的男人时，他还记得她么？', 'http://175.6.0.111:8058/200904/16/115724910.jpg', '大陆', '', '0', '0', '', '1', '1383714827', '3', '0', '0', '0', '0', '1', '1', '3', '2', 'qvod', '', 'qvod://1077778010|058E9ECA77A85B7C1DAB5F500F2DBF3A72990955|李米的猜想_HDTV.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76107', '', 'L', '', '2.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('181', '3', '苍蓝钢铁的琶音', 'HDTV', '', '', '兴津和幸,渕上舞,沼仓爱美,山村響,内山夕实', '岸诚二', '在地面上，由于全球气候变暖的影响，在21世纪的开端，人类已经失去了大追捕。突然，军舰在二战期间的一组配备一个超级武器，随着全球出现神秘的迷雾。它的意图，人类遭遇了失败军舰舰称为“舰队雾” ，再也不能走出海面上失去控制的海域。经过17年，并登上潜艇的y 401“舰队的雾”，这是人性化的一面，他和我们的朋友，千早雕塑组的学员，战斗舰队的雾随着艾奥娜的心理模型的船舶。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131008230057.jpg', '日本', '', '0', '6', '', '1', '1384334712', '0', '0', '0', '0', '0', '1', '1', '7', '5', 'qvod', '', '01$qvod://141718086|92E3EE59379E3D30B20E3B9E770AC280F872D78B|苍蓝钢铁的琶音_HDTV_01.MP4|\r02$qvod://227472847|2C31060CA9F43D17C6B23B23E2E630D56B5B965A|苍蓝钢铁的琶音_HDTV_02.mp4|\r03$qvod://114089380|D1D050CBD17E26E1FEB8114C5E2C0096EAABEFD4|苍蓝钢铁的琶音_HDTV_03.rmvb|\r04$qvod://181576083|F4AFE9E951953DD271E172450DE4FD4D52DF4D13|苍蓝钢铁的琶音_HDTV_04.rmvb|\r05$qvod://160923569|56458F9876490135597A139D34D856C7FE13BB09|苍蓝钢铁的琶音_HDTV_05.rmvb|\r06$qvod://159718692|E3628577DC494FB402B05DA7F353DF9F40DBB9A3|苍蓝钢铁的琶音_HDTV_06.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75259', '', 'C', '', '6.0', '1', '1', '0', '0', '0');
