INSERT INTO `ff_vod` VALUES ('184', '18', '秘密[日剧QMV+]', 'HDTV', '', '', '志田未来,佐佐木藏之介,本仮屋唯佳,池津祥子,升毅,林丹丹,龙星凉,堀内敬子,吹越满', '唐木希浩,高桥伸之', '原本幸福的一家三口人因为一次车祸变得分崩离析。妻子和女儿乘坐的巴士因为司机的睡眠不足导致跌落山谷。最后妻子死去，女儿得以幸存。奇怪的是，妻子的灵魂却住进了女儿的身体里，女儿自己的灵魂却不知去向。杉田平介（佐佐木藏之介 饰）面对这样的结果不知该庆幸还是难过。于是平介和外表是女儿，内心是妻子的杉田藻奈美（志田未来 饰）开始了奇异的生活。妻子决定替女儿好好活下去，在学校认真学起了当高中生，而在家则是平介的太太，替他打点好生活。对于平介，还能有妻子和女儿相伴，某种程度上值得欣慰。但与此同时，他也无法同妻子过正常的夫妻生活。而女儿这边，上了大学的她结识了不同的人，有了追求者，一方面觉得要让女儿体验精彩的人生，另一方面又觉得对不起丈夫，这让藻奈美和平介都十分痛苦。于是女儿下了一个决定，让二人都释然……\r\n    本剧改编自东野圭吾的同名小说，还有同名电影版。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131103082858.jpg', '日本', '', '0', '4', '', '1', '1383714827', '3', '0', '0', '0', '0', '1', '1', '4', '9', 'qvod', '', 'qvod://402271376|E8A2854CFCE35CA77947585B7D60F9B9131EE560|秘密_2010_HDTV_01.QMV|\rqvod://401886205|3812F561DEA300F01FA7AED0B0CA93FCCCA46804|秘密_2010_HDTV_02.QMV|\rqvod://402408876|8278E30A4F02BEC283D88FE6DDEC2B6645F9BA13|秘密_2010_HDTV_03.QMV|\rqvod://403732810|BFBB1511CD15A5487E0630D882388339420B2DA8|秘密_2010_HDTV_04.QMV|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76067', '', 'M', '', '3.0', '4', '1', '0', '0', '0');
