INSERT INTO `ff_vod` VALUES ('188', '15', '幸福人生/因为爱情有多美[QMV+]', 'HDTV', '', '', '海陆,蒋毅,彭冠英,赵韩樱子,李泰,张含韵', '高先明', '成长于幸福家庭中的文馨（海陆 饰），纯真善良，与丈夫陈笑飞（蒋毅 饰）有着美满的婚姻。林多美（赵韩樱子 饰）与文馨的哥哥文杰（李泰 饰）在国外相识，回国后林多美嫁进文家后，意外发现文馨的丈夫陈笑飞居然是她至今难忘的初恋。陈笑飞作为倒插门女婿，一直为文家工作出力却没有得到足够的认可，加上他身上背负着上一代的恩怨，让陈笑飞内心矛盾压抑。而林多美因为谎言而得来的幸福并不牢靠，在婚后被文杰发现真相并产生质疑，陷入信任危机。 一连串的意外，把陈笑飞和林多美往错误的道路上越推越远，他们不断犯下过错，令文馨及其家人陷入危机。文馨经受系列打击后反而脱胎换骨，在叶南迪（彭冠英 饰）和闺蜜杜若男（张含韵 饰）的帮助下，她自强不息，并苦心追查父亲去世和公司破产的真相，最终令罪魁祸首得到应有的惩罚。文馨也终于收获真正的爱情，与叶南迪终成眷属。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130929203133.jpg', '大陆', '', '0', '76', '', '1', '1384334695', '1', '0', '0', '0', '0', '1', '1', '6', '8', 'qvod', '', 'qvod://173262507|FD2601DBCD352CA3A427F918C5B9C419114D70FB|因为爱情有多美_HDTV_01.QMV|\rqvod://259088295|F22BBD080218C36F670914817132730E311F52CF|因为爱情有多美_HDTV_02.QMV|\rqvod://199537444|72E2CBE0CE71F63FBA334DE98E3C4E12DC473327|因为爱情有多美_HDTV_03.QMV|\rqvod://176696691|1F7CEACEC42312416E7FCA48F4A786906B7E02BD|因为爱情有多美_HDTV_04.QMV|\rqvod://196707268|740CD006AFA1F4396C41CF6B12F4004F8C59DCD2|因为爱情有多美_HDTV_06.QMV|\rqvod://255735186|8A98622A00C7B1400935F5AC30DF9780589C5C9D|因为爱情有多美_HDTV_05.QMV|\rqvod://210773230|00C466BBA4055DAF3D6E704CAA8BC3D8AAD088F4|因为爱情有多美_HDTV_07.QMV|\rqvod://261042642|3ABE058FDD837BABFC4843F5085EAA4AB6CE237C|因为爱情有多美_HDTV_08.QMV|\rqvod://295721223|88A2657ABB2826AED2664F7A2718DEF36759B85F|因为爱情有多美_HDTV_09.QMV|\rqvod://220814450|3ADB2EF7B21E13B97EA18A2E0B911C83CD22AC97|因为爱情有多美_HDTV_10.QMV|\rqvod://247989998|F49AD721F9949D4F744924F6EF3CF60E316E9D86|因为爱情有多美_HDTV_11.QMV|\rqvod://285127641|70E2061A4E58D56CB9C9B40A332222BBBE68AC13|因为爱情有多美_HDTV_12.QMV|\rqvod://221274926|6AD9A29896A26FB7217608D6D614077C1AA1C158|因为爱情有多美_HDTV_13.QMV|\rqvod://279647223|709FD6B49A2D5FFD5FAFD5F5FB15867D217CCE44|因为爱情有多美_HDTV_14.QMV|\rqvod://302534142|31F0E68E043CE40302644DB7D8D19C602150BFFC|因为爱情有多美_HDTV_15.QMV|\rqvod://200731440|DBDB7C526B448F63366177FE8299F13036C08EB0|因为爱情有多美_HDTV_16.QMV|\rqvod://184087237|71FEDE88114DC790F6274F1971330A1CBCDDF327|因为爱情有多美_H