INSERT INTO `ff_vod` VALUES ('189', '18', '机师小姐/飞行员小姐', 'HDTV', '', '', '堀北真希,相武纱季,斎藤工,桜庭ななみ,菜々绪,间宫祥太朗,小柳友,藤井流星,庄野崎谦', '泽田镰作,成田岳', '故事讲述主角手塚晴是东京蒲田居酒屋店主的女儿，因为性格直率不懂巧言说谎，就职活动陷入苦战。之后参加ANA的招募，考试合格展开女机师之道。过程中她将遇上和她有共同目标亦敌亦友的同学，对她们进行严格训练的魔鬼教官，还有制定培育机师制度的高层。晴将面对预想以外的重压，在当中跨越困难奋斗成长，当然然也会遇上友情和恋爱的考验。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131017144603.jpg', '日本', '', '0', '3', '', '1', '1383714827', '6', '0', '0', '0', '0', '1', '1', '4', '9', 'qvod', '', 'qvod://213556885|B2B41683D1A5F79974A3B7E0EA1B5D371A1D0FB3|飞行员小姐_HDTV_01.rmvb|\rqvod://215391202|60AEA8D7A2259B5EB85A8CDF11A739F0A67B6F12|飞行员小姐_HDTV_02.rmvb|\rqvod://215422710|F6605B0CB00D94C413E10EE2FF24D971488C29B8|飞行员小姐_HDTV_03.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75581', '', 'J', '', '2.0', '9', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('190', '14', '青春如期', 'DVD', '', '', '陈羽琦,韩雪薇,廖望,王德枫,王翌', '泽田', '程道琪和阿华、顾景容是大学死党。毕业聚会时程道琪因为在酒吧为依依打架，被依依深深的喜欢。但因阿华喜欢依依，所以不断拒绝依依的感情，同时在酒吧顾景容认识了依依的表姐夏文文，情窦初开，并为夏文文做了许多感动其的事情，最终获取了夏文文的芳心。一次聚会的酒后程道琪和依依发生关系，决定要对其负责和其在一起，但却因此阿华与程道琪决裂，友情，爱情，生存，5个人面临着相同的考验该何去何从。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130925001710.jpg', '大陆', '', '0', '0', '', '1', '1383714827', '5', '0', '0', '0', '0', '1', '1', '1', '6', 'qvod', '', 'qvod://480055352|6FABADAD5E2ACC4E9458BC9E4ADA7608A70A4541|青春如期_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74876', '', 'Q', '', '6.0', '8', '1', '0', '0', '0');
