INSERT INTO `ff_vod` VALUES ('192', '14', '二哥相亲记[微电影]', 'DVD', '', '', '徐颖鹏', '徐颖鹏', '喜剧微电影《二哥相亲记》以许颖鹏饰演的“二哥”相亲过程为故事背景，在相亲的路上“二哥”的一系列丰富的肢体语言，展现了“二哥”这个人物的“二”的性格特点，尽管在相亲路上遇到各种坎坷的事情，但是“二哥”依然执着于相亲这一事，知道片尾“二哥”相亲的对象出镜后……', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105104342.jpg', '大陆', '', '0', '0', '', '1', '1383714827', '6', '0', '0', '0', '0', '1', '1', '2', '2', 'qvod', '', 'qvod://16028942|A2AD42605FE2266D3E3F7F548F1B4AD351AA5076|二哥相亲记_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76105', '', 'E', '', '3.0', '5', '1', '0', '0', '0');
