INSERT INTO `ff_vod` VALUES ('196', '9', '憨哥与逗妹', 'DVD', '', '', '周石林,张海梦', '林梦静', '某日，逗妹在公司厕所拉屎的时候，听到小亲亲在外面打电话，说想吃重庆的豆花，但因为工作忙去不了。逗妹立马有了动力，“小亲亲的梦想就是我的梦想，好，出发去重庆！”本次拍摄创下了《憨哥与逗妹》的新记录，第一次坐飞机外出，到过的最远的地方，片长最长，拍摄周期最长的一次拍摄。逗妹为了完成小亲亲的心愿，独自来到重庆，不料在重庆还能偶遇憨哥，原来他们俩拿了相同的旅游攻略，攻略上有五个任务，因为这个攻略，俩人频频相遇，接下来又会发生什么雷人的事呢？在完成了攻略上的五个任务之后，逗妹还有最重要的第六个任务，那就是给小亲亲买豆花，小亲亲会接受逗妹的这份情吗？憨哥这次来重庆又是为了什么？', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105103004.jpg', '大陆', '', '0', '0', '', '1', '1383714827', '9', '0', '0', '0', '0', '1', '1', '5', '2', 'qvod', '', 'qvod://170821612|785C51EC646F5913FE9196F7305A70FB209BE4A8|憨哥与逗妹_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76102', '', 'H', '', '3.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('197', '14', '我是球迷', 'BD', '', '', '秦汉擂,杜安琪', '张晓颖', '刘小宇是一个忠实的老球迷。一天，他在家翻开相册，随着照片的一张张闪过，勾起了他足球历程。回忆点点滴滴涌现而出。小时候一次偶然的经历中，国家队退役的王叔叔把他带进了足球的大门；年轻时也因为踢足球，使她结识了他的终身半侣；老婆临产时，更是伴随着收看一场重要足球比赛中度过；从小教儿子踢足球，盼着有一天儿子长大考上体育大学。时光流逝回到相册，刘小宇儿子也考上了体育大学并成为了足球队的一员。此刻，年迈的刘小宇穿着队服，慢慢和上老相册。电视播放着足球决赛……', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105103208.jpg', '大陆', '', '0', '0', '', '1', '1383714827', '1', '0', '0', '0', '0', '1', '1', '9', '3', 'qvod', '', 'qvod://112637104|C15BF56B10A9015FE72A795E16A47870DDAB79AD|我是球迷_BD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76103', '', 'W', '', '4.0', '4', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('198', '8', '活人墓/钢铁坟墓/金蝉脱壳/逃跑计划/越狱', 'TS', '', '', '西尔维斯特·史泰龙,阿诺·施瓦辛格,詹姆斯·卡维泽,文森特·诺费奥,维尼·琼斯,山姆·尼尔,50分,艾米·莱安,法兰·塔希尔,马特·杰拉德,杰夫·蔡斯,斯蒂文·克鲁格', '米凯尔·哈弗斯特罗姆', '一位世界上最顶尖的安全系统设计专家设法从自己设计的监狱中逃脱的故事，史泰龙饰演这位设计师雷-布雷斯林(Ray Breslin)，施瓦辛格则饰演他的越狱搭档斯万-罗特梅耶(Swan Rottmayer)。其他参演影星还包括《疑犯追踪》男星詹姆斯-卡维泽(James Caviezel)，“恶汉专业户”维尼-琼斯(Vinnie Jones)等等。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131004103959.jpg', '欧美', '', '0', '0', '', '1', '1383714827', '7', '0', '0', '0', '0', '1', '1', '8', '2', 'qvod', '', 'qvod://529863670|10E787CA3E7C01769800532BA13B78110CBC1094|金蝉脱壳_TS.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75135', '', 'H', '', '7.0', '4', '1', '0', '0', '0');
