INSERT INTO `ff_vod` VALUES ('200', '8', '壮志凌云2[预告片]', 'DVD', '', '', '汤姆·克鲁斯', '托尼·斯科特', '1986年，《壮志凌云》里英俊帅气的飞行员让大众记住了汤姆·克鲁斯的名字，少年俊秀由此平步青云。22年后，巅峰已过的阿汤哥“壮志未酬”，仍希望借助这部“幸运片”再登好莱坞一哥宝座。《壮志凌云2》剧本大纲已经写好，故事讲述本是战斗机机师的汤姆·克鲁斯已升任为空军学校教官，训练一个年少气盛的女机师。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105102405.jpg', '欧美', '', '0', '0', '', '1', '1383714835', '7', '0', '0', '0', '0', '1', '1', '7', '4', 'qvod', '', 'qvod://8214379|13AD9A0363F7628CFC29A0BCBBCD3AF6E22AE153|壮志凌云2.预告片_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76101', '', 'Z', '', '3.0', '2', '1', '0', '0', '0');
