INSERT INTO `ff_vod` VALUES ('202', '14', '有种[预告片]', 'DVD', '', '', '段博文,李昕芸,韩雯雯,吕聿来,时诗,王景春,秦子涵,王梓诺,高群书,赵宁宇,孔二狗', '张元', '三宝（段博文 饰）是游荡在北京城的一名普通青年，遭遇女友背叛后，他一下子失去了生活的意义，随后他丢了工作，被房东赶出门，他甚至想到了轻生。幸好，三宝身边有个好哥们王铭（吕聿来 饰）一直支持他。因为一个意外事件，他们遇到了酒吧乐队主唱柚子（李昕芸 饰）以及男扮女装的舞者小诗（时诗 饰）。身为这座城市的外地人，他们四个年轻人格格不入，生活在都市的夹缝，有着各自的烦恼和困境，始终处于一种失意者的状态。他们遭遇过背叛，也忍受过凌辱，见证着身边的人来了又走。\r\n    生活没种，精神有种。四个年轻人互相扶持，彼此照顾，并没有因为命运的嘲弄而放弃追逐美好，在没有光明的地方，他们以黑暗为灯。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105100954.jpg', '大陆', '', '0', '0', '', '1', '1383714835', '7', '0', '0', '0', '0', '1', '1', '9', '6', 'qvod', '', 'qvod://8096037|DBCBA0A2B5864C810E97BC05438269579A54AE88|有种.预告片_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76099', '', 'Y', '', '6.0', '8', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('203', '14', '做茧[预告片]', 'DVD', '', '', '孙易铖,张学虎,张春龙,朱宏郁,张博程,毋点点,马静一', '殷德义', '大神和阳阳是表兄弟，他们跟随黑社会成员柱子一起为老大工作。在一次帮助老大交易的过程中，不慎将七十万元现金丢失，老大请来前刑警韩凯对他们三人进行严酷审讯。\r\n    这笔钱到底被谁拿走？这三个人当中又有怎样的恩怨情仇？在审讯的过程中，谜底将被逐一揭开。当一切似乎尘埃落定的时候，他们才发现，这里面所有的人都不过是一个可悲的被利用者。这事件背后，原来隐藏着更不可测的阴谋。\r\n    螳螂捕蝉黄雀在后，那么黄雀到底是谁？', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105101516.jpg', '大陆', '', '0', '0', '', '1', '1383714835', '7', '0', '0', '0', '0', '1', '1', '8', '7', 'qvod', '', 'qvod://18841353|A213F90E8AEC6FC795BB2D47465747A5D73C7A99|做茧.预告片_DVD.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76100', '', 'Z', '', '1.0', '2', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('204', '14', '囚徒', 'DVDscr', '', '', '休·杰克曼,杰克·吉伦哈尔,保罗·达诺,玛丽亚·贝罗,泰伦斯·霍华德,维奥拉·戴维斯,迪兰·明奈特,韦恩·杜瓦尔,梅丽莎·里奥', '丹尼斯·维伦纽瓦', '为了自己孩子的性命你会做到哪一步？凯勒.多佛（杰克曼饰）面对的是每个父母最恐惧的恶梦。他六岁的女儿安娜和小玩伴祖儿一起失踪了。唯一的线索是早前停在他家附近的一辆休闲车。在调查中，警探洛基（吉伦哈尔饰）逮捕了这辆车的车主亚历克斯.琼斯（保罗.达诺饰），但因为缺乏证据而不得不放了他。\r\n    想到自己的孩子身处险境，急疯了的多佛决定靠自己。这位绝望的父亲决定不顾一切找到失踪的小女生们，但在找寻女儿的过程中，他渐渐迷失了自己，从而引出一个问题：寻求正义是不是可以超越法治？', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130929223556.jpg', '欧美', '', '0', '0', '', '1', '1383714835', '7', '0', '0', '0', '0', '1', '1', '2', '9', 'qvod', '', 'qvod://557588314|57169F6867DD2D2E64748DB11CEA1F34C2BE0F16|囚徒_DVDscr.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75012', '', 'Q', '', '8.0', '3', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('205', '4', '娱乐百分百[2013]', 'TV', '', '', '罗志祥,黄鸿升', '未填写', '《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBSG《娱乐新闻》（EntertainmentNews）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间1800至1900，重播时间为隔天凌晨100、早上600、早上1100。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。\r\n    罗志祥曾说过“娱乐百分百好比就是一碗白饭，就算有再喜欢吃的菜，也离不开这碗白饭”', 'http://175.6.0.111:8058/201011/02/20101102100414.jpg', '台湾', '', '0', '20131111', '', '1', '1384334710', '3', '0', '0', '0', '0', '1', '1', '6', '4', 'qvod', '', '20130101$qvod://310041172|D6DF230AEF1436CB88AA8390F43DAAB01C203611|娱乐百分百.年度十大娱乐新闻.李宗瑞迷奸案第一_TV_20130101.rmvb|\r20130102$qvod://293963865|AA88CADBF5A17CBDAAEDA9B64FDF383141A37B4D|娱乐百分百.2012年度成绩单.演艺圈年度好友_TV_20130102.rmvb|\r20130103$qvod://287704379|DA356FEBAA4F61AC9BE39E35BC2EEF1E84958D7A|娱乐百分百.汪东城被封.不老顽童.曾沛慈假发套头被恶_TV_20130103.rmvb|\r20130104$qvod://290808340|901CADF8A9AE6FACB32F20722F11B33EA54997C4|娱乐百分百.亲爱的奶奶影友会_TV_20130104.rmvb|\r20130107$qvod://291540104|E73B377E153727543C53AAAEDD59EA47149B8F02|娱乐百分百.韩流控舞蹈大赛_TV_20130107.rmvb|\r20130108$qvod://290905497|74A2F670A8BFDF5324CCA20B91CBC91A4C473985|娱乐百分百_TV_20130108.rmvb|\r20130109$qvod://292320038|F7F896012E0307CCD6DF4D481856CA7E4B7D4255|娱乐百分百_TV_20130109.rmvb|\r20130110$qvod://290489475|C1C7BBBF99496A719DABEDCD34E18535D9C42EDA|娱乐百分百.恋爱百分百.陈意涵上演浪漫相亲记_TV_20130110.rmvb|\r20130111$qvod://287417079|F889CA6996DA057054B982ABD50BD3FBD6B5842A|娱乐百分百.我家也有大明星.林俊逸经典模仿费玉清_TV_20130111.rmvb|\r20130114$qvod://289442033|F7756D0122F7FDA70292940376988FA4D0197BA1|娱乐百分百.周杰伦香蕉弹琴.十二新作MV细节曝光_TV_20130114.rmvb|\r20130115$qvod://289489246|50A517B80AB1F387B82456055A2BDA92F51B2E37|娱乐百分百.曹格演唱会邀好友.小鬼或挑战变装演唱_TV_20130115.rmvb|\r20130116$qvod://285961478|40CF1D5DA6EB326FCCEEA3676C78B8C04170524D|娱乐百分百.萧亚轩模仿大赛_TV_20130116.rmvb|\r20130117$qvod://290318974|454E2E825DFD7DB85D997AAD4C9C91D2D74F1D9E|娱乐百分百.宅男女神DreamGirl联谊会_TV_20130117.rmvb|\r20130118$qvod://287256822|35003D7BCF56FA7713DEC5C6D3DC633BD2