INSERT INTO `ff_vod` VALUES ('207', '4', '超级访问[2013]', 'TV', '', '', '李静,戴军', '未填写', '　　栏目介绍：《超级访问》是一档由当红娱乐节目主持人李静、戴军以最幽默、最诙谐的语言联袂打造的关注、透视我们身边明星的大型娱乐访谈节目。节目每周一期，每期将邀请一位家喻户晓的焦点人物（如：娱乐明星、体坛名将、时尚人物）做客《超级访问》，节目从多角度挖掘明星鲜为人知的故事。通过场外亲朋好友的大胆揭秘、现场主持人机智幽默的追问“逼着”名角众目睽睽之下“现原形”！五十分钟的节目在娱乐中搞笑，轻松中引发真情，使您在捧腹大笑之余体会百味人生。\r\n 　　一样的明星，不一样的访问！《超级访问》时尚人群不容错过！栏目主持人：担纲主持《超级访问》的两位“超级”搭档李静和戴军以最默契、最幽默的配合，天衣无缝的精彩表现赢得了观众的一致认可。掌门人李静头发乱乱，身着奇装异服，机智灵活，善于“穿针引线、击中要害”;戴军嘴角一抹坏笑，风趣幽默，善于“插科打诨、语出惊人”。\r\n 　　《超级访问》在红遍大江南北后又携《凤凰卫视》之手，落户美国和欧洲，成为新时代华语娱乐节目的楷范。被评为2003年中国最佳谈话节目主持人。《超级访问》2004年获得第二届中国电视十大名牌栏目荣誉称号。2004年荣获广东南方电视台颁发的金南方年度最默契主持搭档奖。2006获《北京电视周刊》举办观众票选的“完美收视”活动最佳电视节目奖\r\n 　　发行网络覆盖全国，与200家电视台及海外传播机构建立了紧密的合作关系。（电视台、数字频道、网络视频、凤凰欧洲电视台、凤凰美洲电视台、公交车、民航客机、VCD和DVD中播出。）', 'http://175.6.0.111:8058/201010/11/20101011112917.jpg', '大陆', '', '0', '20131111', '', '1', '1384334710', '5', '0', '0', '0', '0', '1', '1', '1', '8', 'qvod', '', '20130107$qvod://174156351|3798BBC656C0061EC8C0D5D99E13DA34E8FB9EE3|超级访问.章子怡.荣耀背后的辛酸与无奈_TV_20130107.rmvb|\r20130114$qvod://172179926|314E588BB66D7BFC7B993D9113C3F17C77E3B1B1|超级访问.王雷现场向李小萌求婚.自曝初次约会竟在动物园_TV_20130114.rmvb|\r20130121$qvod://174865866|1E9E63ABDDDA3FD67CA9A5DCCF3C86DDB5834B84|超级访问.严宽被曝不懂浪漫.美艳女友首曝光_TV_20130121.rmvb|\r20130128$qvod://163752486|7F684DC423BDFC65ACB24AF448F62516C1A32FAF|超级访问.张卫健自曝险破产.感恩刘德华帮付贷款_TV_20130128.rmvb|\r20130204$qvod://174350274|23D798610879498B06F1147EBAF35EEFD173F74D|超级访问.于震遭娇妻投诉三宗罪.首秀儿子萌照_TV_20130204.rmvb|\r20130218$qvod://183809539|3929C5984C094A591C474656716743ECB47E0EC6|超级访问.小二班新年聚会.那英大爆张玮私生活_TV_20130218.rmvb|\r20130225$qvod://172501494|D3DE03DAA04C5ADAECAFA5EC51B60B48EC149840|超级访问.曹云金首曝择偶标准.幽默调侃戴军长相_TV_20130225.rmvb|\r20130304$qvod://178823306|A4FF49A25E05476D0E22B9617FFEC2A8ED71887D|超级访问.林申苏岩吻戏惊心.张少华憾事令人扼腕_TV_20130304.rmvb|\r20130311$qvod://168662196|4D577169FF9612F0C353F59682E43D639AE2AEB0|超级访问.李静PK朱丹互相较劲.戴军惨变极品前任_TV_20130311.rmvb|\r20130318$qvod://172801077|386CDFCA3C785FBB5EA48E02CE25FC685BC3DEA2|超级访问.龚琳娜曝御夫之术.老锣与岳母频发冲突_TV_20130318.rmvb|\r20130