INSERT INTO `ff_vod` VALUES ('210', '20', '背叛[美剧]', 'HDTV', '', '', '汉娜·韦尔,斯图尔特·汤森德,克里斯·J.约翰逊,詹姆斯·克伦威尔,温迪·莫尼兹', '未知', '该剧改编自另一部荷兰剧集——如同去年获得剧集预订的新剧《血玫瑰》（Red Widow）一样。\r\n    一切起始于在艺廊中的一次邂逅。从第一眼看到对方开始，摄影师Sara Hayward（Hannah Ware）和律师Jack McCutchen（Stuart Townsend）立刻有了一种触电般的感觉。你可以叫它「一见钟情」，也可以叫它「天注定」，但它就这么自然而然地发生了。\r\n    尽管他们都已经结婚，但他们的婚姻都很不幸。Sara嫁给了事业成功的检察官Drew Hayward（Chris Johnson），一个政治小爬虫，所做的一切都是为了自己能获得更高的地位。外人看来Drew和Sara是一对完美夫妻，但Sara很清楚两人的婚姻已经名存实亡，那种隔阂和冷漠是难以用言语来表达的。Jack的情况同样糟糕。Jack的父母都为冷血无情、阴险狡诈的大亨Terrence Karsten（James Cromwell）打工，他们同时死在一个建筑工地上，是Karsten把他养大。后来，Karsten还把自己的掌上明珠Elaine（Wendy Moniz）许配给Jack为妻。Karsten虽然能够呼风唤雨，但这些年树立了太多仇家，Jack被迫为他干许多违心的事情。Jack和Elaine的婚姻早就失去了亲密，他们现在唯一能做的就是尽尽家庭义务，照顾好一对已经16岁的双胞胎子女（Elizabeth McLaughlin、Braeden Lamasters）。\r\n    尽管一开始Sara和Jack竭力让自己循规蹈矩，但是在多次相遇之后，他们之间的相互吸引力更强烈了。生活的变化无常让他们伤痕累累，渴望得到慰藉的灵魂终于挣脱重重羁绊，一场长久的、热情似火的婚外情由此开始。\r\n    Karsten的妹夫Lou突然遭人谋杀，一切证据都显示Karsten的儿子TJ（Henry Thomas）是凶手。作为公司的首席律师，为TJ出庭辩护的任务理当由Jack来承担。但是对Sara的丈夫Drew来说，起诉这样一件知名度高的案件无疑会给他的政治前途带来莫大的好处。就这样，Sara和丈夫和情人在法庭上相见了。\r\n    Sara和Jack的私情才刚刚开始，但这种令人匪夷所思的情形迫使他们站到这起谋杀案的对立面上。随着调查的深入，案情变得越来越复杂，涉案的人员越来越多。当一次又一次背叛事件发生后，每个人都面临灾难性的后果。\r\n    该剧完全符合ABC的特点：有一点故事情节，有一点悬疑气氛，但更多是「肥皂元素」。ABC给该剧定了四个主题词：性爱、丑闻、复仇和背叛。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130930145449.jpg', '欧美', '', '0', '7', '', '1', '1384334714', '1', '0', '0', '0', '0', '1', '1', '3', '4', 'qvod', '', 'qvod://512827066|6FD655EA40E83678AA17A65D42E128518F9940A5|背叛_HDTV_01.mkv|\rqvod://513422745|DD800650021E8F446CA5B8CCAE4C9117A3B4311C|背叛_HDTV_02.mkv|\rqvod://530196723|44DBDCE95190D39074510B1251E663CB494F6CF7|背叛_HDTV_03.mkv|\rqvod://538915828|AEABF0B022F02428D6D9378504F8EC7C44FB1377|背叛_HDTV_04.mkv|\rqvod://538211775|B52AD02F9FAE3C8AC35818535A910E88AA0ED948|背叛_HDTV_05.mkv|\rqvod://536069314|9921DEB4957757C86B427527F0420B646325C507|背叛_HDTV_06.mkv|\rqvod://538637002|5AEEFB56033E1972443CFBF6F19DD211B966C397|背叛_HDTV_07.mkv|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75039', '', 'B', '', '2.0', '5', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('211', '3', '魔鬼爱人 DIABOLIK LOVERS', 'HDTV', '', '', '绿川光,梶裕贵,平川大辅,鸟海浩辅,小西克幸,近藤隆,末柄里恵', '田头しのぶ', '主人公·小森是非常普通的高中生。只是从小时候开始周围就会发生奇怪的事。比如说能看见某人的灵体，或者说发生骚灵现象。但是乐观向上的主人公却毫不在意地过着每一天。在主人公成为高二学生的时候，因为父亲的工作变动原因而转校到了一条叫神无町的街上的学校。那是一所名为“岭帝学院高校”的，为艺人和社会名流所开设的夜间学校。那是一所第一眼看上去外表华丽，却不断流传着不吉利的流言的学校。不同寻常的流言中也有“有学生被吸血鬼袭击”这样的说法。但是主人公却没有在意那些流言地转了校，并且寄宿在父亲所说的亲戚家。但是那里却是街上所传说的，最糟糕的兄弟六人所住的屋子——“妖怪屋”。突然和性格极其糟糕的帅气兄弟六人同居，而且他们还不是普通的人类——感觉有着似乎被什么吸引着一样的些微的期待，不安又恐怖的新生活开始了。', 'http://175.6.0.111:8058/vfolder//upimage/201309//20130917085223.jpg', '日本', '', '0', '8', '', '1', '1384334713', '0', '0', '0', '0', '0', '1', '1', '9', '5', 'qvod', '', '01$qvod://129649684|BCF3EAA85921F4F3B0180BA0BBE30F864012079A|魔鬼爱人_2013_HDTV_01.mp4|\r02$qvod://123620021|95399781A5E639D62A2F3C29E4FCC2EE12F26596|魔鬼爱人_2013_HDTV_02.mp4|\r03$qvod://112004449|674A4FE758B49085BD6DEF99893E4651E6502590|魔鬼爱人_2013_HDTV_03.mp4|\r04$qvod://104190163|A042521167F1606D403676D7352B033084F48901|魔鬼爱人_2013_HDTV_04.mp4|\r05$qvod://107733681|28A1C6AEF369BEC0FD63A3B75060366BC9585E71|魔鬼爱人_2013_HDTV_05.mp4|\r06$qvod://88897184|9C2033205A5E5D8FE3DE0F2EDF13F4862525B5A2|魔鬼爱人_2013_HDTV_06.mp4|\r6$qvod://237082165|41F1EF4980F2B61360BCBA8DB110E1F23FF76D21|魔鬼爱人_2013_HDTV_6.5.mkv|\r07$qvod://99431082|0802B5743BE0A6B0277F92115E8CBB85F3146969|魔鬼爱人_2013_HDTV_07.rmvb|\r08$qvod://99437904|9CDAFA4B89B24A131C3A443CA9F93F5AF5471671|魔鬼爱人_2013_HDTV_08.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=74625', '', 'M', '', '9.0', '8', '1', '0', '0', '0');
