INSERT INTO `ff_vod` VALUES ('213', '4', '万里寻爸', 'TV', '', '', '姚嘉妮,郑丹瑞', '未知', '为了生计，爸爸不惜离乡别井，远赴他方工作。一个个年纪小小的心灵充满著对爸爸的思念，他们会如何独自高飞，展开万里寻爸之旅，为彼邦的爸爸送上突如其来的惊喜？一对对父子、父女久别重逢，是千言万语说不尽，是幕幕惊喜，是感动落泪，还是欢欣无限。 一个个日本小孩飞越万里长空，分别远赴智利、不丹、摩洛哥、阿拉斯加、荷兰、孟加拉等十多个不同国家，为爸爸送上惊喜之餘，亦写下一段段真挚感人的故事。为人父母对此当然感受至深，所以节目请来郑丹瑞和姚嘉妮担任主持，并有林盛斌、麦长青等多位艺人轮流担任嘉宾。除了一同细心欣赏每个寻找爸爸的过程，见证小朋友们为爸爸付出泪水与汗水，曾因为工作而长期不能陪伴子女成长的他们，还会以过来人身份畅谈与子女离别的情怀。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105083213.jpg', '香港', '', '0', '2', '', '1', '1384334719', '9', '0', '0', '0', '0', '1', '1', '8', '1', 'qvod', '', '01$qvod://259189814|E6C2FE566B334632BE09F6604797A51ED7F40FB1|万里寻爸_TV_01.rmvb|\r02$qvod://267555990|58B91D3682130CF8F3B4D0B0D2B9EC0D00E0B993|万里寻爸_TV_02.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76097', '', 'W', '', '4.0', '2', '1', '0', '0', '0');
INSERT INTO `ff_vod` VALUES ('214', '16', 'On Call 36小时2[粤语]', 'HDTV', '', '', '马国明,吴启华,杨怡', '潘嘉德', '各司其职、各安其位，医院内无论哪一个工作岗位，都是保护生命的斗士。\r\n    面对着垂危的病人、带病有孕的子妤，一健执着地要把一切全都扛在肩上，沉重得令他难以喘息。此时再遇上意见不合、封刀多时的大国手洛彦笙，而子妤又病发流产，被逼放弃外科医生的岗位，这一切都让一健在人生路途上受到莫大的冲击。\r\n    子妤为了让一健明白到放下执着、活在当下的真谛，毅然转科重新学习。一健霎时难以接受，但看着从前的沛聪、美雪、晶晶等人日渐成长，各大自成为独当一面的医生，在洛彦笙与子妤启发与鼓励下，一健终于明白到一个医生就如一位斗士，要知道自己的能力，守着自己的岗位，才能保卫别人的生命。', 'http://175.6.0.111:8058/vfolder//upimage/201311//20131105083800.jpg', '香港', '', '0', '1', '', '1', '1383714835', '5', '0', '0', '0', '0', '1', '1', '1', '6', 'qvod', '', 'qvod://317299339|DA7C7FB0E9934BD0E7BFACC8B3EAED3581927E8F|On.Call.36小时2.粤语_HDTV_01.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=76098', '', 'O', '', '3.0', '1', '1', '0', '0', '0');
