INSERT INTO `ff_vod` VALUES ('216', '4', '玩转世界杯', 'TV', '', '', '何傲儿,吴家乐,李思雅,张秀文', '未知', '四年一度的世界盃盛事，「TVB主场，大家有份！」 为了迎接热爆全城的巴西世界盃，无綫电视除了独家直播决赛週赛事之外，开赛前夕还会精心炮製多个世界盃前奏节目。《玩转世界盃》率先抢点进攻，和球迷一起热热身，鬆鬆脑袋、筋骨、脚头，迎接世界盃带来的兴奋衝击！ 节目将搞笑、娱乐、资讯、游戏、竞技等元素共冶一炉，主持吴家乐、黎国辉（阿感）、陈国峰（Penny）、何傲儿、李思雅与张秀文发挥团队精神，穿梭港九新界各区，邀请各路足球人马接受大挑战，参与各项技术测试，赢取现金奖励！此外，一班热爱足球的艺员组成「TVB足球队」，与来自不同组织或单位的球迷「以波会友」，上演多场形式、规则均没有特定限制的友谊赛，切磋球技同时广结球友，於球场上擦出激情火花！ 主持还会以戏剧、说故事、补习课、做实验等不同形式，送上丰富的足球及世界盃知识，务求以轻鬆、活泼手法，全方位解构绿茵场上的球人球事。另外，多名来自非足球界的嘉宾会代表所属界别的「身位」，以崭新另类角度，畅谈他们心目中的世界盃，以及世界盃所引发的各种现象。', 'http://175.6.0.111:8058/vfolder//upimage/201310//20131022195447.jpg', '香港', '', '0', '4', '', '1', '1384334717', '3', '0', '0', '0', '0', '1', '1', '3', '4', 'qvod', '', '01$qvod://136518098|7D04253E4C01415798D63BF956AC0C2DFD279090|玩转世界杯_TV_01.rmvb|\r02$qvod://123968719|9D86457DD616BF1BDE60D0FEC83E1D733AB52045|玩转世界杯_TV_02.rmvb|\r03$qvod://142562412|97E8C98901C2B44503FE2B7967CFBB689FF6F14B|玩转世界杯_TV_03.rmvb|\r04$qvod://138780440|DAF6150AA7D79FCD86EF10CA5AB009BB9E080E12|玩转世界杯_TV_04.rmvb|', 'xml_3', 'http://zy.gvod.net/Video.aspx?Videoid=75727', '', 'W', '', '1.0', '1', '1', '0', '0', '0');
